INSERT INTO `item_text` VALUES (1,1,'de','Trank','Stellt einen kleinen Teil der Gesundheit wieder her.'),(2,1,'en','Potion','Restores a small amount of health.'),(3,2,'de','Mega-Trank','Stellt einen grossen Teil der Gesundheit wieder her.'),(4,2,'en','Mega Potion','Restores a moderate amount of health.'),(5,3,'de','Maxi-Trank','Stellt Gesundheit vollständig wieder her und maximiert den Gesundheitsbalken.'),(6,3,'en','Max Potion','Fully restores health and maximizes the size of your Health Gauge.'),(7,4,'de','Uralter Trank','Stellt Gesundheit sowie Ausdauer wieder her und maximiert deren Balken.'),(8,4,'en','Ancient Potion','Fully restores health and maximizes the size of your Health and Stamina Gauges.'),(9,5,'de','Gegengift','Der Name sagt alles: Dieses Objekt ist ein Gegengift.'),(10,5,'en','Antidote','A cure for poison.'),(11,6,'de','Kräutermedizin','Entfernt alle Giftstoffe und stellt Gesundheit geringfügig wieder her.'),(12,6,'en','Herbal Medicine','Removes all traces of poison and restores a slight amount of health.'),(13,7,'de','Nullbeere','Eine geheimnisvolle Beere, die verschiedene Pestarten heilt.'),(14,7,'en','Nulberry','A mysterious berry that cures various blights.'),(15,8,'de','Energy-Drink','Ein von der Gilde geprüftes Getränk, das die Ausdauer stärkt. Es hilft ausserdem gegen Müdigkeit!'),(16,8,'en','Energy Drink','A Guild-approved beverage that boosts your stamina. Helps shake off sleep, too!'),(17,9,'de','Ration','Essen, das etwas Ausdauer wiederherstellt.'),(18,9,'en','Ration','Food that restores a bit of stamina.'),(19,10,'de','Blutiges Steak','Ermöglicht eine mittlere Steigerung der Ausdauer. Das Fleisch ist noch rot in der Mitte.'),(20,10,'en','Rare Steak','Provides a moderate boost to your stamina. This one\'s still red in the middle.'),(21,11,'de','Gebratenes Steak','Ermöglicht eine mittlere und dauerhaftere Steigerung der Ausdauer. Ein gut zubereitetes Stück Fleisch.'),(22,11,'en','Well-done Steak','Provides a moderate boost to your stamina and keeps it at max for a longer period. Meat done right!'),(23,12,'de','Verkohltes Fleisch','Ermöglicht eine geringe Steigerung der Ausdauer. Ein wenig bitter, kann aber schnell gegessen werden.'),(24,12,'en','Burnt Meat','Provides a small boost to your stamina. Can be eaten quickly.'),(25,13,'de','Kaltgetränk','Schützt dich vorübergehend vor extremer Hitze.'),(26,13,'en','Cool Drink','Provides temporary relief from extreme heat.'),(27,14,'de','Nährstoffe','Erhöht die maximale Gesundheitsstufe sehr geringfügig.'),(28,14,'en','Nutrients','Very slightly increases your maximum health level.'),(29,15,'de','Mega-Nährstoffe','Erhöht die maximale Gesundheitsstufe geringfügig.'),(30,15,'en','Mega Nutrients','Slightly increases your maximum health level.'),(31,16,'de','Immunisierer','Verbessert deine natürlichen Heilkräfte.'),(32,16,'en','Immunizer','Boosts your natural ability to heal.'),(33,17,'de','Astera-Jerky','Getrocknetes Fleisch aus Astera. Stärkt die natürlichen Heilungskräfte und stoppt Blutungen.'),(34,31,'en','Honey','Highly nutritious honey. Combine this with Potions to craft Mega Potions for maximum potency.'),(35,17,'en','Astera Jerky','Juicy, dried meat made by Astera\'s chef. Boosts natural healing and cures bleeding.'),(36,18,'de','Sprintsaft','Verringert Ermüdungserscheinungen. Reduziert die Ausdauerabnahme kurzzeitig.'),(37,18,'en','Dash Juice','Dulls one\'s sense of exhaustion. Reduces stamina depletion for a time.'),(38,19,'de','Machtsamen','Steigert vorübergehend deine Angriffskraft durch besseren Energiefluss.'),(39,32,'de','Kraut','Eine Hauptzutat von Tränken.'),(40,19,'en','Might Seed','Temporarily strengthens your attacks when ingested by improving energy flow.'),(41,32,'en','Herb','A primary ingredient in potions.'),(42,20,'de','Dämonenmittel','Verbessert deinen Angriff und erfüllt dich mit – na was wohl? Dämonenkraft!'),(43,20,'en','Demondrug','Boosts your attack power by filling you with—guess what?—demonic strength.'),(44,33,'de','Gegengiftkraut','Eine Hauptzutat von Gegengiften.'),(45,21,'de','Mega-Dämonenmittel','Verbessert deine Angriffskraft noch mehr als das Dämonenmittel.'),(46,21,'en','Mega Demondrug','Boosts your attack power even more than a regular Demondrug.'),(47,33,'en','Antidote Herb','A primary ingredient in antidotes.'),(48,34,'de','Feuerkraut','Eine erstaunliche entflammbare Pflanze, die zur Herstellung von Sprengstoffen verwendet wird.'),(49,34,'en','Fire Herb','A wondrous, flammable plant. Useful for crafting explosives.'),(50,35,'de','Flussfarn','Die Blätter dieser Pflanze speichern viel Wasser und sind eine Komponente für Wasser-Munition.'),(51,22,'de','Machtpille','Verleiht dir vorübergehend die Kraft eines mächtigen Gottes. Sehr wirksam!'),(52,35,'en','Flowfern','This plant\'s leaves store a great amount of water. A component for making Water Ammo.'),(53,36,'de','Schneekraut','Eine Pflanze, die eiskalte Luft verströmt und zur Herstellung von Frost-Munition verwendet wird.'),(54,36,'en','Snow Herb','A plant that radiates ice-cold air. Use in combinations to create freeze ammo.'),(55,37,'de','Schlafkraut','Eine Pflanze, die einschläfernde Substanzen enthält und zur Herstellung von Beruhigungsmitteln verwendet wird.'),(56,22,'en','Might Pill','Temporarily endows you with the strength of a mighty god. Potent!'),(57,37,'en','Sleep Herb','A plant containing sleeping agents. Used to craft tranquilizers.'),(58,23,'de','Diamantsamen','Steigert durch die Einnahme vorübergehend die Verteidigung, indem es zu Gewebeverhärtungen kommt.'),(59,92,'de','Panzeramulett','Ein Amulett, das die Verteidigung stärkt. Wenn du es trägst, macht es deine Haut so hart wie Stein.'),(60,38,'de','Efeu','Eine leichte und extrem robuste Pflanze. Sie wird zur Herstellung von Netzen für Fallgruben verwendet.'),(61,145,'de','Finsteres Tuch','Ein verdächtiges Tuch, das die Schnurrtrupp-Safari weiss der Geier wo aufgegabelt hat. Es trieft vor Bösartigkeit.'),(62,23,'en','Adamant Seed','Temporarily raises your defense when ingested by hardening tissue.'),(63,38,'en','Ivy','A lightweight and extremely strong plant. Used to make nets for pitfall traps.'),(64,24,'de','Panzerhaut','Verbessert die Verteidigung, indem sie deine Haut hart wie Stein werden lässt.'),(65,24,'en','Armorskin','Boosts your defense by turning your skin as hard as rock.'),(66,39,'de','Rauchnuss','Eine Nuss, die dichten Rauch erzeugt. In Kombination mit anderen Objekten erzeugt sie verschiedene Raucharten.'),(67,145,'en','Sinister Cloth','Suspect cloth the Tailraider Safari dug up from who-knows-where. Drips with an aura of pure evil.'),(68,25,'de','Mega-Panzerhaut','Verbessert deine Verteidigung noch mehr als die normale Panzerhaut.'),(69,39,'en','Smokenut','A nut that produces a copious amount of smoke. Combine with other items to create smoke with various properties.'),(70,92,'en','Armorcharm','An amulet that increases defense. Just carrying this hardens your skin like stone.'),(71,146,'de','Monsterknochen S','In Fossilienansammlungen gefundenes Material. Unverzichtbar für den Gebrauch auf der Jagd und im Alltag.'),(72,25,'en','Mega Armorskin','Boosts your defense even more than a regular armorskin.'),(73,93,'de','Panzerkralle','Ein Talisman, der die Verteidigung erhöht. Dieser Effekt wird durch enthaltene Drachenteile verstärkt.'),(74,40,'de','Drachentod-Beere','Eine geheimnisvolle Beere, die zur Herstellung von Drachen-Munition verwendet wird.'),(75,26,'de','Diamantpille','Eine Pille, die deine Haut vorübergehend diamanthart macht. Sehr wirkungsvoll!'),(76,146,'en','Monster Bone S','A material found in bonepiles. Indispensable for both hunting and daily life.'),(77,40,'en','Dragonfell Berry','A mysterious berry, rumored for eons to be loathed by dragons. Required to craft Dragon Ammo.'),(78,93,'en','Armortalon','A charm that increases defense. Its effects are amplified by the dragon parts it contains.'),(79,26,'en','Adamant Pill','Temporarily makes your skin as hard as adamant. Potent!'),(80,147,'de','Monster