ve power with every beat.'),(2650,1290,'de','Flor-Ticket','Ein für die Teilnahme am Flor-Fest erhaltenes Ticket; wird gegen andere Dinge eingetauscht.'),(2651,1290,'en','Full Bloom Ticket','A ticket you receive for attending the Full Bloom Fest. Can be exchanged for special equipment or items.'),(2652,1291,'de','Wetzfisch-Ticket','Ein Ticket des Fischforschers mit Wetzfischen; kann bei der Schmiede eingelöst werden.'),(2653,1291,'en','Whetfish Ticket','A ticket from the Piscine Researcher, with various Whetfish prints. Show it to the Smithy and see what happens!'),(2654,1292,'de','KT Goldene Schuppe+','Sehr seltenes Kulve-Taroth-Material, meist als Belohnung erhalten. Viele sind für nur ein Exemplar gefallen.'),(2655,1292,'en','Kulve Taroth Golden Scale+','Very rare Kulve Taroth material. Mostly obtained as a reward. Many have fallen trying to obtain just one of these.'),(2656,1293,'de','KT Goldener Panzer+','Sehr seltenes Kulve-Taroth-Material, meist als Belohnung erhalten. Wegen seines goldenen Scheins wertvoll.'),(2657,1293,'en','Kulve Taroth Golden Shell+','Very rare Kulve Taroth material. Mostly obtained as a reward. Its value is tied to its brilliant gold shine.'),(2658,1294,'de','KT Goldener Klumpen+','Sehr seltenes Kulve-Taroth-Material. Wird selten mal fallengelassen und leuchtet exotisch.'),(2659,1294,'en','Kulve Taroth Golden Nugget+','Very rare Kulve Taroth material. Obtained from rare drops. Emits an exotic light to those that look at it.'),(2660,1295,'de','KT Goldenes Spiralhorn+','Sehr seltenes Kulve-Taroth-Material, erhalten durch das Brechen des Kopfs. Glüht trotz des Alters und Gewichts.'),(2661,1295,'en','Kulve Taroth Golden Spiralhorn+','Very rare Kulve Taroth material. Obtained by breaking its head. It glows despite its age and weight.'),(2662,1296,'de','KT Goldener Schwanzpanzer+','Sehr seltenes Kulve-Taroth-Material, erhalten durch das Brechen des Schwanzes. Schimmert gülden.'),(2663,1296,'en','Kulve Taroth Golden Tailshell+','Very rare Kulve 