INSERT INTO `quest_text` VALUES (1,101,'de','Die Jagras des Uralten Waldes','Töte sieben Jagras.','Das Erscheinen des Zorah Magdaros hat im lokalen Ökosystem Veränderungen verursacht. Begib dich ins Jagras-Gebiet zum Nachforschen und töte sie, wenn nötig.'),(2,101,'en','Jagras of the Ancient Forest','Slay 7 Jagras','Zorah Magdaros\'s appearance has brought about changes in the local ecosystem. Head into Jagras territory to investigate, and take them out if necessary.'),(3,102,'de','Das Kestodon-Gedöns','Schliesse die Aufgabe ab.','Durch das Erscheinen des Zorah Magdaros ist eine Herde von Kestodons in ein neues Gebiet gewandert. Du musst los und die Herde der Kopfnüssler ausdünnen.'),(4,102,'en','A Kestodon Kerfuffle','Complete the assignment','Zorah Magdaros\'s appearance has driven a herd of Kestodon to new territory. We\'ll need you to go out and thin that herd of head-butters.'),(5,103,'de','Die Gross-Jagras-Jagd','Erjage einen Gross-Jagras.','Was ich nicht in meinen täglichen Bericht schreiben möchte: \"Forscher komplett von Gross-Jagras verschluckt.\" Vernichte ihn, bevor ich das wirklich schreiben muss!'),(6,103,'en','The Great Jagras Hunt','Hunt a Great Jagras','Things I\'m not interested in writing in my daily report: \"Researchers swallowed whole by Great Jagras.\" Take it out before I actually have to write it!'),(7,151,'de','Kopfnüsse mit der Natur','Töte zwölf Kestodons.','Verdammte Kestodons! Jedes Mal, wenn wir Proben sammeln wollen, kommen uns diese nervigen Wesen in die Quere! Ich wünschte, sie hielten sich aus unserer Forschung raus!'),(8,151,'en','Butting Heads with Nature','Slay 12 Kestodon','Blasted Kestodon! Every single time we go out to collect samples, those annoying creatures knock us on our tushes! I wish they\'d butt out of our research!'),(9,152,'de','Ein schlagendes Argument','Töte sieben Jagras.','Einer meiner Feldforscher möchte Leuchtmoos sammeln und studieren. Es wird meist in Höhlen gefunden. Was findet man noch meistens in Höhlen? Richtig... Jagras!'),(10,152,'en','A Thicket of Thugs','Slay 7 Jagras','One of my field researchers wants to collect brightmoss to study. Only problem is, it\'s mostly found in caves. Guess what else is mostly found in caves? That\'s right...Jagras!'),(11,302,'de','Unheimliche Schatten im Sumpf','Schliesse die Aufgabe ab.','Ein junger Gelehrter wurde in der Wildturm-Ödnis von seiner Eskorte getrennt. Finde ihn und bring ihn zurück zur Basis. Schalte grosse Monster aus, die eine Bedrohung darstellen.'),(12,153,'de','Pilzeinsatz im Uralten Wald','Liefere 20 Gourmet-Pilzhüte.','Ergänzungsmittel? In meiner Kantine? Hier ist alles Bio! Wenn du Vitamin D brauchst, brauche ich Gourmet-Pilzhüte! *Der 1. Abschluss schaltet eine neue Kantinenzutat frei.'),(13,153,'en','Fungal Flexin\' in the Ancient Forest','Deliver 20 Gourmet Shroomcaps','Supplements? At MY Canteen? Pfft! We\'re all organic, baby! If you need vitamin D, get some Gourmet Shroomcaps! *Unlocks a new Canteen ingredient on first time completion.'),(14,201,'de','Bandit mit Vogelhirn','Erjage einen Kulu-Ya-Ku.','Der Kulu-Ya-Ku nutzt seine Vorderbeine zum Tragen von Objekten. So kann er wichtige Vorräte entwenden. Erster Schritt beim Wiederaufbau eines sicheren Lagers: Den Dieb jagen!'),(15,201,'en','Bird-Brained Bandit','Hunt a Kulu-Ya-Ku','The Kulu-Ya-Ku uses its dexterous forearms to carry objects. Left unchecked it\'s liable to run off with crucial supplies. Step one of rebuilding a secure camp is hunting that thief!'),(16,205,'de','Dringend: Pukei-Pukei-Jagd','Erjage einen Pukei-Pukei.','Der Pukei-Pukei ist nicht über die Schlacke in seinem Gebiet erfreut. Es wird ihn noch weniger freuen, wenn wir Gelehrte zum Forschen schicken. Er muss wohl getötet werden.'),(17,302,'en','Sinister Shadows in the Swamp','Complete the assignment','A young scholar has gotten separated from his escort out in the Wildspire Waste. Find him and escort him back to base. Neutralize any large monsters that pose a threat.'),(18,205,'en','Urgent: Pukei-Pukei Hunt','Hunt a Pukei-Pukei','That Pukei-Pukei is none too pleased to have that slag in its territory. It\'ll be even less pleased if we send in our scholars to research it. Looks like we have to put it down.'),(19,241,'de','Erlernen der Klammerklaue','Lerne, wie die Klammerklaue funktioniert.','Der alte Mann meinte, Jäger in der Neuen Welt müssen innovativ bleiben, deshalb ist die Klammerklaue eine neue Funktion der Schleuder. Es wird Zeit, dass du den Umgang damit lernst.'),(20,305,'de','Fliegende Funken: Tobi-Kadachi','Erjage einen Tobi-Kadachi.','Dieser Tobi-Kadachi kommt uns wirklich in die Quere! Ihr Jäger werdet meine Spezialwerkzeuge nie bekommen, wenn er mich zum Abendessen verspeist!'),(21,241,'en','Learning the Clutch','Learn the mechanics of the clutch claw','The old man said that New World hunters need to keep innovating, and our latest innovation is the clutch claw, a new feature of the slinger. Time for you to get up to snuff on how to use it.'),(22,305,'en','Flying Sparks: Tobi-Kadachi','Hunt a Tobi-Kadachi','Oh, my! That Tobi-Kadachi sure is getting in the way of progress! You hunters will never get a hold of these specialized tools I\'m making if I become its dinner!'),(23,251,'de','Der grosse Vielfrass','Erjage einen Gross-Jagras.','Mittlerweile hast du sicher gesehen, wie Gross-Jagras ihre Beute komplett verschlingen. Im Wald wurde einer entdeckt. Töte ihn, bevor einer meiner Forscher verspeist wird!'),(24,306,'de','Der nahende Anjanath','Erjage einen Anjanath.','Während wir uns auf den Fang des Zorah Magdaros vorbereiten, müssen wir Astera so weit wie möglich absichern. Es ist riskant, wenn der Anjanath der Basis so nahekommt.'),(25,251,'en','The Great Glutton','Hunt a Great Jagras','I\'m sure by now you\'ve seen the way Great Jagras swallow its prey whole. One\'s been spotted again in the forest. Take it out before one of my researchers gets gobbled up!'),(26,306,'en','The Encroaching Anjanath','Hunt an Anjanath','As we\'re gearing up to capture Zorah Magdaros, we need to secure Astera as much as we can. It\'s too much of a risk to have that Anjanath roaming so close to base.'),(27,252,'de','Der Lager-Eindringling','Erjage einen Kulu-Ya-Ku.','Neulich entdeckte einer meiner Forscher morgens, dass sein Lager von einem diebischen Kulu-Ya-Ku geplündert wurde. Tu was, bevor noch ein Lager dran glauben muss!'),(28,331,'de','Spezialarena: Pukei-Pukei','Erjage einen Pukei-Pukei.','Ein neuer Herausforderer: Pukei-Pukei – der Giftraufer, die Prügelmaschine! Er gibt niemals auf! Nimm dieses Schwergewicht nicht auf die leichte Schulter!'),(29,331,'en','Special Arena: Pukei-Pukei','Hunt a Pukei-Pukei','A new challenger: Pukei-Pukei, the Toxic Tussler, the Lickin\' Machine! He won\'t listen when you say \"no tongues\"! Think you can go toe-to-toe—er, toe-to-claw with this heavy hitter!?'),(30,252,'en','Camp Crasher','Hunt a Kulu-Ya-Ku','The other morning one of my researchers woke to his camp having been pilfered by one of those thieving Kulu-Ya-Ku. Do something about it before it ransacks another camp!'),(31,482,'de','Eine verweste Sache','Erjage einen Gross-Girros.','Ich h-h-habe im T-Tal der Verwesung gearbeitet, als m-mich ein G-G-Gross-Girros von hinten angriff. Ich h-habe überlebt, aber es k-kribbelt noch... Beende meine Arbeit? B-Bitte!'),(32,332,'de','Spezialarena: Barroth','Erjage einen Barroth.','Ein neuer Herausforderer: Barroth – der Kopfnusskoloss, der Schädelspalter! Verlieren verboten! Nimm dieses Schwergewicht nicht auf die leichte Schulter!'),(33,261,'de','Schnapp den Schnapper','Fange einen Kulu-Ya-Ku.','Der Kulu-Ya-Ku nutzt seine flinken Unterarme, um Steine und Eier aufzuheben. Monster, die Werkzeuge nutzen, sind sehr selten. Fang mir einen für eine Studie.'),(34,332,'en','Special Arena: Barroth','Hunt a Barroth','A new challenger: Barroth, the Hulking Headbutt, the Skull-cracker! Lose to this guy, and your name is mud! Think you can go toe-to-toe—er, toe-to-claw with this heavy hitter!?'),(35,261,'en','Snatch the Snatcher','Capture a Kulu-Ya-Ku','The Kulu-Ya-Ku uses its nimble forearms to pick up stones and eggs. Monsters that use tools are exceptionally rare. I\'d like you to catch one for closer study.'),(36,482,'en','A Rotten Thing To Do','Hunt a Great Girros','I was work-k-king the Rotten V-Vale when a G-G-Great Girros z-z-zapped me from behind. I g-got out in one piece, but I\'m still all t-t-tingly... Finish the j-j-job for me? P-Please!'),(37,333,'de','Spezialarena: Tobi-Kadachi','Erjage einen Tobi-Kadachi.','Ein neuer Herausforderer: Tobi-Kadachi – die Sprungechse, der Bissmeister! Macht dich mit Donnerschlag fertig! Nimm dieses Schwergewicht nicht auf die leichte Schulter!'),(38,262,'de','Der Preis von Fleiss','Töte sieben Gajaus.','Meine Tatz-ritis macht mir mal wieder Sorgen. Was dagegen hilft? Eigentlich nur Gajau-Lebertran... *Der 1. Abschluss schaltet eine neue Kantinenzutat frei.'),(39,333,'en','Special Arena: Tobi-Kadachi','Hunt a Tobi-Kadachi','A new challenger: Tobi-Kadachi, the Leaping Lizard, the Bite-master! He\'ll clean your clock with thunder shocks! Think you can go toe-to-toe—er, toe-to-claw with this heavy hitter!?'),(40,483,'de','Knochenarbeit','Erjage einen Radobaan.','Es ist fast unmöglich, dass unsere Forscher Fossilien im Tal der Verwesung studieren, weil dieser verdammte Radobaan ihnen immer in die Quere kommt...'),(41,351,'de','Der Streunuss-Mangel','Erjage einen Pukei-Pukei.','Ein Pukei-Pukei muss aufgetaucht sein, denn es wird immer schwieriger, Streunüsse zu sammeln! Wir können sie nicht studieren, wenn alle unsere Exemplare mit Gift bedeckt sind!'),(42,262,'en','The Pain from Gains','Slay 7 Gajau','My paw-thritis is acting up again. Years of Palico-ing will do that to you. The best remedy? Good ol\' Gajau liver oil! *Unlocks a new Canteen ingredient on first time completion.'),(43,483,'en','A Bone to Pick','Hunt a Radobaan','It\'s nearly impossible for any of our researchers to study fossils in the Rotten Vale because they keep getting stuck to that blasted Radobaan rolling around down there...'),(44,351,'en','Scatternut Shortage','Hunt a Pukei-Pukei','A Pukei-Pukei must have shown up because it\'s getting more and more difficult to gather scatternuts! We can\'t study them if the only specimens we can gather are covered in poison!'),(45,263,'de','Kammerjäger der Ödnis','Töte 14 Vespoiden.','Du musst raus in die Wildturm-Ödnis und ein paar Vespoiden für mich veröden, diese Boxsäcke mit Flügeln. *Der 1. Abschluss schaltet eine neue Kantinenzutat frei.'),(46,652,'de','Glubschäugiges grünes Monster','Erjage einen Pukei-Pukei.','Wir haben einen beunruhigenden Bericht über einen besonders starken Pukei-Pukei im Uralten Wald erhalten. Nimm schnell die Untersuchung auf, aber Vorsicht vor seinem Gift!'),(47,263,'en','Exterminator of the Waste','Slay 14 Vespoid','I need you to go out to the Wildspire Waste and waste a few Vespoids...or as I like to call them, punchin\' bags with wings. *Unlocks a new Canteen ingredient on first time completion.'),(48,301,'de','Die beste Art von Quest','Schliesse die Aufgabe ab.','In der Wildturm-Ödnis wurde etwas entdeckt, das wohl der Zorah Magdaros zurückgelassen hat. Jäger der Fünften: Schütz unsere Gelehrten, wenn du sie zur Untersuchung eskortierst.'),(49,301,'en','The Best Kind of Quest','Complete the assignment','Something surely left by Zorah Magdaros was discovered out in the Wildspire Waste. Fifth Fleet hunters: Keep our scholars safe as you escort them out to investigate this new evidence.'),(50,652,'en','Googly-eyed Green Monster','Hunt a Pukei-Pukei','We\'ve gotten a disturbing report of an unusually powerful Pukei-Pukei appearing in the Ancient Forest. Begin your investigation ASAP, but beware its poisonous attacks!'),(51,484,'de','Albtraumartige Flügel','Töte fünf Raphinos.','Wir von der 2. Flotte haben neue Werkzeuge entwickelt, die dir auf deinen Jagden helfen. Aber du musst das Material besorgen. Wir zählen darauf, dass du diese Quest annimmst.'),(52,653,'de','Ein haarsträubendes Erlebnis','Erjage einen Tobi-Kadachi.','Wir haben einen beunruhigenden Bericht über einen besonders starken Tobi-Kadachi im Uralten Wald erhalten. Nimm schnell die Untersuchung auf, aber Vorsicht, er ist blitzschnell!'),(53,484,'en','On Nightmare\'s Wings','Slay 5 Raphinos','Here at the Second Fleet, we\'ve been working to develop new tools to help your hunts, but we need YOUR help gathering the materials. We\'re counting on you to take this quest!'),(54,501,'de','In den Tiefen des Tals','Schliesse die Aufgabe ab.','... Tief unten lauert der Tod, genau wie der Schlüssel zum Auffinden des Zorah Magdaros. Ein fairer Handel, finde ich.'),(55,352,'de','Unter Strom','Erjage einen Tobi-Kadachi.','Fass mich nicht an! Fass mich nicht an! *zap* Ich sag doch, fass mich nicht an! Ein verdammter Tobi-Kadachi ist gekommen, jetzt kann ich nichts anfassen, ohne-- *ZAP* AUA!'),(56,352,'en','The Current Situation','Hunt a Tobi-Kadachi','Don\'t touch me! Don\'t touch me! *zap* I told you NOT TO TOUCH ME! A blasted Tobi-Kadachi has shown up and now I can\'t touch anything without getting— *ZAP* OUCH!'),(57,751,'en','Rathalos Rematch','Hunt a Rathalos','We\'ve gotten a disturbing report of another unusually powerful Rathalos in the Ancient Forest. Let that red beast know who REALLY stands atop the food chain here!'),(58,361,'de','Beschmutzt in der Ödnis','Erjage einen Barroth','Die Trägerameisen in der Wildturm-Ödnis sind ungewöhnliche Ingenieure. Wir wollten sie näher untersuchen, aber ein Barroth ist erschienen und hat alles in den Dreck gezogen.'),(59,752,'de','Rathalos in Blau','Erjage einen Azurnen Rathalos.','Das Feldteam hat beobachtet, wie ein Azurner Rathalos am Himmel patrouilliert ist. Unterarten wie diese sind für die Forschung der Kommission unglaublich wichtig, also los!'),(60,653,'en','A Hair-Raising Experience','Hunt a Tobi-Kadachi','We\'ve gotten a disturbing report of an unusually powerful Tobi-Kadachi appearing in the Ancient Forest. Begin your investigation ASAP, but beware its lightning speed!'),(61,361,'en','Mired in the Spire','Hunt a Barroth','The Carrier Ants out in the Wildspire Waste are extraordinary engineers. We\'ve been trying to further our research of them but a Barroth appeared and mucked up our entire operation.'),(62,654,'de','Bloss nicht bewegen','Erjage einen Anjanath.','Wir haben einen beunruhigenden Bericht über einen besonders starken Anjanath im Uralten Wald erhalten. Nimm schnell die Untersuchung auf, aber Vorsicht vor seinem Feuer!'),(63,501,'en','Into the Bowels of the Vale','Complete the assignment','...... Certain death awaits you in the depths, but so does the key to finding Zorah Magdaros. A fair trade-off if you ask me.'),(64,362,'de','Das Fisch-Problem','Erjage einen Jyuratodus.','Die Eisen-Helmkrabbe ist ein faszinierendes Wesen. Dreh eine um, dann kommt eine Stechkapsel heraus. Wir möchten sie studieren, aber nicht mit einem Jyuratodus in der Nähe!'),(65,654,'en','It Can\'t See You if You Don\'t Move','Hunt an Anjanath','We\'ve gotten a disturbing report of an unusually powerful Anjanath appearing in the Ancient Forest. Begin your investigation ASAP, but beware its fiery attacks!'),(66,362,'en','The Piscine Problem','Hunt a Jyuratodus','The Iron Helmcrab is such a fascinating creature. Just kick it over and out pops a piercing pod! We\'d love to study them more but not with a Jyuratodus lurking about!'),(67,655,'de','Die schlafende Waldkönigin','Erjage eine Rathian.','Aufgrund eines stark veränderten Ökosystems verlassen die Monster ihre angestammten Lebensräume. Geh in den Uralten Wald und untersuche die eindringende Rathian!'),(68,363,'de','Eine stachelige Situation','Liefere 20 Narrenkakteen.','Die einheimischen Pflanzen in der Ödnis helfen sicher bei der Zucht Uralter Bäume. Du musst beim Sammeln helfen! *1. Abschluss schaltet ein Botanisches Forschungsobjekt frei.'),(69,752,'en','Rathalos in Blue','Hunt an Azure Rathalos','The field team has spotted an Azure Rathalos patroling the skies. Subspecies like these are highly valuable to the Commission\'s research efforts. Get going, hunter!'),(70,655,'en','The Sleeping Sylvan Queen','Hunt a Rathian','A major change in the ecosystem is driving monsters from their natural habitats. Head to the Ancient Forest and begin your investigation of the invading Rathian immediately!'),(71,363,'en','Prickly Predicament','Deliver 20 Bauble Cactuses','I\'m confident the plants native to the waste will help us grow our Ancient Trees, but I need your help gathering them! *Unlocks a Botanical Research item on first time completion.'),(72,753,'de','Das rote und das blaue Team','Erjage alle Zielmonster.','Wir von der 2. Flotte haben neue Werkzeuge entwickelt, die dir auf deinen Jagden helfen. Aber du musst das Material besorgen. Wir zählen darauf, dass du diese Quest annimmst.'),(73,502,'de','Feuriger Thron über dem Wald','Erjage einen Rathalos.','Der Erste Wyverianer sagt nichts zum Zorah, bis wir in der Nahrungskette ganz oben stehen. Deshalb müssen wir einen Rathalos erjagen! Können wir ihn dann auch essen?!'),(74,753,'en','The Red and Blue Crew','Hunt all target monsters','Here at the Second Fleet, we\'ve been working to develop new tools to help your hunts, but we need YOUR help gathering the materials. We\'re counting on you to take this quest!'),(75,502,'en','A Fiery Throne Atop the Forest','Hunt a Rathalos','The First Wyverian\'s not gonna spill the beans about Zorah until we stand on top of the food chain. That means we gotta hunt us a Rathalos! ...Does that mean we have to eat it too?'),(76,656,'de','Gewohnheitstiere','Fange einen Tobi-Kadachi.','Die drei verrückten alten Gelehrten wollen einen LEBENDEN Tobi-Kadachi erforschen. Fang ihn, bevor sie sich wehtun! *Der 1. Abschluss schaltet eine neue Kantinenzutat frei.'),(77,761,'de','Die rosa Schönheit','Erjage eine Rosa Rathian.','Das Feldteam hat beobachtet, wie eine Rosa Rathian einigen lokalen Kreaturen nachgestellt hat. Unterarten wie diese sind für die Forschung der Kommission unglaublich wichtig, also los!'),(78,364,'de','Nur das Gelbe in der Ödnis','Liefere zwei Pflanzenfresser-Eier.','Bereit für ordentlich Beintraining?! Gut! Die brauchst du, wenn du vor der Apceros-Herde wegläufst! Jetzt besorg mir mein Pfo-tein! *Der 1. Abschluss schaltet eine neue Kantinenzutat frei.'),(79,503,'de','Gehörnter Tyrann unter dem Sand','Erjage einen Diablos.','Der Erste Wyverianer sagt nichts zum Zorah, bis wir in der Nahrungskette ganz oben stehen. Deshalb müssen wir einen Diablos erjagen! Können wir ihn dann auch essen?!'),(80,761,'en','Pretty In Pink','Hunt a Pink Rathian','The field team has spotted a Pink Rathian stalking the local wildlife. Subspecies like these are highly valuable to the Commission\'s research efforts. Get going, hunter!'),(81,364,'en','Gettin\' Yolked in the Waste','Deliver 2 Herbivore Eggs','You ready for leg day!? GOOD! You\'ll need \'em when you\'re running from that Apceros herd! Now go get me my purr-otein! *Unlocks a new Canteen ingredient on first time completion.'),(82,656,'en','Stuck in Their Ways','Capture a Tobi-Kadachi','Those three crazy old scholars went to study a LIVE Tobi-Kadachi. Please go capture it before they hurt themselves! *Unlocks a new Canteen ingredient on first time completion.'),(83,503,'en','Horned Tyrant Below the Sands','Hunt a Diablos','The First Wyverian\'s not gonna spill the beans about Zorah until we stand on top of the food chain. That means we gotta hunt us a Diablos! ...Does that mean we have to eat it too?'),(84,762,'de','Also, dieser Diablos!','Erjage einen Diablos.','Wir haben einen beunruhigenden Bericht über einen besonders starken Diablos in der Wildturm-Ödnis erhalten. Nimm die Untersuchung auf, aber Vorsicht vor Sturmangriffen!'),(85,365,'de','Der Erdrutsch-Wyvern','Fange einen Barroth.','Barroth leben in den Sümpfen der Wildturm-Ödnis. Über ihre Aktivitäten, Ernährung und Nistverhalten wissen wir nichts. Fang einen, damit wir mehr herausfinden können.'),(86,661,'de','Weg mit den Flossen!','Erjage einen Kulu-Ya-Ku.','Wir haben einen beunruhigenden Bericht über einen besonders starken Kulu-Ya-Ku in der Wildturm-Ödnis erhalten. Nimm schnell die Untersuchung auf, aber Vorsicht, er ist clever!'),(87,504,'de','Eine kolossale Aufgabe','Schliesse die Aufgabe ab.','Der Einsatz startet im Ewigen Strom. Tu alles, um den Zorah Magdaros aufs Meer zu treiben. Wir dürfen nicht scheitern! Möge der Saphirstern unseren Weg erhellen!'),(88,365,'en','Landing the Landslide Wyvern','Capture a Barroth','Barroth dwell in the marshes of the Wildspire Waste, but details of their activities, diet, and nesting habits remain unknown. Catch one to help shed light on the issue.'),(89,762,'en','Well, That Diablos!','Hunt a Diablos','We\'ve gotten a disturbing report of an unusually powerful Diablos appearing in the Wildspire Waste. Begin your investigation ASAP, but beware of its charging attacks!'),(90,661,'en','Keep Your Hands to Yourself!','Hunt a Kulu-Ya-Ku','We\'ve gotten a disturbing report of an unusually powerful Kulu-Ya-Ku roaming the Wildspire Waste. Begin your investigation ASAP, but beware its clever attacks!'),(91,504,'en','A Colossal Task','Complete the assignment','The operation is set to commence in the Everstream. Do everything you can to force Zorah Magdaros out to sea. We must not fail! May the Sapphire Star light our way!'),(92,763,'de','Der Feind mit den zwei Hörnern','Erjage eine Schwarze Diablos.','Hey, wir haben einen Bericht über ein besonders schönes Monster erhalten. Wir müssen diese Gelegenheit nutzen – beginne deine Untersuchung so schnell wie möglich!'),(93,401,'de','In die Geschichtsbücher eingehen','Schliesse die Aufgabe ab.','Bei Sonnenaufgang wagen wir etwas, was niemand gewagt hat: einen Drachenältesten zu fangen! Bereite dich vor und gehe dorthin. Möge der Saphirstern uns allen den Weg weisen!'),(94,662,'de','Eine Krone aus Schlamm und Wut','Erjage einen Barroth.','Wir haben einen beunruhigenden Bericht über einen besonders starken Barroth in der Wildturm-Ödnis erhalten. Nimm schnell die Untersuchung auf. Vorsicht vor seinen Schlammangriffen!'),(95,531,'de','Spezialarena: Legiana','Erjage einen Legiana.','Ein neuer Herausforderer: Legiana – der Herr der Lüfte, der Windschattenschläger! Eine fliegende Bedrohung! Nimm dieses Schwergewicht nicht auf die leichte Schulter!'),(96,763,'en','Two-horned Hostility','Hunt a Black Diablos','Hey, we\'ve gotten a report of an unusually fine monster specimen roaming around. We need to seize on this opportunity, so we need you to investigate ASAP!'),(97,401,'en','One for the History Books','Complete the assignment','At dawn we\'ll attempt what no one in history has dared: Capture an elder dragon! Make your preparations and proceed to the site. May the Sapphire Star guide us all.'),(98,662,'en','A Crown of Mud and Anger','Hunt a Barroth','We\'ve gotten a disturbing report of an unusually powerful Barroth roaming the Wildspire Waste. Begin your investigation ASAP, but beware its mud-caked attacks!'),(99,531,'en','Special Arena: Legiana','Hunt a Legiana','A new challenger: Legiana, the Slipstream Striker, the Wing leader! Remember, you can\'t spell flight without fight! Think you can go toe-to-toe—er, toe-to-claw with this heavy hitter!?'),(100,764,'de','Der Kampf in der Ödnis','Erjage alle Zielmonster.','*seufz* Ich hab dir doch schon gesagt, was ich vorhabe. Willst du dein neues Spielzeug? Dann absolviere diese Quest. *1. Abschluss schaltet ein neues Spezialwerkzeug frei.'),(101,405,'de','Aufgeblasene Probleme','Erjage einen Paolumu.','Mir wird schon schlecht, wenn ich nur an diese Monsterfratze denke. Ehrlich, du würdest ihm einen Gefallen tun! Uns auch. Erjage es, und der Ingenieur bekommt, was er braucht.'),(102,663,'de','Der Pukei-Pukei-Hinterhalt','Erjage einen Pukei-Pukei.','Aufgrund eines stark veränderten Ökosystems verlassen die Monster ihre angestammten Lebensräume. Geh in die Wildturm-Ödnis und untersuche den eindringenden Pukei-Pukei!'),(103,532,'de','Spezialarena: Odogaron','Erjage einen Odogaron.','Ein neuer Herausforderer: Odogaron – der Muskelprotz, der Meister der Zerstörung! Er will dir ans Leder! Nimm dieses Schwergewicht nicht auf die leichte Schulter!'),(104,764,'en','RRRRRumble in the Waste!','Hunt all target monsters','*sigh* I\'ve already told you what I want you to do. Run along now and complete this quest if you want your new toy. *Unlocks a new Specialized Tool on first time completion.'),(105,405,'en','Ballooning Problems','Hunt a Paolumu','...I\'m sorry, I just retched thinking about that monster\'s face. Seriously, you\'ll be doing it a favor...and us too. Hunt it and the Airship Engineer will have everything he needs.'),(106,663,'en','Pukei-Pukei Ambush','Hunt a Pukei-Pukei','A major change in the ecosystem is driving monsters from their natural habitats. Head to the Wildspire Waste and begin your investigation of the invading Pukei-Pukei ASAP!'),(107,532,'en','Special Arena: Odogaron','Hunt an Odogaron','A new challenger: Odogaron, the Muscle Mutt, the Rex Who Wrecks! He\'ll bite your leg to fetch the stick inside! Think you can go toe-to-toe—er, toe-to-claw with this heavy hitter!?'),(108,771,'de','Kirschfarbener Wind überm Riff','Erjage eine Rosa Rathian.','Das Feldteam hat beobachtet, wie eine Rosa Rathian einigen lokalen Kreaturen nachgestellt hat. Unterarten wie diese sind für die Forschung der Kommission unglaublich wichtig, also los!'),(109,407,'de','Radobaan-Strassensperre','Erjage einen Radobaan.','Die Knochen, die den Körper des Radobaan schützen, sind ein Hindernis, aber wenn wir unsere Erkundung des Tals der Verwesung fortsetzen wollen, musst du einen Weg finden!'),(110,665,'de','Knietief in der Ödnis','Erjage einen Jyuratodus.','Wir haben einen beunruhigenden Bericht über einen besonders starken Jyuratodus in der Wildturm-Ödnis erhalten. Nimm die Untersuchung auf, aber bleib nicht im Schlamm stecken!'),(111,407,'en','Radobaan Roadblock','Hunt a Radobaan','The bones covering Radobaan\'s body are gonna be tough to get through, but if we want to continue our survey of the Rotten Vale, you\'ll need to find a way!'),(112,771,'en','A Cherry Wind upon the Reefs','Hunt a Pink Rathian','The field team has spotted a Pink Rathian stalking the local wildlife. Subspecies like these are highly valuable to the Commission\'s research efforts. Get going, hunter!'),(113,665,'en','Up to Your Waist in the Waste','Hunt a Jyuratodus','We\'ve gotten a disturbing report of an unusually powerful Jyuratodus appearing in the Wildspire Waste. Begin your investigation ASAP, but beware of getting stuck in the muck!'),(114,408,'de','Legiana: Verkörperte Eleganz','Erjage einen Legiana.','Du weisst, was ich von der unerträglichen Kreatur halte. Solange sie den Himmel im Hochland beherrscht, kommen wir nie herunter. Kümmer dich um sie, ja?'),(115,772,'de','Legiana: Der König des Hochlands','Erjage einen Legiana.','Wir haben einen beunruhigenden Bericht über einen besonders starken Legiana im Korallenhochland erhalten. Nimm die Untersuchung auf, aber Vorsicht vor den eisigen Attacken!'),(116,666,'de','Braune Wüste, Grüne Königin','Erjage eine Rathian.','Wir haben einen beunruhigenden Bericht über eine besonders starke Rathian in der Wildturm-Ödnis erhalten. Nimm schnell die Untersuchung auf, aber Vorsicht vor ihrem Giftstachel!'),(117,408,'en','Legiana: Embodiment of Elegance','Hunt a Legiana','You already know how I feel about that intolerable creature. As long as it controls the skies in the highlands, we\'ll never be able to make our descent. Do take care of it, won\'t you?'),(118,772,'en','Legiana: Highlands Royalty','Hunt a Legiana','We\'ve gotten a disturbing report of an unusually powerful Legiana appearing in the Coral Highlands. Begin your investigation ASAP, but beware its swift and icy attacks!'),(119,666,'en','Brown Desert, Green Queen','Hunt a Rathian','We\'ve gotten a disturbing report of an unusually powerful Rathian appearing in the Wildspire Waste. Begin your investigation ASAP, but beware of its poisonous tail!'),(120,431,'de','Spezialarena: Anjanath','Erjage einen Anjanath.','Ein neuer Herausforderer: Anjanath – der Todeskiefer, der Trampelsaurus! Schaut auf einen Imbiss vorbei! Nimm dieses Schwergewicht nicht auf die leichte Schulter!'),(121,773,'de','Eine wunde Stelle','Erjage einen Odogaron.','Uff! Immer, wenn ich im Hochland meinen geliebten Paolumu beobachten will, ist da dieses fiese Monster! Bitte tu was! *Der 1. Abschluss schaltet eine neue Kantinenzutat frei.'),(122,773,'en','A Sore Site','Hunt an Odogaron','Ugh! Every time I go out to the highlands to observe my beloved Paolumu, that gnarly monster is there! Please do something! *Unlocks a new Canteen ingredient on first time completion.'),(123,431,'en','Special Arena: Anjanath','Hunt an Anjanath','A new challenger: Anjanath, the Jaws of Death, the Stomp-asaurus! He\'s just stopped by for a quick bite! Think you can go toe-to-toe—er, toe-to-claw with this heavy hitter!?'),(124,774,'de','Zornesklauen aus Eis','Erjage alle Zielmonster.','Es gibt einen Ort, an dem sich das Geheimnis zur Zucht Uralter Bäume versteckt. Aber da sind zwei fiese Monster. *1. Abschluss schaltet einen Botanik-Forschungsplatz frei.'),(125,432,'de','Spezialarena: Rathian','Erjage eine Rathian.','Eine neue Herausforderin: Rathian – die Königin der Luft, die Himmelsspalterin! Vorsicht, sie ist pures Gift! Nimm dieses Schwergewicht nicht auf die leichte Schulter!'),(126,774,'en','Talons of Ire and Ice','Hunt all target monsters','There\'s a spot I\'m certain hides the secret to growing Ancient Trees. Unfortunately, two nasty monsters are patrolling that area. *Unlocks a Botanical Research slot on first time completion.'),(127,432,'en','Special Arena: Rathian','Hunt a Rathian','A new challenger: Rathian, the Queen o\' Green, the Sky-borne Slasher! Don\'t get the lady angry; she\'s poison! Think you can go toe-to-toe—er, toe-to-claw with this heavy hitter!?'),(128,667,'de','Eindringender Störenfried','Erjage einen Anjanath.','Aufgrund eines stark veränderten Ökosystems verlassen die Monster ihre angestammten Lebensräume. Geh in die Wildturm-Ödnis und untersuche den eindringenden Anjanath!'),(129,533,'de','Spezialarena: Rathalos','Erjage einen Rathalos.','Ein neuer Herausforderer: Rathalos – der Hitzige Räuber, der Brandstifter! Er mag seine Opfer gut durch! Nimm dieses Schwergewicht nicht auf die leichte Schulter!'),(130,433,'de','Spezialarena: Paolumu','Erjage einen Paolumu.','Ein neuer Herausforderer: Paolumu – der Henkersbausch, der Fürchterliche! Er ist ein echter Luftikus! Nimm dieses Schwergewicht nicht auf die leichte Schulter!'),(131,781,'de','Odogaron auf freiem Fuss','Erjage einen Odogaron.','Wir haben einen beunruhigenden Bericht über einen besonders starken Odogaron im Tal der Verwesung erhalten. Nimm schnell die Untersuchung auf, aber Vorsicht vor seinen Krallen!'),(132,667,'en','Trespassing Troublemaker','Hunt an Anjanath','A major change in the ecosystem is driving monsters from their natural habitats. Head to the Wildspire Waste and begin your investigation of the invading Anjanath ASAP!'),(133,533,'en','Special Arena: Rathalos','Hunt a Rathalos','A new challenger: Rathalos, the Red-Hot Raider, the Fire-starter! Forgive the fireballs; he likes his meals cooked! Think you can go toe-to-toe—er, toe-to-claw with this heavy hitter!?'),(134,433,'en','Special Arena: Paolumu','Hunt a Paolumu','A new challenger: Paolumu, the Punishing Puffball, the Fear-igible! It may not be fair, but he\'s walking on air! Think you can go toe-to-toe—er, toe-to-claw with this heavy hitter!?'),(135,781,'en','Odogaron Unleashed','Hunt an Odogaron','We\'ve gotten a disturbing report of an unusually powerful Odogaron appearing in the Rotten Vale. Begin your investigation ASAP, but beware of its powerful claws!'),(136,671,'de','Bitte recht freundlich!','Erjage einen Tzitzi-Ya-Ku.','Wir haben einen beunruhigenden Bericht über einen besonders starken Tzitzi-Ya-Ku im Korallenhochland erhalten. Nimm die Untersuchung auf, aber Vorsicht vor seinem Blitzangriff!'),(137,534,'de','Spezialarena: Diablos','Erjage einen Diablos.','Ein neuer Herausforderer: Diablos – der Sandsturm, der Grosse Graber! Die Gefahr aus dem Untergrund! Nimm dieses Schwergewicht nicht auf die leichte Schulter!'),(138,671,'en','Say Cheese!','Hunt a Tzitzi-Ya-Ku','We\'ve gotten a disturbing report of an unusually powerful Tzitzi-Ya-Ku appearing in the Coral Highlands. Begin your investigation ASAP, but beware its blinding flash attacks!'),(139,672,'de','Fang den Paolumu','Erjage einen Paolumu.','Wir haben einen beunruhigenden Bericht über einen besonders starken Paolumu im Korallenhochland erhalten. Nimm schnell die Untersuchung auf, aber Vorsicht vor Luftangriffen!'),(140,672,'en','Loop the Paolumu','Hunt a Paolumu','We\'ve gotten a disturbing report of an unusually powerful Paolumu appearing in the Coral Highlands. Begin your investigation ASAP, but beware of its airburst attacks!'),(141,434,'de','Spezialarena: Radobaan','Erjage einen Radobaan.','Ein neuer Herausforderer: Radobaan – der Roto-Zerstörer, der Zermalmer! Weich bloss aus, sonst bist du Brei! Nimm dieses Schwergewicht nicht auf die leichte Schulter!'),(142,681,'de','Ein prickelnder Geschmack','Erjage einen Gross-Girros.','Warum ich möchte, dass du mir einen Gross-Girros erjagst? Das verrate ich dir später. Gemein von mir, nicht wahr? Na los jetzt...'),(143,434,'en','Special Arena: Radobaan','Hunt a Radobaan','A new challenger: Radobaan, the Roto-Ravager, the Grinder! Better dodge fast, or you\'ll be boned! Think you can go toe-to-toe—er, toe-to-claw with this heavy hitter!?'),(144,791,'de','Lavasioth, das Monster aus Magma','Erjage einen Lavasioth.','Hey, wir haben einen Bericht über ein besonders schönes Monster erhalten. Wir müssen diese Gelegenheit nutzen – beginne deine Untersuchung so schnell wie möglich!'),(145,681,'en','A Tingling Taste','Hunt a Great Girros','...... Why do I want you to hunt a Great Girros? Well, I\'ll tell you later. I know, how devilish of me. Run along now...'),(146,451,'de','Im Griff der Grippe','Erjage einen Anjanath.','Wegen des Anjanath hat unsere ganze Abteilung die Grippe. Was hätte man auch machen können? Der ganze Uralte Wald ist von oben bis unten mit ekligem Schleim bedeckt.'),(147,682,'de','Betriebsblind','Erjage einen Radobaan.','Wir haben einen beunruhigenden Bericht über einen besonders starken Radobaan im Tal der Verwesung erhalten. Nimm schnell die Untersuchung auf, aber Vorsicht vor Rollangriffen!'),(148,534,'en','Special Arena: Diablos','Hunt a Diablos','A new challenger: Diablos, the Sandy Stampede, Biggus Diggus! Don\'t hang around if he\'s underground! Think you can go toe-to-toe—er, toe-to-claw with this heavy hitter!?'),(149,451,'en','One Helluva Sinus Infection','Hunt an Anjanath','Our entire department is out with the flu because of that Anjanath. How could they not be? The Ancient Forest is covered from top to bottom with that nasty mucus!'),(150,682,'en','Stuck in a Rut','Hunt a Radobaan','We\'ve gotten a disturbing report of an unusually powerful Radobaan appearing in the Rotten Vale. Begin your investigation ASAP, but beware of its rolling attacks!'),(151,551,'de','Wenn Wunsch Obsession wird','Erjage einen Rathalos.','Angeblich besitzt der Rathalos den seltensten aller Edelsteine, aber wie viele Exemplare ich auch seziere, ich bekomme einfach keinen Stein. Okay, letzter Versuch...'),(152,791,'en','Lavasioth, Monster of Magma','Hunt a Lavasioth','Hey, we\'ve gotten a report of an unusually fine monster specimen roaming around. We need to seize on this opportunity, so we need you to investigate ASAP!'),(153,683,'de','Chefkochquest! Immer lieferbereit!','Liefere vier Vergessene Fossilien.','Hast du deinen Ober- und Unterkörper trainiert und bist einsatzbereit?! GUT! Dann an die Arbeit! *Der 1. Abschluss schaltet eine neue Kantinenzutat frei.'),(154,792,'de','Der erzfressende Besatzer','Erjage einen Uragaan.','Hey, wir haben einen Bericht über ein besonders schönes Monster erhalten. Wir müssen diese Gelegenheit nutzen – beginne deine Untersuchung so schnell wie möglich!'),(155,792,'en','Ore-eating Occupier','Hunt an Uragaan','We\'ve gotten a report of an unusually fine monster specimen roaming around. We need to seize on this opportunity, so we need you to investigate ASAP!'),(156,683,'en','Chef Quest! Pumped to Deliver','Deliver 4 Forgotten Fossils','Now that you\'ve worked both your upper and lower body, are you ready to put it to good use!? GOOD! Let\'s Work! *Unlocks a new Canteen ingredient on first time completion.'),(157,793,'de','Herrscher des azurblauen Himmels','Erjage einen Azurnen Rathalos.','Das Feldteam hat beobachtet, wie ein Azurner Rathalos am Himmel patrouilliert ist. Unterarten wie diese sind für die Forschung der Kommission unglaublich wichtig, also los!'),(158,684,'de','Chefkochquest! Jagdbegeistert!','Töte zehn Girros.','Diese kleinen Monster glauben, du spielst mit ihnen! Zeig ihnen, woraus du gemacht bist. Sagen wir... 10 Exemplare? *Der 1. Abschluss schaltet eine neue Kantinenzutat frei.'),(159,793,'en','Ruler of the Azure Skies','Hunt an Azure Rathalos','The field team has spotted an Azure Rathalos patroling the skies. Subspecies like these are highly valuable to the Commission\'s research efforts. Get going, hunter!'),(160,794,'de','Der Bazelgeuse im Schussfeld','Erjage einen Bazelgeuse.','Das Exzentriker-Trio hat es schon wieder getan! Sie haben einen Bazelgeuse entdeckt und wollen ihn studieren! Bitte jage ihn, bevor ihnen etwas passiert!'),(161,794,'en','Bazelgeuse in the Field of Fire','Hunt a Bazelgeuse','That eccentric trio has gone and done it again! Now that they\'ve discovered the location of a Bazelgeuse, they\'re off to study it! Please hunt it before they get themselves hurt!'),(162,795,'de','Gebündeltes Feuer','Erjage alle Zielmonster.','Wir von der 2. Flotte haben neue Werkzeuge entwickelt, die dir auf deinen Jagden helfen. Aber du musst das Material besorgen. Wir zählen darauf, dass du diese Quest annimmst.'),(163,795,'en','A Fiery Convergence','Hunt all target monsters','Here at the Second Fleet, we\'ve been working to develop new tools to help your hunts, but we need YOUR help gathering the materials. We\'re counting on you to take this quest!'),(164,801,'de','Kushala Daora, Stahl-Drache','Töte den Kushala Daora.','Die Drachenältestenspuren im Wald? Kushala Daora. Da bin ich ganz sicher. Wir wissen, dass er in der Heimat der Ältesten ist. Die Sicherheit aller in Astera liegt in deinen Händen!'),(165,551,'en','When Desire Becomes an Obsession','Hunt a Rathalos','They say that Rathalos possess the rarest of gems, but I\'m having a hard to time obtaining one. I\'ve already gone through ten or so of them with no luck. Oh well, bring me another!'),(166,801,'en','Kushala Daora, Dragon of Steel','Slay Kushala Daora','The elder dragon tracks in the forest? Kushala Daora. I\'m sure of it. We know it\'s in the Elder\'s Recess. For the safety of everyone in Astera, we\'re counting on you!'),(167,452,'de','Nur das Gelbe im Wald','Liefere zwei Wyvern-Eier.','Bereit für ordentlich Beintraining?! Gut! Die brauchst du, wenn du vor der Rathian wegläufst! Jetzt besorg mir mein Pfo-tein! *Der 1. Abschluss schaltet eine neue Kantinenzutat frei.'),(168,552,'de','Neudefinition des \"Machtpaars\"','Erjage alle Zielmonster.','Wir von der 2. Flotte haben neue Werkzeuge entwickelt, die dir auf deinen Jagden helfen. Aber du musst das Material besorgen. Wir zählen darauf, dass du diese Quest annimmst.'),(169,452,'en','Gettin\' Yolked in the Forest','Deliver 2 Wyvern Eggs','You ready for leg day!? GOOD! You\'ll need \'em when you\'re running from that Rathian! Now go get me my purr-otein! *Unlocks a new Canteen ingredient on first time completion.'),(170,552,'en','Redefining the \"Power Couple\"','Hunt all target monsters','Here at the Second Fleet, we\'ve been working to develop new tools to help your hunts, but we need YOUR help gathering the materials. We\'re counting on you to take this quest!'),(171,461,'de','Königliche Umsiedlung','Erjage eine Rathian.','Die Proben für die Forschung zum Uralten Baum sind direkt unter einem Rathian-Nest. Kannst du sie umsiedeln? *1. Abschluss schaltet ein Botanisches Forschungsobjekt frei.'),(172,461,'en','Royal Relocation','Hunt a Rathian','The samples I need to further my Ancient Tree research are right under a Rathian\'s nest. Perhaps you can move it for me? *Unlocks a Botanical Research item on first time completion.'),(173,471,'de','Keine Gnade für Shamos','Töte elf Shamos.','Sie tun mir fast leid. Diese mickrigen Monster haben keine Chance. Erledige sie, während ich Sachen hole! *Der 1. Abschluss schaltet eine neue Kantinenzutat frei.'),(174,802,'de','Teostra der Fürchterliche','Töte den Teostra.','Teostra der Flammenkaiser durchstreift die Ödnis. Und jetzt liegt er in der Heimat der Ältesten auf Lauer. Zieh los und beende seine brennende Herrschaft!'),(175,471,'en','It\'s a Crying Shamos','Slay 11 Shamos','I almost feel bad for \'em. Those scrawny little monsters don\'t even stand a chance. Go flex on \'em while I get the goods! *Unlocks a new Canteen ingredient on first time completion.'),(176,472,'de','Ein Tzitzi für die Wissenschaft','Erjage einen Tzitzi-Ya-Ku.','Wir haben vom Tzitzi-Ya-Ku im Korallenhochland gehört. Mit Blitzen blendet er seine Gegner. Den Mechanismus müssen wir untersuchen. Feldteam, jagt bitte einen für eine Studie.'),(177,472,'en','A Tzitzi for Science','Hunt a Tzitzi-Ya-Ku','We\'ve heard talk of the Coral Highlands\' Tzitzi-Ya-Ku, how it emits flashes of light to blind its enemies. We must know the mechanics involved. Field team, please hunt one for our studies!'),(178,473,'de','Leider nicht eingeladen','Erjage einen Paolumu.','Dies ist eine seltsame Bitte, aber dieses Wochenende gibt es eine Geburtstagsparty und wir brauchen unbedingt Ballons. Wenn du uns hilfst, wärst du ein echter Held!'),(179,473,'en','Sorry You\'re Not Invited','Hunt a Paolumu','This is sort of an odd request but there is a birthday party coming up this weekend and we\'re in desperate need of balloons. If you could help us out you\'d be a real hero!'),(180,474,'de','Jede Menge Abalone','Liefere zehn Super-Abalone.','Bereit fürs Armtraining?! Gut! Denn die brauchst du, um diese Zutaten für mich zu sammeln! *Der 1. Abschluss schaltet eine neue Kantinenzutat frei.'),(181,474,'en','What a Bunch of Abalone','Deliver 10 Super Abalone','You ready for arms day!? GOOD! You\'re gonna need \'em to gather these ingredients I\'ve had my eye on! *Unlocks a new Canteen ingredient on first time completion.'),(182,561,'de','Doppeltürme im Sand','Erjage einen Diablos.','Wusstest du, dass eine Insektenart überlebt, indem sie sich in Diablos-Schwänzen verbirgt? Nein? Wir auch nicht! Wir wissen es nicht, bis du uns einen bringst!'),(183,475,'de','Weisses Monster, weisser Kittel','Fange einen Paolumu.','Paolumu leben im Korallenhochland. Über ihre Aktivitäten, Ernährung und Nistverhalten wissen wir nichts. Fang einen, damit wir mehr über diese Kreatur herausfinden können.'),(184,561,'en','Twin Spires Upon the Sands','Hunt a Diablos','Did you know there\'s a species of insect that survives by burrowing into Diablos tails? No? Well neither do we! And we won\'t find out unless you go and bring us one to be sure!'),(185,684,'en','Chef Quest! A Rotten Request','Slay 10 Girros','These little monsters think you\'re playing with them! Show \'em what you\'re made of! Let\'s say... 10 reps? *Unlocks a new Canteen ingredient on first time completion.'),(186,571,'de','Schwüle Kopfschmerzen','Erjage einen Legiana.','Das Wetter ist so schwül, dass man die Luft mit einem Grossschwert durchtrennen kann! Unsere Abteilung braucht Klimakontrolle. Ich weiss, welches Monster da helfen kann!'),(187,571,'en','A Humid Headache','Hunt a Legiana','This weather is so humid you could cut the air with a great sword! Our department could do with some climate control and I know just the monster that can provide some relief!'),(188,802,'en','Teostra the Infernal','Slay Teostra','It\'s Teostra that stalks the Waste—Emperor of flame. And now it sits in wait in the Elder\'s Recess. Go to it, hunter, and end its searing reign!'),(189,572,'de','Blitzartig davon','Töte einen Kirin.','Warum bist du noch hier? Ein Drachenältester wurde gesichtet und du hängst hier rum?! Beeil dich, bevor er entkommt! *1. Abschluss schaltet ein neues Spezialwerkzeug frei.'),(190,803,'de','Höllischer Feind Vaal Hazak','Töte den Vaal Hazak.','Ich bin mir absolut sicher, dass das Miasma vom Vaal Hazak kontrolliert wird. Um meine Theorie ein für alle Mal zu beweisen, geh ins Tal und suche den Vaal Hazak!'),(191,572,'en','Gone in a Flash','Slay a Kirin','Why are you still here? An elder dragon\'s been spotted and you\'re just hanging out!? Hurry up before it gets away! *Unlocks a new Specialized Tool on first time completion.'),(192,803,'en','Hellish Fiend Vaal Hazak','Slay Vaal Hazak','I\'m absolutely positive that the effluvium is controlled by Vaal Hazak. Now to prove my theory once and for all. Go to the vale and seek out Vaal Hazak!'),(193,581,'de','Wen es juckt','Erjage einen Odogaron.','Diesen Morgen hatte ich eine Erleuchtung! Ich weiss, was jeder Jäger nach einem langen Tag unterwegs braucht... Odogaron-Rückenkratzer!'),(194,804,'de','Der Ort der Bündelung','Schliesse die Aufgabe ab.','Die Neue Welt wird von einer immensen Energie durchströmt und wir wissen nun, wo sie zusammenläuft. Begleite den Wyverianischen Jäger und finde heraus, was sich da befindet.'),(195,581,'en','Scratching the Itch','Hunt an Odogaron','This morning I awoke to a brilliant epiphany! I have an idea for something every hunter needs after a long day out in the field...Odogaron backscratchers!'),(196,804,'en','Land of Convergence','Complete the assignment','An immense energy flows through the New World, and we\'ve found where it all leads to. Go with the Seeker and find out what\'s there. May the Sapphire Star guide us all.'),(197,582,'de','Das beste Monster des Menschen','Fange einen Odogaron.','Ich vermisse mein Haustier. Wir sind in den Park gegangen und haben Apportieren gespielt. Mir fehlt die Gesellschaft, die Loyalität. Bitte geh los und besorg mir ein neues.'),(198,805,'de','Jenseits der explosiven Schuppen','Erjage zwei Bazelgeuse.','Diese Quest ist nur etwas für Leute, die absolutes Vertrauen in ihre Fähigkeiten haben. Dich erwarten zwei unglaublich starke Bazelgeuse. Besiege sie zum Beweis deiner Jagdkunst!'),(199,582,'en','Man\'s Best Fiend','Capture an Odogaron','I really miss my old pet. The days we spent going to the park, playing fetch. I long for that companionship... that loyalty. Please go out and find me a new one.'),(200,805,'en','Beyond the Blasting Scales','Hunt two Bazelgeuse','This quest courts only those with absolute faith in their abilities. You face two abnormally powerful Bazelgeuse, Defeat them to prove you are a true master of the hunt!'),(201,583,'de','Fleischangelegenheit','Liefere zwei Fleischklumpen.','Bereit fürs Rückentraining?! Gut! Den brauchst du, um alle Zutaten auf der Liste zu besorgen! *Der 1. Abschluss schaltet eine neue Kantinenzutat frei.'),(202,806,'de','Kampfgetöse im Hochland','Töte einen Kirin.','Diese Quest ist nur etwas für besonders Wagemutige. Geh ins Korallenhochland und untersuche die Bestie, die in Blitze gehüllt ist. Danach erwartet dich wahrer Ruhm.'),(203,691,'de','Ein Miau um Hilfe','Töte 13 Gastodon.','Immer, wenn ich im Ewigen Strom etwas für meinen Miauster sammeln will, werfen mich diese Gastodone auf meinen Allerwertesten! MIAU! Kannst du mir eine Pfote leihen?'),(204,806,'en','Thunderous Rumble in the Highlands','Slay a Kirin','This quest seeks only those with an unquenchable flame in their chest. Make for the Coral Highlands and investigate the beast swathed in lightning. Beyond it lies true glory.'),(205,475,'en','White Monster for a White Coat','Capture a Paolumu','Paolumu dwell in the Coral Highlands, but details of their activities, diet, and nesting habits remain unknown. Catch one to help shed light on this mysterious creature.'),(206,851,'de','Ein böses Omen','Töte einen Kushala Daora.','Wir von der 2. Flotte haben neue Werkzeuge entwickelt, die dir auf deinen Jagden helfen. Aber du musst das Material besorgen. Wir zählen darauf, dass du diese Quest annimmst.'),(207,481,'de','Hartnäckige Störenfriede','Töte 14 Hornetauren.','Es gibt einen Ort, an dem sich das Geheimnis zur Zucht neuer Uralter Bäume versteckt. Aber da lauern Hornetauren! *1. Abschluss schaltet einen Botanik-Forschungsplatz frei.'),(208,481,'en','Persistent Pests','Slay 14 Hornetaur','There\'s a spot that I\'m certain hides the secret to new Ancient Tree growth but it\'s infested with Hornetaurs! *Unlocks a Botanical Research slot on first time completion.'),(209,851,'en','A Portent of Disaster','Slay a Kushala Daora','Here at the Second Fleet, we\'ve been working to develop new tools to help your hunts, but we need YOUR help gathering the materials. We\'re counting on you to take this quest!'),(210,583,'en','The Meat of the Matter','Deliver 2 Lumps of Meat','You ready for back day!? GOOD! You\'ll need to put your back into it to get all the ingredients on this list! *Unlocks a new Canteen ingredient on first time completion.'),(211,861,'de','Brennender Sand','Töte einen Teostra.','Wir von der 2. Flotte haben neue Werkzeuge entwickelt, die dir auf deinen Jagden helfen. Aber du musst das Material besorgen. Wir zählen darauf, dass du diese Quest annimmst.'),(212,601,'de','Eindringling in der Ödnis','Erjage einen Pukei-Pukei.','Ein Pukei-Pukei in der Wildturm-Ödnis?! Als wäre das nicht seltsam genug, ist er auch noch besonders stark. Dem müssen wir nachgehen! Sei vorsichtig!'),(213,895,'de','Beissender Wind des Zorns','Töte einen Kushala Daora.','Ein Kushala Daora läuft herum und macht alles kaputt. Anscheinend wurde er aus seinem Revier vertrieben. Aber wovon? Zeit, dem nachzugehen!'),(214,601,'en','Invader in the Waste','Hunt a Pukei-Pukei','A Pukei-Pukei in the Wildspire Waste!? As if that\'s not already weird enough, this one\'s extra tough. We\'ve gotta get to the bottom of this! Be careful, Partner!'),(215,861,'en','A Blaze on the Sand','Slay a Teostra','Here at the Second Fleet, we\'ve been working to develop new tools to help your hunts, but we need YOUR help gathering the materials. We\'re counting on you to take this quest!'),(216,895,'en','The Winds of Wrath Bite Deep','Slay a Kushala Daora','We\'ve got a Kushala Daora running \'round, tearin\' things up. Seems like it was kicked out of its territory. Question is, what did the kickin\'? Time to investigate!'),(217,605,'de','Rosige Aussichten','Erjage einen Anjanath.','Es wurde ein starker Anjanath gesichtet! Diese Art ist der Gold- – Pink-? – Standard für Monster aus der Neuen Welt. Wir brauchen dieses Exemplar. Mach dich auf die Jagd!'),(218,691,'en','A Meow for Help','Slay 13 Gastodon','Every time I try to gather something for my meowster out in the Everstream, these Gastodon knock me on my tail! MEOW-CH! Can you lend a Felyne a paw here?'),(219,605,'en','Tickled Pink','Hunt an Anjanath','A powerful Anjanath\'s been sighted! Their kind\'s the gold— pink?—standard for New World monsters. We can\'t let this chance at an ideal sample slip away. Go hunt it ASAP!'),(220,896,'de','Sengendes Höllenfeuer','Töte einen Teostra.','Wir haben einen wütenden Teostra auf dem Kriegspfad. Anscheinend wurde er aus seinem Königreich vertrieben. Aber wovon? Zeit, dem nachzugehen!'),(221,692,'de','Ein brandheisser Knüller','Töte fünf Barnos.','Während eines Auftrags hat ein Barnos mich mit etwas bespuckt. Es war HEISS, verdammt heiss! Aber auch im übertragenen Sinne! Hilf mir, meine Geschichte zu bekommen.'),(222,896,'en','The Fires of Hell Bite Deep','Slay a Teostra','We\'ve got a riled up Teostra on the warpath. Seems like it was kicked out of its kingdom. Question is, what did the kickin\'? Time to investigate!'),(223,607,'de','Monster der Alten in der Neuen Welt','Schliesse die Aufgabe ab.','Wir haben endlich die Quelle dieser geheimnisvollen Spuren ausgemacht. Melde dich im Korallenhochland und spüre sie auf! Ich erwarte deinen Bericht, sobald du fertig bist!'),(224,961,'de','Jenseits der explosiven Schuppen','Erjage zwei Bazelgeuse.','Diese Quest ist nur etwas für Leute, die absolutes Vertrauen in ihre Fähigkeiten haben. Dich erwarten zwei unglaublich starke Bazelgeuse. Besiege sie zum Beweis deiner Jagdkunst!'),(225,607,'en','Old World Monster in the New World','Complete the assignment','We\'ve finally tracked down the source of those mysterious tracks. Report to the Coral Highlands and seek it out! I\'ll be expecting your report as soon as you\'re done!'),(226,961,'en','Beyond the Blasting Scales','Hunt 2 Bazelgeuse','This quest courts only those with absolute faith in their abilities. You face two abnormally powerful Bazelgeuse, Defeat them to prove you are a true master of the hunt!'),(227,971,'de','Kampfgetöse im Hochland','Töte einen Kirin.','Diese Quest ist nur etwas für besonders Wagemutige. Geh ins Korallenhochland und untersuche die Bestie, die in Blitze gehüllt ist. Danach erwartet dich wahrer Ruhm.'),(228,971,'en','Thunderous Rumble in the Highlands','Slay a Kirin','This quest seeks only those with an unquenchable flame in their chest. Make for the Coral Highlands and investigate the beast swathed in lightning. Beyond it lies true glory.'),(229,991,'de','Das Licht über dem dunklen Fluss','Töte den Xeno\'jiiva.','Der Xeno\'jiiva ist ein fantastisches, geheimnisvolles Exemplar eines Monsters. Mit genug Proben könnten wir ihn 100 Jahre lang studieren! Das ist dein Stichwort...'),(230,991,'en','A Light Upon the River\'s Gloom','Slay Xeno\'jiiva','Xeno\'jiiva is such a marvelous, mysterious example of exotic monster biology. We could study it for a hundred years if we just had enough samples! That\'s your cue, Hunter.'),(231,992,'de','Die weissen Winde der Neuen Welt','Erjage alle Zielmonster.','Ich habe für den Jäger, der alle Untersuchungen geschafft hat, noch eine ultimative Quest. Betritt die Spezialarena und nimm es mit der Neuen Welt auf. Setze alles ein.'),(232,992,'en','The White Winds of the New World','Hunt all target monsters','To the hunter who has conquered every investigation, I offer this, the ultimate quest. Enter the Special Arena and take on the New World. Use all that lies before you, and claim glory.'),(233,631,'de','Spezialarena: HR Pukei-Pukei','Erjage einen Pukei-Pukei.','Ein neuer Herausforderer: Pukei-Pukei – der Giftraufer, die Prügelmaschine! Er gibt niemals auf! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(234,995,'de','Folge dem Saphirstern','Töte alle Zielmonster.','Für unseren besten Jäger habe ich noch eine letzte Quest. Kehre in die Heimat der Ältesten zurück und kämpfe gegen die Ältesten. Beweise dich und werde zum Meister der Neuen Welt.'),(235,631,'en','Special Arena: HR Pukei-Pukei','Hunt a Pukei-Pukei','A new challenger: Pukei-Pukei, the Toxic Tussler, the Lickin\' Machine! He won\'t listen when you say \"no tongues\"! The gloves are off—not that we have gloves that big...'),(236,995,'en','The Sapphire Star\'s Guidance','Slay all target monsters','To the unparalleled hunter, I offer this final quest. Return to the Elder\'s Recess and brave the elders\' onslaught. Use all within your grasp to prove yourself master of the New World.'),(237,632,'de','Spezialarena: HR Barroth','Erjage einen Barroth.','Ein neuer Herausforderer: Barroth – der Kopfnusskoloss, der Schädelspalter! Verlieren verboten! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(238,996,'de','Showdown: Schlamm gegen Schlägel','Erjage alle Zielmonster.','Wir von der 2. Flotte haben neue Werkzeuge entwickelt, die dir auf deinen Jagden helfen. Aber du musst das Material besorgen. Wir zählen darauf, dass du diese Quest annimmst.'),(239,632,'en','Special Arena: HR Barroth','Hunt a Barroth','A new challenger: Barroth, the Hulking Headbutt, the Skullcracker! Lose to this guy, and your name is mud! The gloves are off—not that we have gloves that big...'),(240,996,'en','Showdown: the Muck and the Maul','Hunt all target monsters','Here at the Second Fleet, we\'ve been working to develop new tools to help your hunts, but we need YOUR help gathering the materials. We\'re counting on you to take this quest!'),(241,633,'de','Spezialarena: HR Tobi-Kadachi','Erjage einen Tobi-Kadachi.','Ein neuer Herausforderer: Tobi-Kadachi – die Sprungechse, der Bissmeister! Macht dich mit Donnerschlag fertig! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(242,997,'de','Himmel und Blume der Neuen Welt','Erjage alle Zielmonster.','Wir von der 2. Flotte haben neue Werkzeuge entwickelt, die dir auf deinen Jagden helfen. Aber du musst das Material besorgen. Wir zählen darauf, dass du diese Quest annimmst.'),(243,633,'en','Special Arena: HR Tobi-Kadachi','Hunt a Tobi-Kadachi','A new challenger: Tobi-Kadachi, the Leaping Lizard, the Bitemaster! He\'ll clean your clock with thunder shocks! The gloves are off—not that we have gloves that big...'),(244,692,'en','A Scalding Scoop','Slay 5 Barnos','I was out on assignment when a Barnos barfed something at me. Whatever it was it was HOT, painfully hot! But also the sells-lots-of-copies kind of hot! Help me get my story!'),(245,693,'de','Das Dodogama-Drama','Erjage einen Dodogama.','Hey, wir haben einen Bericht über ein besonders schönes Monster erhalten. Wir müssen diese Gelegenheit nutzen – beginne deine Untersuchung so schnell wie möglich!'),(246,871,'de','Zweimal vom Blitz getroffen','Töte einen Kirin.','Es ist noch ein Kirin aufgetaucht und du spielst hier mit deinem Palico?! So eine Chance ihn zu erforschen bekommen wir vielleicht nie wieder! Los, los, LOOOOOOOS!'),(247,693,'en','Dodogama Drama','Hunt a Dodogama','Hey, we\'ve gotten a report of an unusually fine monster specimen roaming around. We need to seize on this opportunity, so we need you to investigate ASAP!'),(248,871,'en','Lightning Strikes Twice','Slay a Kirin','Yet another Kirin has shown up and you\'re just here, playing with your Palico!? We might never get this chance again to study it! Go go GOOOOOO!'),(249,694,'de','Chefkochquest! Gajalaka-Fangen!','Besiege zehn Gajalaka.','Miau! Wollen diese kleinen Biester dich etwa fertigmachen? Zeig ihnen, was du draufhast! Sagen wir... zehn Stück? *Der 1. Abschluss schaltet eine neue Kantinenzutat frei.'),(250,881,'de','Rufe aus dem Grab','Töte einen Vaal Hazak.','Der Vaal Hazak hat seinen Zweck im Lebenszyklus der Neuen Welt erfüllt, aber jetzt bedroht er das komplette Ökosystem und muss deshalb aufgehalten werden.'),(251,694,'en','Chef Quest! Gajalaka Lockdown','Defeat 10 Gajalaka','Meow my god! Are these lil\' guys tryin\' to flex on you? Show \'em what you\'re packin\'! Let\'s say... 10 reps! *Unlocks a new Canteen ingredient on first time completion.'),(252,881,'en','Stirrings from the Grave','Slay a Vaal Hazak','Vaal Hazak serves its purpose in the life cycle of the New World, but now that it has stirred from its nest of decay, it threatens to ruin the whole ecosystem. It must be stopped!'),(253,701,'de','Eine Wunde und ein Verlangen','Töte den Nergigante.','Der Nergigante hält uns schon geraume Zeit zum Narren, aber jetzt wissen wir, wo er steckt. Seine Erforschung könnte uns mehr über die Ältestenwanderung verraten.'),(254,701,'en','A Wound and a Thirst','Slay Nergigante','The Nergigante\'s long eyed us from the far side of the Elder Crossing, but now we have a lead on its whereabouts. If we can study it, it may reveal the Crossing\'s true nature.'),(255,731,'de','Spezialarena: HR Rosa Rathian','Erjage eine Rosa Rathian.','Eine neue Herausforderin: Rosa Rathian – die Feuerblume, die Beissende Schönheit! Ihr Duft ist tödlich! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(256,634,'de','Spezialarena: HR Anjanath','Erjage einen Anjanath.','Ein neuer Herausforderer: Anjanath – der Todeskiefer, der Trampelsaurus! Schaut auf einen Imbiss vorbei! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(257,731,'en','Special Arena: HR Pink Rathian','Hunt a Pink Rathian','A new challenger: Pink Rathian, the Burning Blossom, the Beauty Who Bites! Best not stop to smell the roses! The gloves are off—not that we have gloves that big...'),(258,634,'en','Special Arena: HR Anjanath','Hunt an Anjanath','A new challenger: Anjanath, the Jaws of Death, the Stompasaurus! He\'s just stopped by for a quick bite! The gloves are off—not that we have gloves that big...'),(259,997,'en','New World Sky, New World Flower','Hunt all target monsters','Here at the Second Fleet, we\'ve been working to develop new tools to help your hunts, but we need YOUR help gathering the materials. We\'re counting on you to take this quest!'),(260,732,'de','Spezialarena: HR Legiana','Erjage einen Legiana.','Ein neuer Herausforderer: Legiana – der Herr der Lüfte, der Windschattenschläger! Eine fliegende Bedrohung! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(261,998,'de','Ruf aus dem Abgrund','Erjage alle Zielmonster.','Wir von der 2. Flotte haben neue Werkzeuge entwickelt, die dir auf deinen Jagden helfen. Aber du musst das Material besorgen. Wir zählen darauf, dass du diese Quest annimmst.'),(262,732,'en','Special Arena: HR Legiana','Hunt a Legiana','A new challenger: Legiana, the Slipstream Striker, the Wingleader! Remember, you can\'t spell flight without fight! The gloves are off—not that we have gloves that big...'),(263,998,'en','A Summons from Below','Hunt all target monsters','Here at the Second Fleet, we\'ve been working to develop new tools to help your hunts, but we need YOUR help gathering the materials. We\'re counting on you to take this quest!'),(264,733,'de','Spezialarena: HR Odogaron','Erjage einen Odogaron.','Ein neuer Herausforderer: Odogaron – der Muskelprotz, der Meister der Zerstörung! Er will dir ans Leder! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(265,635,'de','Spezialarena: HR Rathian','Erjage eine Rathian.','Eine neue Herausforderin: Rathian – die Königin der Luft, die Himmelsspalterin! Vorsicht, sie ist pures Gift! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(266,733,'en','Special Arena: HR Odogaron','Hunt an Odogaron','A new challenger: Odogaron, the Muscle Mutt, the Rex Who Wrecks! He\'ll bite your leg to fetch the stick inside! The gloves are off—not that we have gloves that big...'),(267,635,'en','Special Arena: HR Rathian','Hunt a Rathian','A new challenger: Rathian, the Queen o\' Green, the Skyborne Slasher! Don\'t get the lady angry; she\'s poison! The gloves are off—not that we have gloves that big...'),(268,734,'de','Spezialarena: HR Uragaan','Erjage einen Uragaan.','Ein neuer Herausforderer: Uragaan – die Rollende Rakete, der Kinnhetzer! Dreht er sich, fürchte dich! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(269,636,'de','Spezialarena: HR Paolumu','Erjage einen Paolumu.','Ein neuer Herausforderer: Paolumu – der Henkersbausch, der Fürchterliche! Er ist ein echter Luftikus! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(270,734,'en','Special Arena: HR Uragaan','Hunt an Uragaan','A new challenger: Uragaan, the Rolling Rocket, the Chinstigator! Once he starts spinning, uragoner! The gloves are off—not that we have gloves that big...'),(271,636,'en','Special Arena: HR Paolumu','Hunt a Paolumu','A new challenger: Paolumu, the Punishing Puffball, the Fearigible! It may not be fair, but he\'s walking on air! The gloves are off—not that we have gloves that big...'),(272,735,'de','Spezialarena: HR Rathalos','Erjage einen Rathalos.','Ein neuer Herausforderer: Rathalos – der Hitzige Räuber, der Brandstifter! Er mag seine Opfer gut durch! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(273,735,'en','Special Arena: HR Rathalos','Hunt a Rathalos','A new challenger: Rathalos, the Red-Hot Raider, the Firestarter! Forgive the fireballs; he likes his meals cooked! The gloves are off—not that we have gloves that big...'),(274,736,'de','Spezialarena: HR Azurner Rathalos','Erjage einen Azurnen Rathalos.','Ein neuer Herausforderer: Azurner Rathalos – der Saphirne Sultan, der Blaue Schrecken! König der Wyvern! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(275,1101,'de','Die Eistaufe','Erjage einen Beotodus.','Bist du bereit zur Erkundung, <LSNR {Partner} {Partnerin}>? Wer weiss, was für Geheimnisse der Schnee verdeckt! Ich suche einen Landeplatz, sichere du das Gebiet!'),(276,736,'en','Special Arena: HR Azure Rathalos','Hunt an Azure Rathalos','A new challenger: Azure Rathalos, the Sapphire Sultan, the True Blue Terror! Bow down to the king of all wyverns! The gloves are off—not that we have gloves that big...'),(277,1101,'en','Baptism by Ice','Hunt a Beotodus','Ready to get exploring, Pard? I can hardly imagine what secrets are hidden beneath the snow! I\'ll find a place for the airship to land, you secure the area!'),(278,637,'de','Spezialarena: HR Radobaan','Erjage einen Radobaan.','Ein neuer Herausforderer: Radobaan – der Roto-Zerstörer, der Zermalmer! Weich bloss aus, sonst bist du Brei! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(279,1102,'de','Banbaro-Blockade','Erjage einen Banbaro.','Ich habe Vorräte aus Astera beordert, die bald eintreffen sollten. Du musst die Raureif-Weite sichern, damit sie dort sicher ankommen. Und vergiss nicht, dich warm anzuziehen.'),(280,637,'en','Special Arena: HR Radobaan','Hunt a Radobaan','A new challenger: Radobaan, the Roto-Ravager, the Grinder! Better dodge fast, or you\'ll be boned! The gloves are off—not that we have gloves that big...'),(281,1102,'en','Banbaro Blockade','Hunt a Banbaro','I\'ve arranged a shipment of supplies from Astera, which should arrive at any moment. We\'ll need you to secure the Hoarfrost Reach to ensure it arrives safely. Don\'t forget to bundle up.'),(282,641,'de','Ziemlich Eindruck gemacht','Leite den Zorah Magdaros.','Bleibt dir beim Anblick des Zorah Magdaros nicht das Herz stehen? Seine Schuppen aus der Nähe zu sehen, ist genauso ehrfurchtgebietend. Wir müssen ihn noch genauer studieren.'),(283,1121,'de','Tiefschneetaucher','Erjage einen Beotodus.','Der Beotodus ist ein Fischwyvern, der beim Schwimmen durch den Schnee pflügt. Wie er dazu in der Lage ist, ist ein Geheimnis. Ich brauche mehr Daten über diese Kreatur!'),(284,641,'en','Left Quite the Impression','Guide Zorah Magdaros','Doesn\'t the sight of Zorah Magdaros make your heart skip a beat? Let me assure you, seeing its scales close up is just as awe-inspiring. It\'s imperative that we study it more.'),(285,1121,'en','Deep Snow Diver','Hunt a Beotodus','Beotodus is a fascinating piscine wyvern that has the ability to \"swim\" through the snow. How it is actually able to do this is a mystery. I must have more data on this creature!'),(286,891,'de','Der Ältestenfresser','Töte den Nergigante.','Der Nergigante ist eine gewaltige Bestie und uns fehlt noch viel Wissen über ihn. Deshalb brauche ich dich! Mit etwas Glück erleben wir einen Kampf zweier Drachenältester!'),(287,651,'de','Schwer zu verdauen','Erjage einen Gross-Jagras.','Wir haben einen beunruhigenden Bericht über einen besonders starken Gross-Jagras im Uralten Wald erhalten. Nimm schnell die Untersuchung auf, aber pass auf, er hat Heisshunger!'),(288,1122,'de','Ansturmdrang','Erjage einen Banbaro.','Ach, du hast mit dem riesigen Banbaro gekämpft, oder? Dickes Fell zum Schutz gegen die Kälte und gewaltige Hörner! Einfach unglaublich, nicht wahr? Ach, und wie er dann los...'),(289,651,'en','Hard to Swallow','Hunt a Great Jagras','We\'ve gotten a disturbing report of an unusually powerful Great Jagras appearing in the Ancient Forest. Begin your investigation ASAP, but beware its gluttonous appetite!'),(290,891,'en','The Eater of Elders','Slay Nergigante','Nergigante is one helluva beast, and still so much we don\'t know \'bout it. Which is why I need you! If we\'re lucky, we might get to see two elder dragons squaring off!'),(291,1122,'en','Taking Charge','Hunt a Banbaro','—and by the by, you\'ve locked horns with the gigantic Banbaro, yes? Thick fur to protect against the cold, and those massive horns! Simply astounding, yes? Oh, and the way it char—'),(292,1123,'de','Eisiger Fang!','Fange einen Beotodus.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorge du mir die Materialien, dann sehe ich zu, was ich tun kann! *Der 1. Abschluss verbessert den Ghillie-Mantel.'),(293,892,'de','Der Meister des Sturms','Töte einen Kushala Daora.','Wusstest du, dass manche Kulturen den Kushala Daora als Gott des Windes verehren? Glücklicherweise gehören wir nicht dazu. Allerdings sollten wir seinen Flug studieren!'),(294,1123,'en','Ice Catch!','Capture a Beotodus','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You go out and get me them materials and I\'ll see if I can sneak in an upgrade! (Upgrades the Ghillie Mantle upon first completion.)'),(295,892,'en','Master of the Gale','Slay a Kushala Daora','Did you know that some cultures worship Kushala Daora as a god of wind? Luckily, we\'re not one of them! I\'m determined to study its mastery of flight...just think of the benefits!'),(296,1124,'de','Ruf der Wildnis','Töte zehn Wulg.','Diese Wulg sind schon interessant! Die töten nicht sofort... Sie warten ab und wenn sich eine Chance bietet, holen sie ihre Freunde zur Hilfe. Mann, ich liebe Forschung!'),(297,1164,'en','Taster\'s Tour','Hunt a Pukei-Pukei','We\'ve got reports coming in from all locations confirming the existence of some unusually tough monsters. Head to their locations and begin your investigations ASAP.'),(298,1124,'en','Call of the Wild','Slay 10 Wulg','Those Wulg are an interesting bunch! They don\'t go in for the kill right away. Nope! They wait for a chance, and then call in their buddies to help. Maaan, I love researching!'),(299,1171,'de','All die falschen Signale','Erjage einen Tzitzi-Ya-Ku.','Einer meiner Forscher hat mit einer Prototypfunktion des Katzographie-Sets experimentiert, als ein Tzitzi-Ya-Ku das als Bedrohung wahrnahm. Der Forscher floh in Panik – um das Set zurückzubekommen, musst du das Monster loswerden.'),(300,1125,'de','Grüsse aus der Tundra','Liefere 20 Junge Pestwurz.','Der Chef möchte Junge Pestwurz untersuchen. Tu ihm den Gefallen und bring ihm welche, ja? Im Gegenzug für deine Hilfe wird er dein Leben dauerhaft erleichtern. *Der 1. Abschluss verbessert die Erntetruhe.'),(301,1171,'en','All the Wrong Signals','Hunt a Tzitzi-Ya-Ku','One of my researchers was out testing a prototype feature of the Surveyor Set when a Tzitzi-Ya-Ku mistook the flash as territorial threat. The researcher panicked and dropped the device. If we are to ever recover it, we\'ll need you to dispatch the creature first.'),(302,1125,'en','Greetings from the Tundra','Deliver 20 Young Butterburs','Bossman says he wants to examine some Young Butterburs, so do me a solid and grab some for me, will you? Says he\'ll upgrade the Harvest Box for you in return! (First completion upgrades the Harvest Box)'),(303,1181,'de','Grössenwahnsinniger Gross-Girros','Erjage einen Gross-Girros.','Forschung im Tal der Verwesung ist niemals eine leichte Aufgabe, da man ohne Schutzkleidung ruckzuck aufgeben muss. Und jetzt ist auch noch ein Gross-Girros mit seinen Freunden aufgetaucht – und da kommst du ins Spiel...'),(304,1131,'de','Spezialarena: MR Pukei-Pukei','Erjage einen Pukei-Pukei.','Ein neuer Herausforderer: Pukei-Pukei – der Giftraufer, die Prügelmaschine! Er gibt niemals auf! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(305,1181,'en','Grinding my Girros','Hunt a Great Girros','It\'s already quite difficult to get ANY research done in the Rotten Vale as it is. Merely existing in the vale without proper protection is enough to end you. And now a Great Girros has shown up with its little minions to complicate our work. Hunter, if you would, please.'),(306,1131,'en','Special Arena: MR Pukei-Pukei','Hunt a Pukei-Pukei','A new challenger: Pukei-Pukei, the Toxic Tussler, the Lickin\' Machine! He won\'t listen when you say \"no tongues\"! Two fighters enter the Special Arena, but only one leaves!'),(307,1191,'de','Arbeitsverweigerung','Erjage einen Dodogama.','Wir haben hier ein seltsames Problem: Die Forschung in der Heimat der Ältesten ist dank eines temperamentvollen Dodogama zum Stillstand gekommen und die meisten unserer Jägern verweigern den Dienst, weil sie denken, er sei \"niedlich\"!'),(308,737,'de','Spezialarena: HR Diablos','Erjage einen Diablos.','Ein neuer Herausforderer: Diablos – der Sandsturm, der Grosse Graber! Die Gefahr aus dem Untergrund! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(309,1191,'en','Can\'t Bring Yourself To It','Hunt a Dodogama','We\'re facing a rather unique issue at the moment. Research in the recess has come to a halt due to a rather rambunctious Dodogama. However, most of our hunters are refusing to hunt it because they think Dodogama are...\"cute.\"'),(310,893,'de','Die Festung des Höllenfeuers','Töte einen Teostra.','Teostra. Schon bei dem Namen fängt mein Federkiel an zu zittern. Manche glauben, es bedeute Unglück, ihm das Fell über die Ohren zu ziehen, aber wir müssen ihn erforschen!'),(311,737,'en','Special Arena: HR Diablos','Hunt a Diablos','A new challenger: Diablos, the Sandy Stampede, Biggus Diggus! Don\'t hang around if he\'s underground! The gloves are off—not that we have gloves that big...'),(312,1192,'de','Im Land der grossen Hörner','Erjage einen Banbaro.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorge mir unbedingt die Materialien, damit ich loslegen kann! *Der 1. Abschluss verbessert den Lebenskraft-Mantel.'),(313,893,'en','Hellfire\'s Stronghold','Slay a Teostra','Teostra. Just saying the name makes my quill tip quiver. Some believe it\'s bad luck to cut the fur from this regal beast, but for the sake of the future, we must study it!'),(314,1192,'en','This Here\'s Big Horn Country!','Hunt a Banbaro','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. It\'s vital that you go out and get me them materials so I can get to work! (Upgrades the Vitality Mantle upon first completion.)'),(315,894,'de','Der Ältestenfresser','Töte den Nergigante.','Der Nergigante ist eine gewaltige Bestie und uns fehlt noch viel Wissen über ihn. Deshalb brauche ich dich! Mit etwas Glück erleben wir einen Kampf zweier Drachenältester!'),(316,1201,'de','Angriffsbereit','Erjage einen Viper-Tobi-Kadachi.','In der Nähe des Viper-Tobi-Kadachi bringen die Spähkäfer nichts. Los, kümmere dich darum, dann geht es weiter.'),(317,1132,'de','Spezialarena: MR Barroth','Erjage einen Barroth.','Ein neuer Herausforderer: Barroth – der Kopfnusskoloss, der Schädelspalter! Verlieren verboten! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(318,1201,'en','Ready to Strike','Hunt a Viper Tobi-Kadachi','The scoutflies are useless with that Viper Tobi-Kadachi around. Get in there and do what you do best so we can keep pushing forward.'),(319,1132,'en','Special Arena: MR Barroth','Hunt a Barroth','A new challenger: Barroth, the Hulking Headbutt, the Skullcracker! Lose to this guy, and your name is mud! Two fighters enter the Special Arena, but only one leaves!'),(320,1202,'de','Keine Zeit für Nickerchen','Erjage einen Nachtschatten-Paolumu.','Ziel: Nachtschatten-Paolumu. Berichten zufolge führte der erste Kontakt zu extremer Benommenheit. Dann endet der Bericht. Los, <LSNR {Partner} {Partnerin}>! Ich bin gespannt, was du machst!'),(321,1133,'de','Spezialarena: MR Tobi-Kadachi','Erjage einen Tobi-Kadachi.','Ein neuer Herausforderer: Tobi-Kadachi – die Sprungechse, der Bissmeister! Macht dich mit Donnerschlag fertig! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(322,1202,'en','No Time for Naps','Hunt a Nightshade Paolumu','Target: Nightshade Paolumu. Reports indicate that first contact resulted in extreme drowsiness. That\'s where the report ends... Let\'s get to it, uh, Partner! Excited to see what you can do!'),(323,1133,'en','Special Arena: MR Tobi-Kadachi','Hunt a Tobi-Kadachi','A new challenger: Tobi-Kadachi, the Leaping Lizard, the Bitemaster! He\'ll clean your clock with thunder shocks! Two fighters enter the Special Arena, but only one leaves!'),(324,1203,'de','Gegeneinander ausgespielt','Erjage einen Korallen-Pukei-Pukei.','Ziel: Korallen-Pukei-Pukei. Berichten zufolge führte der erste Kontakt zu... Wasserstrahlen? Dann endet der Bericht. Los, äh, <LSNR {Partner} {Partnerin}>! Ich bin gespannt, was du machst!'),(325,1134,'de','Spezialarena: MR Banbaro','Erjage einen Banbaro.','Ein neuer Herausforderer: Banbaro, der Wächter der Weite! Wenn er im Ring ist, geht\'s mit harten Bandagen zur Sache! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(326,1203,'en','Play Both Ends','Hunt a Coral Pukei-Pukei','Target: Coral Pukei-Pukei. Reports indicate that first contact was greeted with blasts of...water? That\'s where the report ends... Let\'s get to it, uh, Partner! Excited to see what you can do!'),(327,1134,'en','Special Arena: MR Banbaro','Hunt a Banbaro','A new challenger: Banbaro, the Ruler of the Reach, the Champ of Tramp! If you can\'t dig your own grave, he\'ll dig it for you! Two fighters enter the Special Arena, but only one leaves!'),(328,1221,'de','Analyse führt zu Paralyse','Erjage einen Viper-Tobi-Kadachi.','Kann... nicht... bewegen... gebissen von... Viper... Tobi-Kadachi... Gift... in... meiner... Blutlaufbahn. Stecke... in... fiesen... Schwierigkeiten. Hilf... mir... bitte!'),(329,1151,'de','Der Gross-Jagras kehrt zurück!','Erjage einen Gross-Jagras.','Ich brauche die Hilfe der Ersten Wyverianer, um eine neue Dekoration herzustellen, aber eine aufgeblasene Echse steht mir im Weg. Kümmerst du dich bitte um sie?'),(330,1221,'en','Analysis Creates Paralysis','Hunt a Viper Tobi-Kadachi','Can\'t...move... Bitten...by...a Viper...Tobi-Kadachi... Poison...seeping...into...my bloodstream... In...lots...of trouble... Help...me...please...!'),(331,1222,'de','Gift und Lähmung','Fange einen Viper-Tobi-Kadachi.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorge mir die Materialien, dann kann ich deine Werkzeuge vielleicht boosten! *Der 1. Abschluss verbessert den Reiniger-Booster.'),(332,738,'de','Spezialarena: HR Schwarze Diablos','Erjage eine Schwarze Diablos.','Eine neue Herausforderin: Schwarze Diablos – die Dunkle Zerstörerin, der Hornexpress! Renn bloss weg! Hier steht mehr als nur Ruhm und Ehre auf dem Spiel!'),(333,894,'en','The Eater of Elders','Slay Nergigante','Nergigante is one helluva beast, and still so much we don\'t know \'bout it. Which is why I need you! If we\'re lucky, we might get to see two elder dragons squaring off!'),(334,738,'en','Special Arena: HR Black Diablos','Hunt a Black Diablos','A new challenger: Black Diablos, the Dark Destroyer, the Horn Express! Run, don\'t walk, from this furious fiend! The gloves are off—not that we have gloves that big...'),(335,751,'de','Die Rathalos-Revanche','Erjage einen Rathalos.','Wir haben einen beunruhigenden Bericht über noch einen ungewöhnlich starken Rathalos im Uralten Wald erhalten. Zeig der roten Bestie, wer hier der wahre Herr im Haus ist!'),(336,1271,'de','Das Problem des Paolumu','Erjage einen Paolumu.','Da Einsätze in den Hinterlanden immer länger dauern, benötigen unsere Forscher gut isolierte und bequeme Kleidung für ausgedehnte Aufenthalte im Freien. Also brauche ich Materialien, um einen Prototypen zu schneidern.'),(337,1271,'en','The Plight of Paolumu','Hunt a Paolumu','As operations in the Hinterlands expand further, our researchers require gear that is not only well-insulated but comfortable for long hours of field work. I\'m interested in having a prototype developed, however I\'ll need some materials before we can start.'),(338,1272,'de','Weibliche Machtübernahme','Erjage eine Rosa Rathian.','Durch die Abwanderung der Legiana ist im Korallenhochland ein Machtvakuum entstanden... und eine Rosa Rathian versucht sich das zu Nutze zu machen. Die Auswirkungen auf die Nahrungskette sind unvorhersehbar, also unternimm was... bitte!'),(339,1151,'en','The Great Jagras Returns!','Hunt a Great Jagras','I need to consult with the First Wyverians about this new decoration I want to create, but there\'s some bloated lizard standing in the way. Be a dear and please take care of it, will you?'),(340,1272,'en','Pink Power Grab','Hunt a Pink Rathian','The exodus of Legiana has created a power vacuum in the Coral Highlands. A rather fearsome Pink Rathian seems inclined to fill that void. However, her reign is having a detrimental effect on the food chain. I ask that you go out and usurp the throne, Hunter!'),(341,1222,'en','Poison and Paralysis Pinch','Capture a Viper Tobi-Kadachi','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You go out and get me them materials and I\'ll see if I can boost your tools with an upgrade! (Upgrades the Cleanser Booster upon first completion.)'),(342,1273,'de','Profi-Tipp: Bleib hydriert','Erjage einen Korallen-Pukei-Pukei.','Korallen-Pukei-Pukei haben spezielle Organe, um Wasser zu speichern. Ich muss mir die für meine Notizen näher ansehen und dich ausnahmsweise um einen Gefallen bitten, <LSNR {Jäger} {Jägerin}>.'),(343,1152,'de','Giftiges Kerlchen','Erjage einen Pukei-Pukei.','Es ist nahezu unmöglich, eine Probe aus dem Uralten Wald zu bekommen, ohne von dem Giftschleim dieses Untiers kontaminiert zu werden. Hilf mir bitte, ja?'),(344,1353,'de','Das Geheimnis eines guten Stücks','Erjage einen Glavenus.','Einige der neu entdeckten Monster der Neuen Welt wurden an anderen Orten gesichtet. In ihrer neuen Heimat verhalten sie sich wohl anders, also mach dich auf und finde mehr heraus!'),(345,1152,'en','New World Problems','Hunt a Pukei-Pukei','It\'s nearly impossible to obtain a sample from the Ancient Forest without it being contaminated by that blasted monster\'s poisonous slobber! Please, Hunter. Deal with it, won\'t you?'),(346,1223,'de','Boaboa Constrictor','Besiege 14 Boaboa.','Heeey du da! Ich habe ein paar grossartige Entwürfe parat, aber ich brauche dich, um ihnen den letzten Schliff zu verleihen! Hilf mir mit dieser Quest, dann bekommst du ein Spezial-Ticket!'),(347,1153,'de','Ohne Umschweife','Erjage einen Tobi-Kadachi.','Einer meiner Forscher versteckt sich im Uralten Wald in einem Busch, weil er \"Angst\" vor einem Tobi-Kadachi hat. Der Kerl ist eine faule Socke, macht seine Arbeit aber gut. Befreie ihn bitte!'),(348,1353,'en','The Secret to a Good Slice','Hunt a Glavenus','Some of the newly discovered monsters in the New World have been sighted in other locales. The shift in surroundings will most likely have a significant effect on their behavior, head to their location and investigate immediately.'),(349,1273,'en','Protip: Stay Hydrated','Hunt a Coral Pukei-Pukei','Coral Pukei-Pukei possess specialized organs to store the water they consume. I\'d like to have a closer look at it for my notes, so I\'ll have to call in a favor just this once, Hunter.'),(350,1223,'en','Boaboa Constrictor','Defeat 14 Boaboa','Duuuude! I got these sick drafts cooked up! Just, uh, they need a few more tweaks. Yo, help me out with this quest, and stuff, and you can get a special ticket. Pretty sweet, right?'),(351,1153,'en','Beating Around the Bush','Hunt a Tobi-Kadachi','One of my researchers is out in the Ancient Forest hiding in a bush because he\'s \"afraid\" of a Tobi-Kadachi. I know he\'s just dawdling about. Please dispatch the monster so he can get back to work!'),(352,1354,'de','Trümpfe in Rot und Schwarz','Erjage alle Zielmonster.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorge die Materialien, dann geht es mit deinem Mantel höher hinaus! *Der 1. Abschluss verbessert den Gleiter-Mantel.'),(353,1274,'de','Verantwortungsbewusstes Trinken','Erjage einen Korallen-Pukei-Pukei.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Dieser Mantel mag wasserdicht sein, aber da geht noch mehr! *Der 1. Abschluss verbessert den Wasserschutz-Mantel.'),(354,1224,'de','Mit vereinter Kraft','Erjage einen Beotodus.','Das Ziel unseres Einsatzes ist der furchterregende Beotodus! Bring erst einen Pepe ins Freie, um das Monster anzulocken. Wenn der frostige Fisch den Köder schluckt, stürzen wir los!'),(355,1354,'en','Red and Black Aces','Hunt all target monsters','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You go out and get me them materials I need and I\'ll make sure your mantle soars to new heights! (Upgrades the Glider Mantle upon first completion.)'),(356,1224,'en','By Our Powers Combined','Hunt a Beotodus','Our target of this joint operation is the fearsome Beotodus! First, drive a Popo out in the open to lure the monster out. Then when that frosty fishy takes the bait, we\'ll ambush it!'),(357,1154,'de','Literaturdieb','Erjage einen Kulu-Ya-Ku.','Einer dieser verdammten Kulu-Ya-Ku hat ein Buch gestohlen, das ich einem Feldforscher geliehen habe. Kümmere dich bitte sofort um die Bestie. Oh, und sieh auch nach dem Forscher.'),(358,1361,'de','Wüstenwahnsinn','Erjage einen Diablos.','Unsere Forscher möchten die Kakteen in der Wildturm-Ödnis unter die Lupe nehmen, aber wann immer sie sich ihnen nähern, greift ein aggressiver Diablos an...'),(359,1154,'en','Literary Thief','Hunt a Kulu-Ya-Ku','One of those blasted Kulu-Ya-Ku has stolen a very dear book that I leant to a field researcher. Take care of that despicable creature at once. Oh, and I suppose check on the researcher if you have time...'),(360,1155,'de','Fange den Baumdrescher','Fange einen Banbaro.','Dieses verdammte Miaunster raubt mir noch den letzten Nerv! Kannst du bitte losziehen und mal wieder alles geben, damit wir im Gegenzug diese Zutaten bekommen? *Der 1. Abschluss schaltet neue Kantinenzutaten frei.'),(361,1155,'en','Trapping The Tree Trasher','Capture a Banbaro','Tail shakes alive, this meownster is gettin\' on my last nerve! Can you please go out there and smack that overgrown pot roast upside the head so we can get these ingredients? (Canteen ingredients added upon first completion.)'),(362,1161,'de','Wildturm-Schatzsuche','Erjage einen Kulu-Ya-Ku.','Wir erhalten von überall her Berichte, die die Existenz einiger ungewöhnlich starker Monster bestätigen. Reise an die Sichtungsorte und beginne sofort mit den Untersuchungen.'),(363,1161,'en','Wildspire Treasure Hunt','Hunt a Kulu-Ya-Ku','We\'ve got reports coming in from all locations confirming the existence of some unusually tough monsters. Head to their locations and begin your investigations ASAP.'),(364,1225,'de','Eine Hand wäscht die andere','Erjage einen Beotodus.','Dank dir kennen die hiesigen Lynianer uns jetzt! Ich würde sie gern besuchen, aber leider steht ein Beotodus im Weg. Bitte hilf mir, der Wissenschaft zuliebe!'),(365,1162,'de','Durch den Schlamm gezogen','Erjage einen Barroth.','Die Finanzabteilung stresst rum, weil wir zu viel Geld für Textilreinigungen ausgeben – wegen dieser schlammigen Bestie Barroth! Schalte den Schmutzfink aus... zum Wohle der Umwelt und unseres Zenny-Bestandes!'),(366,1225,'en','You Scratch Our Backs...','Hunt a Beotodus','Thanks to your efforts, we\'ve made fellowship with the local Lynians! I\'d like to pay them a visit, but a meddling Beotodus is in the way. Please, for science, assist me!'),(367,1162,'en','Dragged Through the Mud','Hunt a Barroth','Accounting has been going on and on about how much zenny we spend on laundry. Well perhaps if there wasn\'t a Barroth out in the wastes flinging mud everywhere we could stay within our budget!'),(368,1163,'de','Schlammschlacht','Erjage einen Jyuratodus.','Ich brauche die Hilfe der Ersten Wyverianer, um eine neue Dekoration herzustellen, aber ein riesiger hässlicher Fisch ist mir im Weg. Kümmerst du dich bitte um ihn?'),(369,1231,'de','Spezialarena: MR Anjanath','Erjage einen Anjanath.','Ein neuer Herausforderer: Anjanath, der Kiefer des Todes, die haarige Bestie! Bring dich in Sicherheit, wenn Anja naht! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(370,1274,'en','Put That Red Cup Away','Hunt a Coral Pukei-Pukei','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. This mantle may be waterproof but it sure as heck ain\'t upgrade-proof! (Upgrades the Waterproof Mantle upon first completion.)'),(371,1163,'en','Jyura In My Way','Hunt a Jyuratodus','I need to consult with the First Wyverians about this new decoration I want to create, but there\'s a Joora...Jeeura—a big ugly fish in the way! Be a dear and please take care of it, will you?'),(372,1231,'en','Special Arena: MR Anjanath','Hunt an Anjanath','A new challenger: Anjanath, the Jaws of Death, the Stompasaurus! He\'s just stopped by for a quick bite! Two fighters enter the Special Arena, but only one leaves!'),(373,1281,'de','Lachhaft','Erjage einen Radobaan.','Oh Mann... Hahaha! Einer meiner Forscherinnen wurde *kicher* von einem Radobaan angegriffen *lach* und auf der Flucht verlor sie ihre Aufzeichnungen, die am Teer des Monsterkörpers steckenblieben. *tränenwisch* Ihr Lebenswerk klebt an seinem Körper!'),(374,1232,'de','Spezialarena: MR Radobaan','Erjage einen Radobaan.','Ein neuer Herausforderer: Radobaan, der rollende Rüpel, der stachlige Stecher. Weiche aus, sonst endest du aufgespiesst! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(375,1361,'en','A Line in the Sand','Hunt a Diablos','Our researchers are finding it nearly impossible to study the cacti out in the wastes. Even attempting to get close to a cactus patch triggers a Diablos attack from below...'),(376,1232,'en','Special Arena: MR Radobaan','Hunt a Radobaan','A new challenger: Radobaan, the Roto-Ravager, the Grinder! Better dodge fast, or you\'ll be boned! Two fighters enter the Special Arena, but only one leaves!'),(377,1233,'de','Spezialarena: MR Korallen-Pukei-Pukei','Erjage einen Korallen-Pukei-Pukei.','Ein neuer Herausforderer: Korallen-Pukei-Pukei, die clownhafte Klaue, der glubschäugige Globetrotter. Kralle ihn dir! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(378,1233,'en','Special Arena: MR Coral Pukei-Pukei','Hunt a Coral Pukei-Pukei','A new challenger: Coral Pukei-Pukei, the Savage Sprayer, the Blast Master! Watch out or he\'ll take you to the cleaners! Two fighters enter the Special Arena, but only one leaves!'),(379,1234,'de','Spezialarena: MR Viper-Tobi-Kadachi','Erjage einen Viper-Tobi-Kadachi.','Ein neuer Herausforderer: Viper-Tobi-Kadachi, der dröhnende Dekan des Donners. Wenn er dich beisst, beisst du ins Gras! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(380,1234,'en','Special Arena: MR Viper Tobi-Kadachi','Hunt a Viper Tobi-Kadachi','A new challenger: Viper Tobi-Kadachi, The Boss of Blight, the Number One Stunner! He bites you, you bite the dust! Two fighters enter the Special Arena, but only one leaves!'),(381,1235,'de','Spezialarena: MR Rathian','Erjage eine Rathian.','Eine neue Herausforderin: Rathian – die Königin der Luft, die Himmelsspalterin! Vorsicht, sie ist pures Gift! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(382,1235,'en','Special Arena: MR Rathian','Hunt a Rathian','A new challenger: Rathian, the Queen o\' Green, the Skyborne Slasher! Don\'t get the lady angry; she\'s poison! Two fighters enter the Special Arena, but only one leaves!'),(383,1236,'de','Spezialarena: MR Rosa Rathian','Erjage eine Rosa Rathian.','Ein neuer Herausforderer: Rosa Rathian, die brennende Blüte, die schlichte Schönheit. Halte dich von dieser Rose fern! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(384,1236,'en','Special Arena: MR Pink Rathian','Hunt a Pink Rathian','A new challenger: Pink Rathian, the Burning Blossom, the Beauty Who Bites! Best not stop to smell the roses! Two fighters enter the Special Arena, but only one leaves!'),(385,1237,'de','Spezialarena: MR Paolumu','Erjage einen Paolumu.','Ein neuer Herausforderer: Paolumu, der pedrohlich prügelnde Purche! Ein echter Pastard! Chleudere den Widerporst zu Poden! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(386,1237,'en','Special Arena: MR Paolumu','Hunt a Paolumu','A new challenger: Paolumu, the Punishing Puffball, the Fearigible! It may not be fair, but he\'s walking on air! Two fighters enter the Special Arena, but only one leaves!'),(387,1281,'en','No Laughing Matter','Hunt a Radobaan','Oh, dear...hahaha! One of my researchers *snicker* was attacked by a Radobaan and—as she was running away—all of her research notes got stuck to the tar on its body. So, as we speak, there\'s a Radobaan rolling around the vale with her life\'s work glued to it... BWAHAHAHA!'),(388,1238,'de','Spezialarena: MR Nachtschatten-Paolumu','Erjage einen Nachtschatten-Paolumu.','Ein neuer Herausforderer: Nachtschatten-Paolumu, der Sultan des Schlafs! Zählst du Schäfchen, sind deine Tage gezählt! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(389,1282,'de','Käfer-Krampf','Töte alle Zielmonster.','Ich möchte mit einem Ersten Wyverianer über eine Dekoration reden, die ich herstellen möchte, aber der Kommandant lässt mich wegen der grossen, gruseligen Monster nicht gehen. Kannst du \"mir raushelfen\", wie ihr Jungspunde immer sagt?'),(390,1238,'en','Special Arena: MR Nightshade Paolumu','Hunt a Nightshade Paolumu','A new challenger: Nightshade Paolumu, the Sultan of Slumber, the Flightmare! Get caught in the sleeper hold, and it\'s lights out! Two fighters enter the Special Arena, but only one leaves!'),(391,1362,'de','Ein Aufblitzen der Klinge','Erjage einen Glavenus.','Ach, du hast mit dem furchterregenden Glavenus gekämpft, oder? Wie er seinen glänzenden Schwertschwanz einsetzt! Einfach erstaunlich, oder? Und wie er ihn dann in sein...'),(392,1282,'en','Bugger Off Bugs!','Slay all target monsters','I want to speak with a First Wyverian about a decoration I want to meld, but the Commander won\'t let me go out with all these \"big scary\" monsters around. Can you \"hang a girl up?\" as you kids say.'),(393,1164,'de','Verkoster unterwegs','Erjage einen Pukei-Pukei.','Wir erhalten von überall her Berichte, die die Existenz einiger ungewöhnlich starker Monster bestätigen. Reise an die Sichtungsorte und beginne sofort mit den Untersuchungen.'),(394,1362,'en','A Flash of the Blade','Hunt a Glavenus','—and by the by, you\'ve crossed blades with the fearsome Glavenus, yes? The way it wields its gleaming, sword tail! Simply astounding, yes? Oh, and how it sharpens it in its—'),(395,1291,'de','Auf der Suche nach dem alten Leuchten','Liefere 20 Stück Gaia-Bernstein.','Der Chef hat eine Theorie zu Gaia-Bernstein, die er gerne testen möchte. Im Gegenzug für deine Hilfe wird er dein Leben dauerhaft erleichtern. *Der 1. Abschluss verbessert die Erntetruhe.'),(396,1291,'en','Looking For That Glimmer','Deliver 20 Gaia Ambers','Bossman says he\'s got some theories about Gaia Amber that he\'d like to test. In return for your help, he\'ll upgrade the Harvest Box. (Upgrades the Harvest Box upon first completion.)'),(397,1301,'de','Blizzard-Blitzaktion','Erjage einen Barioth.','Gerüchten zufolge ist in der Weite ein Barioth unterwegs. Die zwei untersuchen noch die Trümmer, aber sie müssen jetzt zurückkommen. Bring sie sicher zurück!'),(398,1251,'de','Anjanath-Ärger','Erjage einen Anjanath.','Wenn ich noch einen einzigen weiteren rotzbedeckten Bericht erhalte, DREHE ICH KOMPLETT DURCH! Gibt es denn nichts, wovon diese ekelhafte Bestie ihren Schleim fernhält?'),(399,1433,'de','Spezialarena: MR Säure-Glavenus','Erjage einen Säure-Glavenus.','Ein neuer Herausforderer: Säure-Glavenus, der Ruin aller Rüstungen! Du denkst, sein Schwanz ist stumpf? Welch Irrtum! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(400,1301,'en','Blizzard Blitz','Hunt a Barioth','Reports have been coming in about a Barioth roaming around the Reach. Those two are still examining the wreckage, but we\'ll need them to retreat for now. Get out there and bring them back safely!'),(401,1251,'en','Anjanath Antics','Hunt an Anjanath','I swear, if I have to handle one more report covered in snot, I\'m going to have a fit! Is there not anything that disgusting beast won\'t blow its mucus all over!?'),(402,1433,'en','Special Arena: MR Acidic Glavenus','Hunt an Acidic Glavenus','A new challenger: Acidic Glavenus, the Colonel of Corrosion, The Dino Dueler! There\'s no stoppin\' once he gets to choppin\'! Two fighters enter the Special Arena, but only one leaves!'),(403,1302,'de','Allgegenwärtiger Schatten','Erjage einen Nargacuga.','Seit der Ankunft des Velkhana ist das Ökosystem der Neuen Welt durcheinander. Es war wohl unumgänglich, dass ein Monster wie der Nargacuga auftaucht. Geh hin und kümmere dich drum.'),(404,1252,'de','Hoffnungsloser Fall','Erjage eine Rathian.','Himmel! Einer meiner Forscher ist komplett von einer Rathian besessen, die er beobachten soll. Inzwischen kommt er kaum noch zur Basis zurück, um zu berichten. Unternimm was... bitte!'),(405,1363,'de','Köcheln und schnippeln!','Erjage alle Zielmonster.','Diese verdammten Miaunster rauben mir noch den letzten Nerv! Kannst du bitte losziehen und mal wieder alles geben, damit wir im Gegenzug diese Zutaten bekommen? *Der 1. Abschluss schaltet neue Kantinenzutaten frei.'),(406,1302,'en','Ever-present Shadow','Hunt a Nargacuga','Velkhana\'s arrival in the New World has thrown the ecosystem out of whack. I guess it was inevitable that a monster like a Nargacuga would show up. Get out there and take care of it.'),(407,1252,'en','Fool\'s Mate','Hunt a Rathian','Dear Gog... One of my researchers is absolutely obsessed with a particular Rathian he has been observing. So much so that he rarely returns to base anymore to report. I ask that you do something about it before things get...weird.'),(408,1303,'de','Die Brennende Klinge','Erjage einen Glavenus.','Seit der Ankunft des Velkhana ist das Ökosystem der Neuen Welt durcheinander. Es war wohl unumgänglich, dass ein Monster wie der Glavenus auftaucht. Geh hin und kümmere dich drum.'),(409,1253,'de','Gute Nacht, Nachtschatten','Fange einen Nachtschatten-Paolumu.','Dieses verdammte Miaunster raubt mir noch den letzten Nerv! Kannst du bitte losziehen und diesem hässlichen Ding eine Lektion erteilen, damit wir im Gegenzug diese Zutaten bekommen? *Der 1. Abschluss schaltet neue Kantinenzutaten frei.'),(410,1434,'de','Spezialarena: MR Vulkan-Odogaron','Erjage einen Vulkan-Odogaron.','Ein neuer Herausforderer: Vulkan-Odogaron, der Höllenhund auf dem Weg zum Himmel; stell dich tot, bevor du es wirklich bist! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(411,1303,'en','The Scorching Blade','Hunt a Glavenus','Velkhana\'s arrival in the New World has thrown the ecosystem out of whack. I guess it was inevitable that a monster like a Glavenus would show up. Get out there and take care of it.'),(412,1253,'en','Nighty Night Nightshade','Capture a Nightshade Paolumu','Tail shakes alive, this meownster is gettin\' on my last nerve! Can you please go out there and smack that ugly thing upside its ugly head so we can get these ingredients? (Canteen ingredients added upon first completion.)'),(413,1434,'en','Special Arena: MR Ebony Odogaron','Hunt an Ebony Odogaron','A new challenger: Ebony Odogaron, the Overlord of Onyx, the Hell-hound that Pounds! He\'ll teach you to sit, roll over, and play dead! Two fighters enter the Special Arena, but only one leaves!'),(414,1304,'de','Absolute Macht','Erjage einen Tigrex.','Durch den Einfluss des Velkhana tauchen überall neue Monster auf, auch im Tal der Verwesung. Geh los und untersuche diesen Tigrex. Aber nimm dich vor seinem Brüllen in Acht!'),(415,1261,'de','Ruhende Königin','Erjage eine Rathian.','Ich möchte mit einem Ersten Wyverianer über eine Dekoration reden, die ich herstellen möchte, aber der Kommandant lässt mich wegen der grossen, gruseligen Monster nicht gehen. Kannst du \"mir raushelfen\", wie ihr Jungspunde immer sagt?'),(416,1435,'de','Spezialarena: MR Fulgur-Anjanath','Erjage einen Fulgur-Anjanath.','Ein neuer Herausforderer: Fulgur-Anjanath, der dreiste Dino, Tyrannosaurus Schreck! Boogie Woogie, Woogie-Wunderland! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(417,1261,'en','A Queen At Heart','Hunt a Rathian','I want to speak with a First Wyverian about a decoration I want to meld, but the Commander won\'t let me go out with all these \"big scary\" monsters around. Can you \"hang a girl up?\" as you kids say.'),(418,1304,'en','Absolute Power','Hunt a Tigrex','New monsters are popping up everywhere due to Velkhana\'s influence, even in the Rotten Vale. Head out and investigate this Tigrex. Be cautious of its piercing roar.'),(419,1435,'en','Special Arena: MR Fulgur Anjanath','Hunt a Fulgur Anjanath','A new challenger: Fulgur Anjanath, the Shock-o-saurus, T-Wrecks! He\'s electric! Boogie Woogie, Woogie! Two fighters enter the Special Arena, but only one leaves!'),(420,1262,'de','Albtraumhaftes Gesicht','Erjage einen Nachtschatten-Paolumu.','Ich ging meiner Wege, als diese hässliche Fratze aus dem Nichts kam und miaute. Hat mich zu Tode erschreckt, ich habe immer noch Albträume! Kannst du dem Biest bitte eine Lektion erteilen?'),(421,1305,'de','Vernichtender Konter','Erjage einen Brachydios.','Durch den Einfluss des Velkhana tauchen überall neue Monster auf, auch in der Heimat der Ältesten. Geh los und untersuche diesen Brachydios. Nimm dich vor seinen Schleimangriffen in Acht.'),(422,1262,'en','A Face Nightmares Are Made Of','Hunt a Nightshade Paolumu','There I was, minding meow-n business, when suddenly the ugliest face I\'d ever seen jumped out at me. I must have fainted, but when I came to, it was gone. I know it\'s still out there... Out there with its hideous face! Please, Hunter! I still have nightmares about it!'),(423,1305,'en','A Smashing Cross Counter','Hunt a Brachydios','New monsters are popping up everywhere due to Velkhana\'s influence, even in the Elder\'s Recess. Head out and investigate this Brachydios. Be cautious of its explosive slime attacks.'),(424,1263,'de','Stecke deine Nase woanders rein','Erjage einen Anjanath.','Wir erhalten von überall her Berichte, die die Existenz einiger ungewöhnlich starker Monster bestätigen. Reise an die Sichtungsorte und beginne sofort mit den Untersuchungen.'),(425,1306,'de','Eine Geschichte von Eis und Feuer','Wehre den Velkhana ab.','Da sich alle so ins Zeug gelegt haben, wissen wir jetzt, dass der Velkhana in der Heimat der Ältesten ist. Warum, wissen wir nicht, aber wir brauchen die besten Jäger. Also dich!'),(426,1263,'en','Stick Your Nose Somewhere Else','Hunt an Anjanath','We\'ve got reports coming in from all locations confirming the existence of some unusually tough monsters. Head to their locations and begin your investigations ASAP.'),(427,1306,'en','A Tale of Ice and Fire','Repel Velkhana','Thanks to everyone\'s diligent efforts, we know that Velkhana is in the Elder\'s Recess. We don\'t know why it\'s there, but we need our best hunters on the job. That means you!'),(428,1264,'de','Königinnen durch und durch','Erjage alle Zielmonster.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorge die Materialien, dann bekommen deine Werkzeuge eine gesunde Verbesserung! *Der 1. Abschluss verbessert den Gesundheit-Booster.'),(429,1321,'de','Weisst du noch...?','Erjage einen Barioth.','Also, der Barioth... ein brutaler, lebendiger Schneesturm. Da fällt mir ein, wie ich einmal auf der Jagd war... Weisst du was? Schon gut. Ich überlasse es dir.'),(430,1264,'en','Feisty Girl Talk','Hunt all target monsters','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You go out and get me them materials and I\'ll make sure your tools get a healthy upgrade! (Upgrades the Health Booster upon first completion.)'),(431,1321,'en','Remember That One Time?','Hunt a Barioth','So yeah, the Barioth...a violent snowstorm personified. It reminds me of this one time I had to go on a hunt for... You know what? Never mind. I\'ll leave this to you.'),(432,1451,'de','Azurblaue Augen sehen alles','Erjage einen Azurnen Rathalos.','Wir erhalten von überall her Berichte, die die Existenz einiger ungewöhnlich starker Monster bestätigen. Reise an die Sichtungsorte und beginne sofort mit den Untersuchungen.'),(433,1363,'en','Simmer and Slice!','Hunt all target monsters','Tail shakes alive, these meownsters are gettin\' on my last nerve! Can you please go out there and smack those two upside the head so we can get these ingredients? (Canteen ingredients added upon first completion.)'),(434,1322,'de','Projekt M.I.A.U.: Stein','Fange einen Tigrex.','Projekt M.I.A.U. läuft... da wäre nur ein kleines Problem: ein Tigrex! Schnapp ihn dir, während wir uns die Beute krallen! *Der 1. Abschluss schaltet neue Einrichtungselemente frei.'),(435,1451,'en','These Azure Eyes See All','Hunt an Azure Rathalos','We\'ve got reports coming in from all locations confirming the existence of some unusually tough monsters. Head to their locations and begin your investigations ASAP.'),(436,1371,'de','Lahmer Legiana','Erjage einen Legiana.','Dank der Legiana-Migration in die Hinterlande gibt es nur noch wenige Exemplare im Korallenhochland. Einer hat wohl den Anschluss verpasst und wurde dort gesichtet. Diese Gelegenheit dürfen wir uns nicht entgehen lassen!'),(437,1322,'en','The Purr-fect Room: Stone','Capture a Tigrex','P.U.R.R. is in fur effect...with just one minor hiccup: a Tigrex! Nab that angry tabby while we sneak past to grab the goods! (Room decoration added upon first completion.)'),(438,1371,'en','Legiana Left Behind','Hunt a Legiana','Due to the Legiana migrating to the Hinterlands, there has been a shortage of specimen to study in the Coral Highlands. However, a straggler has been spotted recently. We can\'t let this opportunity go to waste!'),(439,1452,'de','Pech im Walde','Erjage einen Vulkan-Odogaron.','Einige der neu entdeckten Monster der Neuen Welt wurden an anderen Orten gesichtet. In ihrer neuen Heimat verhalten sie sich wohl anders, also mach dich auf und finde mehr heraus!'),(440,1372,'de','Der schwarze Wind','Erjage einen Nargacuga.','Einige der neu entdeckten Monster der Neuen Welt wurden an anderen Orten gesichtet. In ihrer neuen Heimat verhalten sie sich wohl anders, also mach dich auf und finde mehr heraus!'),(441,1452,'en','Misfortune in the Forest','Hunt an Ebony Odogaron','Some of the newly discovered monsters in the New World have been sighted in other locales. The shift in surroundings will most likely have a significant effect on their behavior, head to their location and investigate immediately.'),(442,1323,'de','Der stolze Weisse Ritter','Erjage einen Barioth.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorge mir die Materialien, dann hilft die Verbesserung dir bei irren Manövern! *Der 1. Abschluss verbessert den Ausweich-Mantel.'),(443,1372,'en','The Black Wind','Hunt a Nargacuga','Some of the newly discovered monsters in the New World have been sighted in other locales. The shift in surroundings will most likely have a significant effect on their behavior, head to their location and investigate immediately.'),(444,1461,'de','Im Eifer des Gefechts','Erjage eine Schwarze Diablos.','Einer unserer Forscher ist einer Schwarzen Diablos nachgestellt und hat dabei versehentlich ein Lockmittel verschüttet. Jetzt stellt die liebestolle Bestie ihm nach! Befreie ihn aus dieser Lage!'),(445,1323,'en','Proud White Knight','Hunt a Barioth','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You get me them materials and this upgrade will have you bobbin\' and weavin\' like there\'s no tomorrow! (Upgrades the Evasion Mantle upon first completion.)'),(446,1461,'en','In the Heat of the Moment','Hunt a Black Diablos','It seems that one of our researchers was set on by a Black Diablos and during the encounter he spilt attractant all over himself. Now the lovesick beast is chasing him all over the wastes...'),(447,1331,'de','Spezialarena: MR Legiana','Erjage einen Legiana.','Ein neuer Herausforderer: Legiana – der Herr der Lüfte, der Windschattenschläger! Eine fliegende Bedrohung! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(448,1373,'de','Eine eklige Fleischwunde','Erjage einen Odogaron.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Hol mir die Materialien, dann verbessere ich heimlich deine Werkzeuge! *Der 1. Abschluss verbessert den Banditen-Mantel.'),(449,1373,'en','A Nasty Flesh Wound','Hunt an Odogaron','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You go out and snatch the materials I need and I\'ll sneak an upgrade into your tools! (Upgrades the Bandit Mantle upon first completion.)'),(450,1331,'en','Special Arena: MR Legiana','Hunt a Legiana','A new challenger: Legiana, the Slipstream Striker, the Wingleader! Remember, you can\'t spell flight without fight! Two fighters enter the Special Arena, but only one leaves!'),(451,1332,'de','Spezialarena: MR Odogaron','Erjage einen Odogaron.','Ein neuer Herausforderer: Odogaron – der Muskelprotz, der Meister der Zerstörung! Er will dir ans Leder! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(452,1332,'en','Special Arena: MR Odogaron','Hunt an Odogaron','A new challenger: Odogaron, the Muscle Mutt, the Rex Who Wrecks! He\'ll bite your leg to fetch the stick inside! Two fighters enter the Special Arena, but only one leaves!'),(453,1381,'de','Jerky schmeckt, Forscher auch','Erjage einen Odogaron.','Einer meiner Forscher hat ein Faible für Snacks, ganz besonders für Astera-Jerky. Ich hab ihm gesagt, er soll es nur wenn nötig essen... Und jetzt versucht ein Odogaron an IHM zu knabbern.'),(454,1381,'en','Don\'t be a Jerk with the Jerky','Hunt an Odogaron','One of my less forward-thinking researchers has quite an affinity for snacks, especially Astera jerky. I\'ve told him time and again to only eat them when necessary but now he\'s really in trouble. An Odogaron has attacked him and without any jerky, I\'m afraid he may be done for...'),(455,1333,'de','Spezialarena: MR Uragaan','Erjage einen Uragaan.','Ein neuer Herausforderer: Uragaan – die Rollende Rakete, der Kinnhetzer! Dreht er sich, fürchte dich! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(456,1594,'de','Projekt M.I.A.U.: Silber','Fange einen Brodelnden Bazelgeuse.','Projekt M.I.A.U. läuft... da wäre nur ein kleines Problem: ein Bazelgeuse! Wenn du dreimal seinen Namen sagst, können wir uns dann die Beute holen? *Der 1. Abschluss schaltet neue Einrichtungselemente frei.'),(457,1333,'en','Special Arena: MR Uragaan','Hunt an Uragaan','A new challenger: Uragaan, the Rolling Rocket, the Chinstigator! Once he starts spinning, uragoner! Two fighters enter the Special Arena, but only one leaves!'),(458,1334,'de','Spezialarena: MR Rathalos','Erjage einen Rathalos.','Ein neuer Herausforderer: Rathalos – der Hitzige Räuber, der Brandstifter! Er mag seine Opfer gut durch! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(459,1594,'en','The Purr-fect Room: Silver','Capture a Seething Bazelgeuse','P.U.R.R. is in fur effect...with just one minor hiccup: a Bazelgeuse! Maybe if you say its name three times, we can sneak in and get the goods! Go on, give it a try! (Decor materials for your room added upon first completion.)'),(460,1334,'en','Special Arena: MR Rathalos','Hunt a Rathalos','A new challenger: Rathalos, the Red-Hot Raider, the Firestarter! Forgive the fireballs; he likes his meals cooked! Two fighters enter the Special Arena, but only one leaves!'),(461,1601,'de','Loblied der Geführten','Schliesse die Aufgabe ab.','Geh an Bord des Schiffs, wenn du bereit bist. Zeit, ein paar Sachen zu Ende zu bringen. Wer weiss schon, was wir bei der Landung vorfinden, aber du wirst bereit sein. Das bist du immer.'),(462,1335,'de','Spezialarena: MR Diablos','Erjage einen Diablos.','Ein neuer Herausforderer: Diablos – der Sandsturm, der Grosse Graber! Die Gefahr aus dem Untergrund! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(463,1601,'en','To The Guided, A Paean','Complete the assignment','Board the ship when you\'re ready. It\'s time we wrap up all loose ends. Who knows what we\'ll find when we land, but I know you\'ll be ready. You always are.'),(464,1602,'de','Loblied auf die Führung','Schliesse die Aufgabe ab.','Die Zeit ist endlich gekommen, den Shara Ishvalda zu stellen. Ich wünschte, ich könnte da sein und einen guten Blick auf ihn werfen, aber das ist eine Aufgabe, die nur du lösen kannst.'),(465,1335,'en','Special Arena: MR Diablos','Hunt a Diablos','A new challenger: Diablos, the Sandy Stampede, Biggus Diggus! Don\'t hang around if he\'s underground! Two fighters enter the Special Arena, but only one leaves!'),(466,1602,'en','Paean of Guidance','Complete the assignment','The time has finally come to face Shara Ishvalda. I wish I could be there to have a good look at it... But this is a job only you\'re capable of. Good luck.'),(467,1336,'de','Spezialarena: MR Barioth','Erjage einen Barioth.','Ein neuer Herausforderer: Barioth – die eisige Vorhut, der verschlagene Vernichter, das brutale Brechmittel! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(468,1603,'de','Schlaft nun im Feuer','Erjage alle Zielmonster.','Diese Aufgabe ist nur für die wenigen Heldenhaften, die das Zeug <LSNR {zum} {zur}> echten <LSNR {Meisterjäger} {Meisterjägerin}> haben. Zeig allen, zu was du fähig bist! (Schaltet beim Abschluss das MR-Limit frei!)'),(469,1336,'en','Special Arena: MR Barioth','Hunt a Barioth','A new challenger: Barioth, the Tusked Terror, The Baron of Blizzards! First everything\'s white, then it turns black! Two fighters enter the Special Arena, but only one leaves!'),(470,1603,'en','Sleep Now in the Fire','Hunt all target monsters','This assignment is only for the few heroic hunters who can handle the rigors of being a true master hunter. Show everyone what you\'re capable of! (Completing this quest unlocks the MR cap limit)'),(471,1337,'de','Spezialarena: MR Nargacuga','Erjage einen Nargacuga.','Ein neuer Herausforderer: Nargacuga – der schattenhafte Schlächter, der niederträchtige Ninja! Siehst du ihn nicht, ist es schon zu spät! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(472,1604,'de','Ganz grosses Getümmel','Erjage alle Zielmonster.','Diese Aufgabe ist nur für die wenigen Heldenhaften, die das Zeug <LSNR {zum} {zur}> echten <LSNR {Meisterjäger} {Meisterjägerin}> haben. Zeig allen, zu was du fähig bist! (Schaltet beim Abschluss das MR-Limit frei!)'),(473,1337,'en','Special Arena: MR Nargacuga','Hunt a Nargacuga','A new challenger: Nargacuga, the Shadowy Slayer, the Nimble Ninja! If you can\'t see him, it\'s already too late! Two fighters enter the Special Arena, but only one leaves!'),(474,1604,'en','Big Burly Bash','Hunt all target monsters','This assignment is only for the few heroic hunters who can handle the rigors of being a true master hunter. Show everyone what you\'re capable of! (Completing this quest unlocks the MR cap limit)'),(475,1338,'de','Spezialarena: MR Glavenus','Erjage einen Glavenus.','Ein neuer Herausforderer: Glavenus – der Kauterisierer, der monströse Klingenmeister; er spaltet alle Meinungen! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(476,1605,'de','Bis zum Ende an deiner Seite','Töte einen Ruinen-Nergigante.','Ich weiss, dass du auf diesen Moment gewartet hast, aber der Nergigante hat das auch. Ihr beide seid ja praktisch unzertrennlich. Es wird Zeit, das zu beenden. Hol ihn dir, <LSNR {Jäger} {Jägerin}>! (Schaltet beim Abschluss das MR-Limit frei!)'),(477,1605,'en','To the Very Ends with You','Slay a Ruiner Nergigante','I know you\'ve been waiting for this, and I bet Nergigante has, too. You guys are basically joined at the hip. But it\'s time to end this. Go get \'em, Hunter! (Completing this quest unlocks the MR cap limit)'),(478,1338,'en','Special Arena: MR Glavenus','Hunt a Glavenus','A new challenger: Glavenus, the Cauterizer, the Slasha-saurus! With this monster, every match is a split decision! Two fighters enter the Special Arena, but only one leaves!'),(479,1606,'de','Rückkehr des Verrückten','Erjage einen Yian Garuga.','Was? Ein Yian Garuga?! Dieses Monster ist meinen Notizen nach ständig auf Keilereien aus. Pass auch auf sein Überschallgebrüll auf! Das wird aufregend, <LSNR {Partner} {Partnerin}>!'),(480,1339,'de','Spezialarena: MR Brachydios','Erjage einen Brachydios.','Ein neuer Herausforderer: Brachydios – der Schleim-Shogun, das blaue Wunder! Sein Charakter? Von Natur aus explosiv! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(481,1606,'en','Return of the Crazy One','Hunt a Yian Garuga','What!? A Yian Garuga!? According to my notes, these monsters will pick a fight with just about anything! It also says be careful around its supersonic roars. This is gonna be exciting, Pard!'),(482,1462,'de','Durchdringendes Schwarz','Erjage eine Schwarze Diablos.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorgst du mir die Materialien, wird dich kein Monster mehr rumschubsen! *Der 1. Abschluss verbessert den Trutzmantel.'),(483,1631,'de','Die Stadt gehört uns','Erjage alle Zielmonster.','Bisher hast du alle Herausforderungen bestanden, aber wie wäre es mit einer weiteren? Wenn du da unversehrt herauskommst, wird niemand vergessen, warum du der wahre Saphirstern bist!'),(484,1631,'en','We Run This Town','Hunt all target monsters','You\'ve overcome everything thrown at you so far, why not just one more challenge? Come out of this unscathed, and no one will forget why you\'re the real Sapphire Star!'),(485,1632,'de','Spezialarena: MR Zinogre','Erjage einen Zinogre.','Ein neuer Herausforderer: Zinogre, schnell wie der Blitz, laut wie der Donner! Meine Damen und Herren, die Spannung steigt! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(486,1632,'en','Special Arena: MR Zinogre','Hunt a Zinogre','A new challenger: Zinogre, the Bug Zapper, the Thunder Clapper! When this pup gets to howlin\', better throw the towel in! Two fighters enter the Special Arena, but only one leaves!'),(487,1633,'de','Spezialarena: MR Yian Garuga','Erjage einen Yian Garuga.','Ein neuer Herausforderer: Yian Garuga, der schreiende Schnabel, der verrückte Vielfrass! Wahnsinn hat einen neuen Namen! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(488,1462,'en','Piercing Black','Hunt a Black Diablos','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You get me the materials I need and no monster will be knocking you around! (Upgrades the Rocksteady Mantle upon first completion.)'),(489,1633,'en','Special Arena: MR Yian Garuga','Hunt a Yian Garuga','A new challenger: Yian Garuga, the Screamin\' Demon, the Beaked Berzerker! You\'ve never seen crazy like this before! Two fighters enter the Special Arena, but only one leaves!'),(490,1471,'de','Ein schattenhafter Angreifer','Erjage einen Vulkan-Odogaron.','\"Ich bin einem Vulkan-Odogaron auf der Spur. Er ist ein wildes Monster, das sehr kampfeslustig zu sein scheint. Ich muss aufpassen, dass ich ni...\" (Der Rest der Nachricht ist zerfetzt...)'),(491,1634,'de','Spezialarena: MR Brachial-Tigrex','Erjage einen Brachial-Tigrex.','Ein neuer Herausforderer: Brachial-Tigrex, der Aggro-Angreifer, die brüllende Blitzeschleuder! Ein Grossmaul mit grossem Maul! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(492,1471,'en','A Shadowy Offender','Hunt an Ebony Odogaron','\"I\'m on the trail of an Ebony Odogaron. It\'s a ferocious monster that seems to have a thirst for battle. I must take care not—\" (the rest of the note is torn...)'),(493,1481,'de','Eine ätzende Klinge','Erjage einen Säure-Glavenus.','Ach, du hast dich mit dem Säure-Glavenus duelliert, oder? Wie er diesen stumpfen, ätzenden Schwanz zu einer Klinge formt – einfach unglaublich! Oh, und wie er damit ausho––'),(494,1634,'en','Special Arena: MR Brute Tigrex','Hunt a Brute Tigrex','A new challenger: Brute Tigrex, the Aggro Assaulter, the Bellowing Blitzer! He\'s talkin\' trash with the moves to back it up! Two fighters enter the Special Arena, but only one leaves!'),(495,1481,'en','This Corroded Blade','Hunt an Acidic Glavenus','—and by the by, you\'ve dueled with the Acidic Glavenus, yes? How it sharpens that dull, acidic tail into a beautiful blade! Simply astounding, yes! Oh, and the way it winds up for an—'),(496,1482,'de','Projekt M.I.A.U.: Helles Eisen','Fange einen Säure-Glavenus.','Projekt M.I.A.U. läuft... da wäre nur ein kleines Problem: ein Säure-Glavenus! Schnapp ihn dir, damit wir uns die Beute krallen können! *Der 1. Abschluss schaltet neue Einrichtungselemente frei.'),(497,1339,'en','Special Arena: MR Brachydios','Hunt a Brachydios','A new challenger: Brachydios, the Guru of Goo, The Purple Pounder! Says he\'s looking for some chump called \"Doodle.\" Two fighters enter the Special Arena, but only one leaves!'),(498,1635,'de','Spezialarena: MR Goldene Rathian','Erjage eine Goldene Rathian.','Eine neue Herausfordererin: Goldene Rathian, das Glanzstück des Himmels. Reden ist Silber, Schweigen der Weg zum Sieg! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(499,1635,'en','Special Arena: MR Gold Rathian','Hunt a Gold Rathian','A new challenger: Gold Rathian, The Queen of Sheen, the Lethal Lunar Lady! She may be golden but she\'ll leave you black and blue. Two fighters enter the Special Arena, but only one leaves!'),(500,1340,'de','Spezialarena: MR Tigrex','Erjage einen Tigrex.','Ein neuer Herausforderer: Tigrex – der brüllende Proto-Wyvern, denkst du er ist harmlos, bist du kurze Zeit später armlos! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(501,1482,'en','The Purr-fect Room: Light Iron','Capture an Acidic Glavenus','P.U.R.R. is in fur effect...with just one minor hiccup: an Acidic Glavenus! Bag us that Glavenus and we\'ll sneak past and snatch the goods! (Decor materials for your room added upon first completion.)'),(502,1636,'de','Spezialarena: MR Silberner Rathalos','Erjage einen Silbernen Rathalos.','Ein neuer Herausforderer: Silberner Rathalos, Schwanzus Longus, der Zernichter der Zypressen, der Landvogt der Leitlande. Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(503,1340,'en','Special Arena: MR Tigrex','Hunt a Tigrex','A new challenger: Tigrex, the Rushing Rampager, the Emperoar! This monster puts the arm in harm! Two fighters enter the Special Arena, but only one leaves!'),(504,1636,'en','Special Arena: MR Silver Rathalos','Hunt a Silver Rathalos','A new challenger: Silver Rathalos, the Glistening Gladiator, the Fireball Flinger! He reigns over the ring with a rain of fire! Two fighters enter the Special Arena, but only one leaves!'),(505,1483,'de','Projekt M.I.A.U.: Dunkles Eisen','Erjage alle Zielmonster.','Projekt M.I.A.U. läuft... da wären nur zwei kleine Probleme: höchst horrende Höllenhunde! Nimm sie an die Leine, damit wir uns die Beute schnappen können! *Der 1. Abschluss schaltet neue Einrichtungselemente frei.'),(506,1351,'de','Ein neues Tief','Erjage einen Rathalos.','Reudiger Rathalos! Wann immer sich unser Feldteam an die Fersen eines Aptonoth heftet, rast dieser Racker hervor und krallt ihn sich als Abendessen! Aber heute bleibt die Küche kalt!'),(507,1641,'de','Lorelei von weit herbei','Töte einen Shara Ishvalda.','Ich muss zugeben: Der Shara Ishvalda ist ein Drachenältester, der sich sehen lassen kann. Dass er uns bis hierher geführt hat... Wir haben noch viel zu lernen – Zeit für eine Stippvisite!'),(508,1483,'en','The Purr-fect Room: Dark Iron','Hunt all target monsters','P.U.R.R. is in fur effect...with just one minor hiccup, well, actually two: a double dose of depraved devil doggies! Put \'em on a leash so we can go in and get the goods! (Decor materials for your room added upon first completion.)'),(509,1641,'en','Faraway Lorelei','Slay a Shara Ishvalda','Gotta admit, Shara Ishvalda is one elder dragon that is a sight to behold. Still can\'t believe it led us all the way here. We still have much to learn, let\'s pay it another visit!'),(510,1351,'en','Swoop to a New Low','Hunt a Rathalos','Blasted Rathalos! Every time the field team tags an Aptonoth to track its behavior, this confounded creature swoops in and carries it off! It\'s almost as if it\'s doing it on purpose!'),(511,1491,'de','Blauer Rathalos-Blues','Erjage einen Azurnen Rathalos.','Der Azurne Rathalos ist bekannt dafür, sein Revier mit Kerben zu markieren, die er mit seinen riesigen Klauen reisst. Unsere Verhaltensforscher lieben das, wir Geologen nicht so sehr...'),(512,1642,'de','Hymne über Mond und Sonne','Erjage alle Zielmonster.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorgst du mir die Materialien, dann liefere ich dir ordentlich Schlagkraft! *Der 1. Abschluss verbessert den Aufschlag-Mantel.'),(513,1642,'en','Hymn of Moon and Sun','Hunt all target monsters','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You get me the materials I need and I guarantee this upgrade will have massive impact! (Upgrades the Impact Mantle upon first completion.)'),(514,1352,'de','Nargacu... garnicht schön','Erjage einen Nargacuga.','Im Uralten Wald bin ich einem Nargacuga begegnet. Auf so ein schnelles Monster war ich nicht vorbereitet. Ich sage es ungern, aber ich brauche Verstärkung. Hilf mir BITTE!'),(515,1491,'en','Blue Rathalos Blues','Hunt an Azure Rathalos','Azure Rathalos are known to mark their territory with gashes by using their massive claws. As fascinating as this is to our ethology department, it\'s quite a headache for our geologists.'),(516,1651,'de','Der Sturm bringt das Unerwartete','Töte alle Zielmonster.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorgst du mir die Materialien, dann bekommst du was, das du lieben wirst! *Der 1. Abschluss verbessert den Affinität-Booster.'),(517,1352,'en','Nargacoulda, Shoulda, Woulda','Hunt a Nargacuga','I should know better than to go out into the Ancient Forest without a hunter escort, but I didn\'t think a freakin\' Nargacuga would be there! Why didn\'t anybody tell me!? Help me, PLEASE!'),(518,1651,'en','The Storm Brings the Unexpected','Slay all target monsters','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You get me the materials I need and I guarantee you\'ll just love this upgrade! (Upgrades the Affinity Booster upon first completion.)'),(519,1492,'de','Fange den Donnerkiefer','Fange einen Fulgur-Anjanath.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorgst du mir die Materialien, dann werte ich sie blitzschnell auf! *Der 1. Abschluss verbessert den Donnerschutz-Mantel.'),(520,1661,'de','Eine heisse Nacht in der Ödnis','Töte eine Lunastra.','Die Lunastra... Ich habe sie nur einmal getroffen, um meine Gefühle zum Ausdruck zu bringen, aber es sollte nicht sein. Oh, ihre Flammen... Jemand muss ihr sagen, was ich fühle!'),(521,1492,'en','Trap the Thunder Jaw','Capture a Fulgur Anjanath','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You get me the materials I need and I\'ll upgrade your gear lightning-quick! (Upgrades the Thunderproof Mantle upon first completion.)'),(522,1661,'en','One Hot Night in the Spire','Slay a Lunastra','Lunastra...I saw her just once and tried to express my feelings, but it was not meant to be. Oh, to be caressed by her flames... I need someone to tell her how I feel!'),(523,1501,'de','Der Eisgeborene Wyvern','Töte den Velkhana.','Wir konnten Seliana diesmal beschützen, aber wir haben keine Ahnung, ob und wann der Velkhana zurückkommt. Also trage den Kampf zu ihm und eliminiere die Bedrohung, bevor er sich erholt.'),(524,1671,'de','Göttlicher Strom','Töte alle Zielmonster.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorge mir die Materialien, dann mache ich dich zukunftssicher! *Der 1. Abschluss verbessert den Lebensretter-Mantel.'),(525,1501,'en','The Iceborne Wyvern','Slay a Velkhana','We may have protected Seliana this time, but we still have no idea if and when Velkhana will return. It\'s time to take the fight to the beast before it recovers! Gear up and head out! And BE CAREFUL!'),(526,1671,'en','Divine Surge','Slay all target monsters','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You get me the materials I need and I\'ll make sure your gear is truly next generation! (Upgrades the Temporal Mantle upon first completion.)'),(527,1502,'de','Die zweite Ankunft','Erjage einen Brodelnden Bazelgeuse.','Ha, sieh mal an, wer wieder Stress machen will. Dieser Kerl denkt, dass er hier Herr im Haus ist, aber der kann sich auf was gefasst machen, nicht wahr? Ist doch wahr, oder?'),(528,1691,'de','In den Palast der Flammen','Töte eine Lunastra.','Eine Anfrage zum Aufspüren einer Lunastra ist eingetroffen! Ich frage mich, wie es ist, als Kaiserin behandelt zu werden. Nimm diese Quest an, Saphirstern, und zeige es mir!'),(529,1502,'en','The Second Coming','Hunt a Seething Bazelgeuse','Hah, look who\'s back to wreak havoc. This guy thinks he owns the place, but he\'s about to get a real rude awakening, right, Fiver? Get in there and send \'em packin\'!'),(530,3071,'en','Arena Master Quest 02','Slay a Nightshade Paolumu','In the monster corner: Nightshade Paolumu, the Sultan of Slumber, the Flightmare! Get caught in the sleeper hold, and it\'s lights out! You ready to duke it out with set weapons and armor?'),(531,1503,'de','Der Schleier des Todes','Töte einen Velum-Vaal-Hazak.','Etwas stimmt nicht... Wir haben Berichte über einen Vaal Hazak erhalten, der im Uralten Wald aufgetaucht ist. Was macht der ausserhalb des Tals? Sei auf jeden Fall vorsichtig!'),(532,3072,'de','Arena-Meister-Quest 03','Töte einen Nargacuga.','In der Monsterecke: Nargacuga, der schattenhafte Schlächter, der niederträchtige Ninja! Siehst du ihn nicht, ist es schon zu spät! Bist du bereit für einen Kampf mit festen Waffen und Rüstung?'),(533,3072,'en','Arena Master Quest 03','Slay a Nargacuga','In the monster corner: Nargacuga, the Shadowy Slayer, the Nimble Ninja! If you can\'t see him, it\'s already too late! You ready to duke it out with set weapons and armor?'),(534,3073,'de','Arena-Meister-Quest 04','Töte einen Säure-Glavenus.','In der Monsterecke: Säure-Glavenus, der Ruin aller Rüstungen! Du denkst, sein Schwanz ist stumpf? Ein tödlicher Irrtum! Bist du bereit für einen Kampf mit festen Waffen und Rüstung?'),(535,3073,'en','Arena Master Quest 04','Slay an Acidic Glavenus','In the monster corner: Acidic Glavenus, the Colonel of Corrosion, The Dino Dueler! There\'s no stoppin\' once he gets to choppin\'! You ready to duke it out with set weapons and armor?'),(536,1503,'en','Under the Veil of Death','Slay a Blackveil Vaal Hazak','Something strange is going on... A Vaal Hazak has shown up in the Ancient Forest. Reports state that something is...off about it. What\'s it doing outside the vale? At any rate, be careful!'),(537,1504,'de','Ein Licht aus dem Abgrund','Töte den Namielle.','Die Kommission hat einen nie zuvor gesehenen Drachenältesten im Korallenhochland entdeckt. Wir haben noch keine gesicherten Infos – ausser dem ominösen Licht vom höchsten Plateau...'),(538,1504,'en','A Light From The Abyss','Slay a Namielle','The Commission has discovered a never-before-seen elder dragon in the Coral Highlands. No solid info to go on, other than reports of an ominous light radiating from the highest plateau...'),(539,1521,'de','Reif fürs Gefecht','Töte den Velkhana.','Offizielle Daten über den Velkhana existieren praktisch nicht und vieles über seine Ökologie ist unklar. Das ist die perfekte Gelegenheit für uns... ähm, DICH... Geschichte zu schreiben!'),(540,1691,'en','Into the Palace of Flame','Slay a Lunastra','A request to track down a Lunastra has come in! I wonder what it\'s like to be treated like an empress. Take this quest, mon étoile, and show me...'),(541,1521,'en','Clashing Swords Upon The Rime','Slay a Velkhana','Official records about Velkhana are non-existent, and much has yet to be confirmed about its ecology. But this is the perfect opportunity for us—er, YOU, to make history!'),(542,1382,'de','Ein Brüllen erschütterte das Tal','Erjage einen Tigrex.','Es ist bekannt, dass der Tigrex ein primitiver Flugwyvern ist. Wenn wir sein Erscheinen in der Neuen Welt erforschen, könnten wir mehr über andere Flugwyvern hier erfahren!'),(543,1551,'de','Bringer klaren Himmels','Töte einen Kushala Daora.','Klar, Kushala Daora richtet mit seinem Sturm starke Schäden an, aber er hat auch was Positives. Denn nach dem Sturm scheint immer die Sonne! Komm, sorgen wir für etwas Aufklärung!'),(544,1551,'en','The Harbinger of Clear Skies','Slay a Kushala Daora','Sure, Kushala Daora wrecks things with its storms, but I think it gets a bad rap. I mean, after those storms, it\'s super sunny and everything! Help me change people\'s minds!'),(545,1552,'de','Hier kommt der Todbringer','Töte einen Velum-Vaal-Hazak.','... Die Geschichten sind also wahr. Ein Vaal Hazak ist im Uralten Wald. Zeit, dich an die Arbeit zu machen, <LSNR {Jäger} {Jägerin}>. Viel Spass.'),(546,1552,'en','Here Comes the Deathmaker','Slay a Blackveil Vaal Hazak','...... So, the stories are true. A Vaal Hazak, in the Ancient Forest. Time for you to get to work, Hunter. Run along, now.'),(547,1561,'de','Königliche Audienz im Sand','Töte einen Teostra.','Ein Mitglied der Vierten hat einen Teostra in der Wildturm-Ödnis angetroffen, und er ist noch schrecklicher als sonst. Der Imperator wartet auf seinem Thron. Sagen wir Hallo?'),(548,3074,'de','Arena-Meister-Quest 05','Töte alle Zielmonster.','In der Monsterecke: Ein Duo – Odogaron und Vulkan-Odogaron! Die Hunde sind von der Leine und nicht nur zum Bellen hier! Bist du bereit für einen Kampf mit festen Waffen und Rüstung?'),(549,1382,'en','A Roar that Shook the Vale','Hunt a Tigrex','It\'s well-known that the Tigrex is a primitive flying wyvern, which means investigating its appearance in the New World could teach us much about other flying wyverns here!'),(550,3074,'en','Arena Master Quest 05','Slay all target monsters','In the monster corner: An Odogaron-Ebony Odogaron tag team! The hounds are out, and you\'re about to get woofed! You ready to duke it out with set weapons and armor?'),(551,1383,'de','Explosiver Rennspass','Erjage alle Zielmonster.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorge mir die Materialien, dann ist es keine Herausforderung, sie zu verbessern! *Der 1. Abschluss verbessert den Herausforderer-Mantel.'),(552,3091,'de','Arena-Meister-Quest 06','Töte einen Zinogre.','In der Monsterecke: Zinogre, schnell wie der Blitz, laut wie der Donner! Meine Damen und Herren, die Spannung steigt! Bist du bereit für einen Kampf mit festen Waffen und Rüstung?'),(553,3091,'en','Arena Master Quest 06','Slay a Zinogre','In the monster corner: Zinogre, the Bug Zapper, the Thunder Clapper! When this pup gets to howlin\', better throw the towel in! You ready to duke it out with set weapons and armor?'),(554,1383,'en','Runnin\', Rollin\', and Weepin\'','Hunt all target monsters','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. It\'ll hardly be a challenge to upgrade your gear if you go out and get me the materials I need! (Upgrades the Challenger Mantle upon first completion.)'),(555,1391,'de','Achtung, Explosion!','Erjage einen Brachydios.','Ach, du hast mit dem Brachydios gekämpft, oder? Viele erzählen von seinem seltsamen Schleim, aber mir geht\'s um seine Fäuste! Wie er auf den Boden schlägt und...'),(556,1391,'en','Blast Warning In Effect!','Hunt a Brachydios','—and by the by, you\'ve exchanged blows with the Brachydios, yes? Most clamor over its peculiar slime, but not I! No, I\'m all about those fists! Yes, the way it strikes the ground and—'),(557,3092,'de','Arena-Meister-Quest 07','Töte alle Zielmonster.','In der Monsterecke: Ein Duo – Tigrex und Brachial-Tigrex! Gerate nicht zwischen sie, es könnte dein letzter Fehler sein! Bist du bereit für einen Kampf mit festen Waffen und Rüstung?'),(558,1692,'de','Meisterjäger der Neuen Welt','Töte alle Zielmonster.','Du hattest deine Schwierigkeiten, aber du bist zu einem Leuchtstern der Kommission geworden. Hier ist eine letzte Quest für dich. Möge dein Name in die Geschichtsbücher Einzug finden!'),(559,3092,'en','Arena Master Quest 07','Slay all target monsters','In the monster corner: A Tigrex-Brute Tigrex tag team! Don\'t get between these two, unless you wanna be a wishbone! You ready to duke it out with set weapons and armor?'),(560,1692,'en','Master Hunter of the New World','Slay all target monsters','You\'ve had your rough patches, but you\'ve become a shining beacon for the Commission. So here\'s to you, one last quest. May your name be etched in history!'),(561,1392,'de','Jeder ist ein Kritiker','Erjage einen Lavasioth.','Einer unserer Künstler wollte ein Landschaftsportrait der Heimat der Ältesten malen, als er aus dem Nichts von einem Lavasioth angegriffen wurde. Er überlebte, das Kunstwerk nicht. Jetzt muss es dem Monster an den Kragen gehen...'),(562,3001,'de','Arena-Quest 02','Töte einen Kulu-Ya-Ku.','In der Monsterecke: Kulu-Ya-Ku, der Pulverminator, der Schnabelator! Dieser Vogel lässt es krachen! Wer stellt sich ihm mit festen Waffen und Rüstung?'),(563,1392,'en','Everyone\'s a Critic','Hunt a Lavasioth','Whilst one of our artists was out trying to paint a landscape of the recess, a Lavasioth appeared out of nowhere and attacked. Though he survived the ordeal, his commissioned piece did not. Please make your way out there and secure the area so that he may continue his work.'),(564,1561,'en','Royal Audience on the Sand','Slay a Teostra','A member of the Fourth encountered a Teostra in the Waste, one more terrible than usual. The emperor sits on its throne, waiting. Shall we pay him a visit?'),(565,1393,'de','Uragaaanz schwindelig','Erjage einen Uragaan.','Die Krankenabteilung ist voller Forscher mit Gleichgewichtsstörungen. Die Ursache? Einer dieser Uragaan dreht sich wie ein Kreisel! Bereite dem ein Ende! Bestimmt ein Kinderspiel...'),(566,1393,'en','Begone Uragaan','Hunt an Uragaan','The infirmary is overflowing with researchers suffering from extreme vertigo. The cause? One of those blasted Uragaan rolling about. Go out there and put the brakes on its spinning!'),(567,3101,'de','Arena-Quest 01','Töte einen Pukei-Pukei.','In der Monsterecke: Pukei-Pukei, der Giftraufer, die Prügelmaschine! Er gibt niemals auf! Wer stellt sich ihm mit festen Waffen und Rüstung?'),(568,1394,'de','Das Geheimnis liegt im Schleim','Fange einen Brachydios.','Ich möchte mit diesem seltsamen Schleim experimentieren, den der Brachydios absondert – oh, keine Sorge, ich bin vorsichtig! Wenn du hilfst, freut sich auch der Uralte Baum! *Der 1. Abschluss schaltet einen Botanik-Forschungsplatz frei.'),(569,3101,'en','Arena Quest 01','Slay a Pukei-Pukei','In the monster corner: Pukei-Pukei, the Toxic Tussler, the Lickin\' Machine! He won\'t listen when you say \"no tongues\"! Who\'s got the guts to fight it with set weapons and armor?'),(570,1394,'en','Secret of the Ooze','Capture a Brachydios','I\'d like to experiment with that peculiar slime the Brachydios secretes—oh, it\'ll be 100% safe, don\'t you worry! Heh... And if you help, I\'m sure it\'ll help our Ancient Tree some, too! (Unlocks a Botanical Research slot on first time completion.)'),(571,3001,'en','Arena Quest 02','Slay a Kulu-Ya-Ku','In the monster corner: Kulu-Ya-Ku, the Pulverizer, the Peckanizer! If this bird is the word, then the word is SMASH! Who\'s got the guts to fight it with set weapons and armor?'),(572,1562,'de','Das Bankett des Tyrannen','Erjage einen Wilden Dämonjho.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorgst du mir die Materialien, ist deiner Ausrüstung ein Statusplus gewiss! *Der 1. Abschluss verbessert den Apotheker-Mantel.'),(573,1395,'de','Festival der Explosionen!','Erjage alle Zielmonster.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorge mir die Materialien und ich entflamme deine Liebe für Mäntel neu! *Der 1. Abschluss verbessert den Feuerschutz-Mantel.'),(574,3002,'de','Arena-Quest 03','Töte eine Rathian.','In der Monsterecke: Rathian, die Königin der Luft, die Himmelsspalterin! Vorsicht, sie ist pures Gift! Wer stellt sich ihr mit festen Waffen und Rüstung?'),(575,1395,'en','Festival of Explosions!','Hunt all target monsters','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You get me the materials I need and I\'ll make sure your gear\'s upgrade\'ll be straight fire! (Upgrades the Fireproof Mantle upon first completion.)'),(576,1562,'en','The Tyrant\'s Banquet','Hunt a Savage Deviljho','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You go out and get me the materials I need and the status of your gear is sure to go up! (Upgrades the Apothecary Mantle upon first completion.)'),(577,3002,'en','Arena Quest 03','Slay a Rathian','In the monster corner: Rathian, the Queen o\' Green, the Skyborne Slasher! Don\'t get the lady angry; she\'s poison! Who\'s got the guts to fight her with set weapons and armor?'),(578,1571,'de','Wie vom Blitz getroffen','Töte einen Kirin.','Aus dem Korallenhochland wurden ungewöhnlich viele Blitze und ein helles Leuchten berichtet. Das müssen Hinweise auf einen Kirin sein. Kannst du dir das mal ansehen, <LSNR {Jäger} {Jägerin}>?'),(579,3031,'de','Arena-Quest 04','Töte einen Tzitzi-Ya-Ku.','In der Monsterecke: Tzitzi-Ya-Ku, der Saurier-Schocker, der Blitzinator! Greller als diese Bestie geht\'s nicht! Wer stellt sich ihm mit festen Waffen und Rüstung?'),(580,3031,'en','Arena Quest 04','Slay a Tzitzi-Ya-Ku','In the monster corner: Tzitzi-Ya-Ku, the Saurian Stunner, the Flashinator! This beastie\'s hot to trot and fine to shine! Who\'s got the guts to fight it with set weapons and armor?'),(581,3032,'de','Arena-Quest 05','Töte einen Barroth.','In der Monsterecke: Barroth, das Kopfnussschwergewicht, der Schädelspalter! Verlieren verboten! Wer stellt sich ihm mit festen Waffen und Rüstung?'),(582,3032,'en','Arena Quest 05','Slay a Barroth','In the monster corner: Barroth, the Hulking Headbutt, the Skullcracker! Lose to this guy, and your name is mud! Who\'s got the guts to fight it with set weapons and armor?'),(583,3033,'de','Arena-Quest 06','Töte einen Dodogama.','In der Monsterecke: Dodogama, das unflätige Ungeheuer, der Kracher! Was in die Luft fliegt, holt dich runter! Wer stellt sich ihm mit festen Waffen und Rüstung?'),(584,3033,'en','Arena Quest 06','Slay a Dodogama','In the monster corner: Dodogama, the Behemoth of Boom, the Cruncher! What blows up, must bring you down! Who\'s got the guts to fight it with set weapons and armor?'),(585,3034,'de','Arena-Quest 07','Töte einen Azurnen Rathalos.','In der Monsterecke: Azurner Rathalos, der Saphirne Sultan, der Tiefblaue Schrecken! Der König der Wyvern! Wer stellt sich ihm mit festen Waffen und Rüstung?'),(586,3034,'en','Arena Quest 07','Slay an Azure Rathalos','In the monster corner: Azure Rathalos, the Sapphire Sultan, the True Blue Terror! Bow down to the king of all wyverns! Who\'s got the guts to fight it with set weapons and armor?'),(587,3051,'de','Arena-Quest 08','Töte alle Zielmonster.','In der Monsterecke: Ein Radobaan-Uragaan-Duo! Die Räder drehen sich, jetzt bist du dran! Wer stellt sich ihnen mit festen Waffen und Rüstung?'),(588,3051,'en','Arena Quest 08','Slay all target monsters','In the monster corner: A Radobaan-Uragaan tag team! The wheels are turning, and your number\'s up! Who\'s got the guts to fight \'em with set weapons and armor?'),(589,3052,'de','Arena-Quest 09','Töte alle Zielmonster.','In der Monsterecke: Ein Duo – Schwarze Diablos und Diablos! Hast du ein Piercing? Probier die extreme Version! Wer stellt sich ihnen mit festen Waffen und Rüstung?'),(590,3052,'en','Arena Quest 09','Slay all target monsters','In the monster corner: A Diablos-Black Diablos tag team! Ever had your ears pierced? Now try the extreme version! Who\'s got the guts to fight \'em with set weapons and armor?'),(591,3071,'de','Arena-Meister-Quest 02','Töte einen Nachtschatten-Paolumu.','In der Monsterecke: Nachtschatten-Paolumu, der Sultan des Schlafs! Zählst du Schäfchen, sind deine Tage gezählt! Bist du bereit für einen Kampf mit festen Waffen und Rüstung?'),(592,1401,'de','Wenn der Nebel dich verschlingt','Erjage einen Schneesturm-Legiana.','Überlass es mir, die Fährtenleserin zu finden. Kümmere dich in der Zwischenzeit um diesen Legiana und sichere das Gebiet! Sei aber vorsichtig, mit dem stimmt irgendwas nicht...'),(593,3171,'de','Arena-Meister-Quest 01','Töte einen Banbaro.','In der Monsterecke: Banbaro, der Wächter der Weite! Wenn er im Ring ist, geht\'s mit harten Bandagen zur Sache! Bist du bereit für einen Kampf mit festen Waffen und Rüstung?'),(594,1401,'en','When the Mist Taketh You','Hunt a Shrieking Legiana','Leave finding the Tracker to me. In the meantime, secure the area by taking care of that Legiana! Be careful though, there\'s something off about this one...'),(595,1402,'de','Die zerfallende Klinge','Erjage einen Säure-Glavenus.','Seit der Velkhana weg ist, drehen die Monster durch. Wir sind dünn besetzt und brauchen <LSNR {einen Jäger, der} {eine Jägerin, die}> die Verteidigungskonvoi-Route nach Seliana sichert. Du kannst helfen, indem du die Glavenus-Unterart beseitigst.'),(596,1402,'en','The Disintegrating Blade','Hunt an Acidic Glavenus','As soon as Velkhana left, monsters everywhere started getting riled up. We\'re short on manpower, and we need a hunter to secure the defense convoy\'s route to Seliana. Start by taking out the Glavenus subspecies!'),(597,1403,'de','Schlechte Freunde, gute Feinde','Erjage einen Vulkan-Odogaron.','Seit der Velkhana weg ist, drehen die Monster durch. Wir sind dünn besetzt und brauchen <LSNR {einen Jäger, der} {eine Jägerin, die}> die Verteidigungskonvoi-Route nach Seliana sichert. Du kannst helfen, indem du die Odogaron-Unterart beseitigst.'),(598,51607,'de','Meine Wut bleibt','Erjage einen Zornigen Rajang.','Ein Zorniger Rajang wurde in der Raureif-Weite gesichtet. Nicht viele Jäger haben sich einem gestellt und sind ohne den Verlust von Körperteilen zurückgekommen. Wird es dir gelingen?'),(599,1403,'en','Bad Friends, Great Enemies','Hunt an Ebony Odogaron','As soon as Velkhana left, monsters everywhere started getting riled up. We\'re short on manpower, and we need a hunter to secure the defense convoy\'s route to Seliana. Start by taking out the Odogaron subspecies!'),(600,51607,'en','The Fury Remains','Hunt a Furious Rajang','A Furious Rajang has been spotted in the Hoarfrost Reach. Not many hunters have faced one and come back in one piece. Think you can join their ranks?'),(601,1404,'de','Die Verteidigung von Seliana','Schliesse die Aufgabe ab.','Der Velkhana nähert sich Seliana! Nimm den Drachenreisser und schlage ihn zurück! Ganz Seliana zählt auf dich, Saphirstern!'),(602,51611,'de','Feuerschwarzes Zwielicht','Töte den Alatreon.','Über den Alatreon ist nicht viel bekannt – ausser dass seine Zerstörungskraft die ganze Menschheit bedroht. Aber das ist die Gelegenheit für die Kommission, Geschichte zu schreiben!'),(603,1404,'en','The Defense of Seliana','Complete the assignment','Velkhana is closing in on Seliana! Man the Dragonrazer and drive that thing back! All of Seliana is counting on you, Sapphire Star!'),(604,51611,'en','Blazing Black Twilight','Slay an Alatreon','Not much is known of Alatreon, other than the destruction it\'s capable of threatens all of humanity. But this is a chance for the Commission to write history, no?'),(605,1571,'en','Lightning Crashes','Slay a Kirin','An unusual amount of lightning and radiance has occurred in the Highlands recently. This must be a sign that a Kirin is active in the area. You MUST look into this, Hunter!'),(606,1572,'de','Erinnerungen an den Meeresgott','Töte den Namielle.','Der Namielle ist eine wahrhaft furchteinflössende Bestie. Er kann Flutwellen und Blitze beschwören! Wir müssen möglichst viele Daten sammeln... Los, aber vorsichtig!'),(607,1572,'en','Memories of the Sea God','Slay a Namielle','Namielle is a truly terrifying beast, capable of summoning torrents as well as lightning! We must gather as much data as possible. I ask that you head out immediately, and of course, be careful!'),(608,1405,'de','Der donnernde Störenfried','Erjage einen Fulgur-Anjanath.','Der Konvoi aus Astera nähert sich der Raureif-Weite, aber wir müssen seine Route sichern. Unser Lieblingsstörenfried ist zurück und jemand muss ihm eine Lektion erteilen.'),(609,1581,'de','Auf dem Weg ins Jenseits','Töte einen Velum-Vaal-Hazak.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Deine Ausrüstung mag immun gegen anormale Status sein, aber da geht noch mehr! *Der 1. Abschluss verbessert den Immunität-Mantel.'),(610,1405,'en','The Thunderous Troublemaker!','Hunt a Fulgur Anjanath','The convoy from Astera is approaching the Hoarfrost Reach, but we need to secure its route. Our favorite troublemaker is back, and someone needs to teach it a lesson!'),(611,1581,'en','It\'s the Afterlife for Me','Slay a Blackveil Vaal Hazak','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. Your gear might be immune to abnormal status effects but it ain\'t immune to my upgrades! (Upgrades the Immunity Mantle upon first completion.)'),(612,1591,'de','Schwingen des Windes','Töte einen Kushala Daora.','Schwarze Tornados wurden in der Heimat der Ältesten gesichtet. Unsere Analytiker glauben, dass das mit einem besonders wilden Kushala Daora zu tun hat. Die Sache überlasse ich dir, <LSNR {Fünfer} {Fünferin}>.'),(613,1421,'de','Edelfrost-Jäger','Erjage einen Schneesturm-Legiana.','Wie dieser Legiana so eine Hülle aus Eis erhalten hat, ist ein Rätsel, aber eines, das die Wissenschaft lösen kann! Wir brauchen so viele Daten wie möglich über dieses Ding!'),(614,51621,'de','Spezialarena: MR Höllen-Zinogre','Erjage einen Höllen-Zinogre.','Ein neuer Herausforderer: Höllen-Zinogre, der Dekan der Dracophage, der mächtige Mephisto! Sei hungrig wie ein Wolf! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(615,1591,'en','Wings of the Wind','Slay a Kushala Daora','Black tornadoes have been spotted in the Elder\'s Recess. Analytics believes this is the work of a Kushala Daora, and a very nasty one at that. I\'ll leave this one to you, bud.'),(616,51621,'en','Special Arena: MR Stygian Zinogre','Hunt a Stygian Zinogre','A new challenger: Stygian Zinogre, the Dean of Dracophage, the Mighty Mephisto! You better be hungry like the wolf if you wanna survive! Two fighters enter the Special Arena, but only one leaves!'),(617,1592,'de','Zeichen der Sonne','Töte einen Teostra.','Der Meister der Jagd und ich haben versucht, es mit einem Teostra aufzunehmen, aber der war zu viel des Guten. Du musst dich in die Heimat der Ältesten aufmachen und uns unterstützen!'),(618,1421,'en','Noblefrost Hunter','Hunt a Shrieking Legiana','How that Legiana got a cloak of ice like that is a mystery, but it\'s nothing science can\'t solve! We\'ll need all the data you can get on that thing!'),(619,61101,'de','Morgenstund und so...','Töte 12 Kestodons.','\"Unsere freundlichen Kestodons drehen mal wieder am Rad, deshalb sollen sie sich in deiner Arena abregen. Ist das inzwischen geschehen?\" (Übersetzt vom Lynianer-Forscher)'),(620,1592,'en','Mark of the Sun','Slay a Teostra','The Huntsman and I tried to take on a Teostra, but it was too much for us. We need you to head out to the Elder\'s Recess and provide assistance. As in, you take care of it!'),(621,1422,'de','Tundratrubel','Erjage einen Fulgur-Anjanath.','Ach, du hast Bekanntschaft mit dem Fulgur-Anjanath gemacht, oder? Ein Kampfwyvern, der es in die Hinterlande geschafft hat. Einfach unglaublich, nicht wahr? Wie kann der überha––...'),(622,61101,'en','Up at the Crack of Dawn','Slay 12 Kestodon','\"Our friendly Kestodon have blown a gasket, so we let them cool off in your Arena. Research Commission friends, please see if they\'ve settled down.\" (Translation by the Lynian Researcher)'),(623,1593,'de','Kochend vor Wut','Erjage einen Brodelnden Bazelgeuse.','Ich hab gehört, dass dieser neu entdeckte Bazelgeuse echt heiss sein soll. Aber kann er es mit dem Feuer aufnehmen, das in mir brennt? KEINE CHANCE! Der bekommt \'ne Abkühlung!'),(624,1593,'en','Seething with Anger','Hunt a Seething Bazelgeuse','So I heard this new Bazelgeuse is supposed to be red-hot. But do you think it can match MY red-hot passion for life? Uh, DOUBT IT! Let\'s go out and cool down that fool!'),(625,61103,'de','Treffpunkt von Sonne und Mond','Erjage alle Zielmonster.','Ich habe gehört, dass die tages- und die nachtaktiven Vertreter der einheimischen Wesen gleichzeitig aktiv sind. Vertreibe die Monster! (Spezial-Ticket und mehr seltene Materialien als Belohnung!)'),(626,3171,'en','Arena Master Quest 01','Slay a Banbaro','In the monster corner: Banbaro, the Ruler of the Reach, the Champ of Tramp! If you can\'t dig your own grave, he\'ll dig it for you! You ready to duke it out with set weapons and armor?'),(627,5003,'de','Notleidende Musikatzen','Erjage zwei Tzitzi-Ya-Ku.','\"Zwei Tzitzi-Ya-Ku spielen mit uns Musikatzen Katz und Maus. Bitte harmiauniere mit unseren Kriegern und verjagt gemeinsam die bösen Miaunster!\" (Übersetzt vom Lynianer-Forscher)'),(628,5003,'en','Troubled Troupers','Hunt 2 Tzitzi-Ya-Ku','\"We Troupers are getting batterfanged by two Tzitzi-Ya-Ku. Please har-meow-nize with our warriors to wallop them into hightailing it!\" (Translation by the Lynian Researcher)'),(629,62504,'en','The Scorn of the Sun','Slay Teostra','When I first fought a Teostra back in the Old World, my fear washed over me, but it gave me the fire to fight. But now I realized it\'s calmness, not fear, that you need to slay it.'),(630,1422,'en','Tundra Troublemaker','Hunt a Fulgur Anjanath','—and by the by, you\'ve come snout to snout with the Fulgur Anjanath, yes? How a brute wyvern could somehow make its way to the Hinterlands! Astounding, yes? How can it even swi—'),(631,50601,'de','Besucher aus einer anderen Welt','Schliesse die Aufgabe ab.','Mein seltsamer Partner quatscht die ganze Zeit über dieses ungewöhnliche Wesen in der Wildturm-Ödnis. Möchtest du mitkommen? Das wird bestimmt ein interessantes Abenteuer!'),(632,62505,'de','Das Auge des Sturms','Töte den Kushala Daora.','Die Existenz des Kushala erinnert uns daran, wie grossartig und furchtbar die Natur ist. Sie erinnert uns auch an jene, die sich gegen die Bestie erhoben haben. Werde ein Teil dieser Gruppe!'),(633,62505,'en','The Eye of the Storm','Slay Kushala Daora','Kushala\'s existence reminds us of how great and fearful nature is. But it also reminds us of those who stood up against the beast. Stand tall hunter, and return the skies to blue.'),(634,61103,'en','Where Sun Meets Moon','Hunt all target monsters','I heard there\'s a period of time when diurnal and nocturnal endemic life meet, so I wanted to see for myself, but now I\'m in a jam! (Special ticket and increased rare material rewards)'),(635,62506,'de','Verkünder der Zerstörung','Töte den Nergigante.','Ich weiss noch, wann das Ding aufgetaucht ist. Ich habe Hörner gehört, die nach Zerstörung klangen. Ich brauche Hilfe bei meiner Forschung, damit die Hörner verstummen!'),(636,61104,'de','Waldrand-Querulant','Erjage 2 Anjanath.','Ich bin heute früh aufgestanden, um ein paar Goldblüten zu sammeln, aber ein Anjanath stand mir im Weg! Kümmere dich um ihn! (Spezial-Ticket und mehr seltene Materialien als Belohnung!)'),(637,62506,'en','The Heralds of Destruction Cry','Slay Nergigante','I still remember when that thing showed up. I heard horns blaring in my head. It sounded like a song of destruction. I need help with my research, so those horns can stop!'),(638,61104,'en','Timberland Troublemakers','Hunt 2 Anjanath','I woke up early to go and fetch some Goldbloom, but I found a grumpy Anjanath standing in my way! Take care of him, will ya? (Rare material reward chance up, special ticket available)'),(639,62511,'de','Blauer Staub passiert rote Lust','Töte die Lunastra.','Was ist WAHRE Liebe? *seufz* Mann muss wohl die leidenschaftliche Verbindung zwischen Kaiserin und Kaiser der Flammen beobachten. Aber wer zu nahe kommt, verbrennt sich. So wie ich...'),(640,61105,'de','Traum eines jeden Jägers','Erjage alle Zielmonster.','Ich habe hier noch Zeichnungen von einer Waffe, die ein Jäger einst in Auftrag gegeben hat. Wenn du auch ein Exemplar möchtest, dann bring mir einfach die benötigten Materialien.'),(641,1423,'de','Tango für zwei','Erjage alle Zielmonster.','Ich drehe noch durch beim Gedanken daran, wie ich deine Spezialwerkzeuge verbessern kann. Besorge mir die Materialien, dann lasse ich deine Ausrüstung richtig cool werden! *Der 1. Abschluss verbessert den Eisschutz-Mantel.'),(642,61105,'en','Every Hunter\'s Dream','Hunt all target monsters','A hunter came by with a blueprint of a weapon he wanted. I still have the prints lying around, so if you want one of your own, get me the materials and I\'ll start workin\'.'),(643,50601,'en','A Visitor from Another World','Complete the assignment','My weirdo partner won\'t shut up about some non-animal animal he found in the Wildspire Waste. Do you wanna tag along? Whatever it is, it\'s bound to be something interesting!'),(644,1423,'en','Duet of Rime','Hunt all target monsters','I\'ve been going bonkers thinkin\' about how I can upgrade your specialized tools. You go out and get me the materials I need and I\'ll hook you up with a cool upgrade! (Upgrades the Iceproof Mantle upon first completion.)'),(645,61601,'de','Mitternachtschaos','Töte zehn Gastodon.','\"Was zur... Ich habe mich verlaufen? Ich erkenne diesen Ort nicht. Nun, dann mache ich es mir halt hier bequem!\" (Übersetzt vom Lynianer-Forscher) (Spezial-Ticket als Belohnung!)'),(646,62511,'en','When Blue Dust Surpasses Red Lust','Slay Lunastra','What is TRUE love? *sigh* One must witness the passionate bond between the empress and emperor of flame to truly know. Get too close and surely you\'ll get burned. Like I did...'),(647,50701,'de','Der Herr der Nahrungskette','Erjage einen Dämonjho.','Der Dämonjho ist ein furchterregendes Wesen, das die Idee der Nahrungskette mit seinem riesigen Kiefer zerfetzt! Jetzt ist er in der Neuen Welt angekommen. Zeit für eine Untersuchung!'),(648,1424,'de','Schatz im Dampf','Liefere zwei Heisse-Quelle-Steine.','Heeey du da! Ich habe ein paar grossartige Entwürfe parat, aber ich brauche dich, um ihnen den letzten Schliff zu verleihen! Hilf mir mit dieser Quest, dann bekommst du ein Spezial-Ticket!'),(649,61601,'en','Midnight Mayhem','Slay 10 Gastodon','\"The heck, am I lost? I don\'t recognize this place. Oh well, I might as well have some fun while I\'m here!\" (Translation by the Lynian Researcher) (Special ticket rewards)'),(650,50701,'en','The Food Chain Dominator','Hunt a Deviljho','The Deviljho is a frightening presence that takes the idea of the food chain and crushes it between its massive jaws! Now it\'s here in the New World. It\'s time to get investigating!'),(651,62515,'de','Sauregurkenzeit','Erjage einen Dämonjho.','Wir haben einen extrem sauren Dämonjho entdeckt! Ursache seiner Verstimmung ist wohl der Verzehr von Stromsteinen. Bereite dem Sodbrennen ein Ende und nimm die Stromsteine an dich!'),(652,1424,'en','Treasure in the Steam','Deliver 2 Hot Spring Stones','Duuuude! I got these sick drafts cooked up! Just, uh, they need a few more tweaks. Yo, help me out with this quest, and stuff, and you can get a special ticket. Pretty sweet, right?'),(653,61603,'de','Ein königlicher Schmerz','Erjage alle Zielmonster.','Ich würde gerne nach Hause, aber das königliche Getue überall... Kannst du mich daran erinnern, warum ich der Fünften beitrat? (Spezial-Ticket und mehr seltene Materialien als Belohnung!)'),(654,62515,'en','Relish the Moment','Hunt a Deviljho','We\'ve discovered an insanely fierce Deviljho! It seems the cause of his bad mood is his diet of Streamstones. Quell the beast, and take those Streamstones for yourself!'),(655,1431,'de','Spezialarena: MR Azurner Rathalos','Erjage einen Azurnen Rathalos.','Ein neuer Herausforderer: Azurner Rathalos – der territoriale Terrorist, tonnenweise Fleisch... und du bist seine Beilage! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(656,50751,'de','Tagesmenü: Flambierte Jägersleut','Erjage einen Dämonjho.','Auch wir sind Teil der Nahrungskette, wenn man mal darüber nachdenkt. Schlechte Neuigkeiten für uns, wenn mal wieder ein Dämonjho durchdreht. Kommen wir ihm zuvor!'),(657,1431,'en','Special Arena: MR Azure Rathalos','Hunt an Azure Rathalos','A new challenger: Azure Rathalos, the Sapphire Sultan, the True Blue Terror! Bow down to the king of all wyverns! Two fighters enter the Special Arena, but only one leaves!'),(658,50751,'en','Today\'s Special: Hunter Flambé','Hunt a Deviljho','Partner, we\'re part of the food chain too if you think about it. And that\'s bad news for us if a Deviljho gets a hankering for a hunter burger! So, let\'s hunt it down before we\'re lunch!'),(659,1432,'de','Spezialarena: MR Schwarze Diablos','Erjage eine Schwarze Diablos.','Eine neue Herausfordererin: Schwarze Diablos – ebenso grimmig wie tödlich, die schwarze Witwenmacherin, die mehr weiss! Zwei Kämpfer betreten die Spezialarena, nur einer kommt raus!'),(660,1432,'en','Special Arena: MR Black Diablos','Hunt a Black Diablos','A new challenger: Black Diablos, the Dark Destroyer, the Horn Express! Run, don\'t walk, from this furious fiend! Two fighters enter the Special Arena, but only one leaves!'),(661,62606,'de','Unsterbliches Alpenglühen','Leite den Zorah Magdaros.','Mein Heimatdorf lag im Weg des Zorah Magdaros und das Resultat war tragisch. Jetzt bin ich Teil der Fünften und ich brauche deine Hilfe, um unseren Erfolg sicherzustellen!'),(662,62606,'en','Undying Alpenglow','Guide Zorah Magdaros','My home was in the path of Zorah Magdaros, and the result was tragic. Now I\'m with the Fifth, and I need your help to make sure our operation is a success! I must avenge my hometown!'),(663,62607,'de','Wie eine Motte zur Flamme','Töte den Xeno\'jiiva.','Noch einmal möchte ich die Quelle dieser Energie sehen. Den aus Licht geborenen, der uns aller hierher geführt hat. Lass uns noch einmal zu dieser Reise aufbrechen!'),(664,62607,'en','Like a Moth to the Flame','Slay Xeno\'jiiva','Once more, I want to see that source of energy. The one born of light that has beckoned us all here to the New World. Let us embark on this journey once again if you are ready.'),(665,62608,'de','Kurz vor Sonnenaufgang','Leite den Zorah Magdaros.','Wenn ich den Zorah Magdaros sehe, fühle ich Traurigkeit und Heimweh. Lass uns diese Untersuchung abschliessen, damit ich mich auf den Heimweg machen kann.'),(666,62608,'en','Gaze Upon the Dawn','Guide Zorah Magdaros','Whenever I see Zorah Magdaros, I can\'t help but feel sad, and a bit homesick. Let\'s finish up our research so I can go back to the Old World and meet my master and former teammates again!'),(667,62609,'de','Hüter der Anderwelt','Töte den Xeno\'jiiva.','Während meiner Forschung bin ich auf einen Fluss gestossen. Als ich ihn durschwimmen wollte, sah ich eine Art übernatürliches Licht. Was war das nur?!'),(668,50801,'de','Die sengende Sonne','Töte den Teostra.','Ein Team hat einen Teostra in der Wildturm-Ödnis gesichtet. Das ist eine gute Gelegenheit für eine Audienz beim fürchterlichen Kaiser – denkst du das nicht auch?'),(669,62609,'en','Keeper of the Otherworld','Slay Xeno\'jiiva','During my research, I came across a river. Just as I was about to swim across, I spotted some kind of supernatural light. Its existence defied all explanation. Help me unravel this mystery.'),(670,50801,'en','The Blazing Sun','Slay Teostra','A team has spotted Teostra in the Wildspire Waste. I say it\'s an opportune time to go and have an audience with the infernal emperor, wouldn\'t you say?'),(671,63072,'en','Challenge Quest 2: MR Intermediate','Slay all target monsters','In the monster corner: An Anjanath-Fulgur Anjanath tag...team...? Bless their hearts, I think their lil\' ol\' arms are too short to tag... You ready to duke it out with set weapons and armor?'),(672,63001,'de','Herausforderung 1: Anfänger','Töte alle Zielmonster.','In der Monsterecke: Zwei mürrische Monstren, die einander verärgern. Schüsse unter die Gürtellinie sind erlaubt. Und da nur du einen Gürtel trägst, passt du besser auf dich auf!'),(673,63073,'de','Herausforderung 1: MR-Experten','Töte einen Yian Garuga.','In der Monsterecke: Yian Garuga, der schreiende Dämon, der Schnabelschnapper! Sowas Verrücktes haste nicht gesehen! Bist du bereit für einen Kampf mit festen Waffen und Rüstung?'),(674,63001,'en','Challenge Quest 1: Beginner','Slay all target monsters','In the monster corner: Two fringed contenders guaranteed to ruffle your feathers! Below the belt shots are allowed! You\'re the only one with a belt, so watch out!'),(675,50802,'de','Pandoras Arena','Schliesse die Aufgabe ab.','Da gibt\'s ein Sprichwort über in die Ecke drängen... Egal! In der Spezialarena ist gerade ein verwunderter Teostra, aber mit dem stimmt was nicht... Kannst du bitte nach ihm sehen?'),(676,63073,'en','Challenge Quest 1: MR Expert','Slay a Yian Garuga','In the monster corner: Yian Garuga, the Screamin\' Demon, the Beaked Berzerker! You\'ve never seen crazy like this before! You ready to duke it out with set weapons and armor?'),(677,50802,'en','Pandora\'s Arena','Complete the assignment','There\'s a saying about a cornered animal that slips me mind— Either way, there\'s wounded Teostra corralled in the Special Arena. Something\'s up with it. Go and check it out, eh?'),(678,63002,'de','Herausforderung 2: Anfänger','Töte alle Zielmonster.','In der Monsterecke: Ein Duo – Tobi-Kadachi und Paolumu! Unterschiedlich wie Tag und Nacht, sind die beiden meist entweder beste Freunde oder schlimmste Feinde.'),(679,63074,'de','Herausforderung 2: MR-Experten','Töte einen Wilden Dämonjho.','In der Monsterecke: Dämonjho, die Spitze der Nahrungskette, der Pulverisierer! Der macht sich gerne breit! Bist du bereit für einen Kampf mit festen Waffen und Rüstung?'),(680,50803,'de','Kein Erbarmen, keine Kapitulation','Töte alle Zielmonster.','Ich hätte nie gedacht, den Kaiser und seine Kaiserin am selben Ort zu sehen. Da ist es nur passend, dass du die Ehre hast, ihre Herrschaft zu beenden.'),(681,63074,'en','Challenge Quest 2: MR Expert','Slay a Savage Deviljho','In the monster corner: Deviljho, the food chain dominator, the pulverizing pickle! This is one hoss that likes to throw its weight around! You ready to duke it out with set weapons and armor?'),(682,63002,'en','Challenge Quest 2: Beginner','Slay all target monsters','In the monster corner: A Paolumu and Tobi-Kadachi tag team! One zips and zaps while the other drifts and flips! Wouldn\'t you know it, they make good enemies, but better friends!'),(683,61603,'en','A Royal Pain','Hunt all target monsters','I wouldn\'t mind going home, but I hate all the royal hubbub that goes with it. Fiver, remind me why I joined the Fifth. (Special ticket and increased rare material rewards)'),(684,63003,'de','Vespoiden-Befall','Töte 30 Vespoiden.','Das kann ja wohl nicht wahr sein! Ich habe hier ein Mittelchen zur Abschreckung von Monstern verteilt, aber stattdessen sind noch Vespoiden aufgetaucht. Ich brauche einen Kammerjäger!'),(685,63003,'en','Vespoid Infestation!','Slay 30 Vespoid','Oh deeeear! I placed some monster repellent around here, but it started attracting giant Vespoids too! Someone, anyone, I need an exterminator!'),(686,63004,'de','Ein dunkler, schlammiger Pfad','Töte einen Barroth.','Gerüchten zufolge lebt an diesem Ort ein mächtiges Monster. Eines, das eine Rüstung aus Erde trägt. Du musst, wie ich, auf der Suche nach einem Rivalen sein, der Grenzen austestet!'),(687,63004,'en','Down the Dark, Muddy Path','Slay a Barroth','I heard rumors of a powerful monster dwelling in this place. One clad in an armor of earth. You must be like myself, seeking a rival that will force you to surpass your limits. It\'s time to fight!'),(688,63005,'de','USJ-Anfängerherausforderung!','Töte einen Kulu-Ya-Ku.','Hallo und willkommen in den USJ! Wir sind stolz darauf, unsere neuste Quest-Attraktion bekanntzumachen; perfekt für Anfänger, die Spass haben wollen!'),(689,63005,'en','USJ Beginners Challenge!','Slay a Kulu-Ya-Ku','Hello everyone, and welcome to USJ! We\'re happy to introduce our latest quest attraction, perfectly suitable for beginners! Come on and enjoy yourselves!'),(690,63006,'de','USJ-Expertenherausforderung!','Töte eine Rathian.','Hallo und willkommen in den USJ! Wir sind stolz darauf, unsere neuste Quest-Attraktion bekanntzumachen; perfekt für jene, die eine Herausforderung suchen!'),(691,63006,'en','USJ Expert Challenge!','Slay a Rathian','Hello everyone, and welcome to USJ! We\'re happy to introduce our latest quest attraction, perfect for those who can beat up a monster with one arm tied behind their back!'),(692,63007,'de','USJ-Anfängerherausforderung!','Töte einen Tzitzi-Ya-Ku.','Hallo und willkommen in den USJ! Wir sind stolz darauf, unsere neuste Quest-Attraktion bekanntzumachen; perfekt für Anfänger, die Spass haben wollen!'),(693,63007,'en','USJ Beginners Challenge!','Slay a Tzitzi-Ya-Ku','Hello everyone, and welcome to USJ! We\'re happy to introduce our latest quest attraction, perfectly suitable for beginners! Come on and enjoy yourselves!'),(694,61604,'de','Könige kennen keine Angst','Erjage alle Zielmonster.','Der Anblick eines Rathalos erinnert mich daran, wie unbedeutend ich im Vergleich zum König der Lüfte bin. Und ich hasse es! Hilf mir, auch berühmt zu werden! (Spezial-Ticket und mehr seltene Materialien als Belohnung!)'),(695,63008,'de','USJ-Expertenherausforderung!','Töte einen Rathalos.','Hallo und willkommen in den USJ! Wir sind stolz darauf, unsere neuste Quest-Attraktion bekanntzumachen; perfekt für jene, die eine Herausforderung suchen!'),(696,63008,'en','USJ Expert Challenge!','Slay a Rathalos','Hello everyone, and welcome to USJ! We\'re happy to introduce our latest quest attraction, perfect for those who can beat up a monster with one arm tied behind their back!'),(697,50803,'en','No Remorse, No Surrender','Slay all target monsters','I never thought I\'d live to see both the emperor and his empress in one spot. It\'s only fitting that you have the honor of ending their reign.'),(698,63009,'de','Ein dunkler, schlammiger Pfad','Töte einen Barroth.','Gerüchten zufolge lebt an diesem Ort ein mächtiges Monster. Eines, das eine Rüstung aus Erde trägt. Du musst, wie ich, auf der Suche nach einem Rivalen sein, der Grenzen austestet!'),(699,50861,'de','Fürchterliche Monarchie','Töte alle Zielmonster.','Ich weiss nicht, wie es dazu kam, aber wir haben die Gelegenheit bekommen, den Teostra und die Lunastra in der Wildturm-Ödnis zu beobachten. Sieh selbst, aber sei vorsichtig!'),(700,50861,'en','Infernal Monarchy','Slay all target monsters','I don\'t know how it happened, but we have the chance to observe Teostra and Lunastra behavior in the Wildspire Waste! This is something we can\'t miss! Go see for yourself, but don\'t get hurt!'),(701,50891,'de','Blaue Prominenz','Töte die Lunastra.','Himmel, ich war in der Wildnis unterwegs, um das Fressverhalten von Monstern zu studieren, als ein riesiger blauer Drache aufgetaucht ist! Hilf mir, ich will doch nur forschen!'),(702,63101,'de','Nergigante Tötungs-Event 1','Töte den Nergigante.','An alle, die die Neue Welt unter den widrigsten Umständen erobert haben! Wir grüssen euch mit einer Quest, die zeigen wird, wen man künftig als wahren Saphirstern bezeichnen darf!'),(703,50891,'en','Blue Prominence','Slay Lunastra','I was out studying the feeding habits of some seriously cute local fauna when—WOWZERS—a gigantic blue elder dragon appears! Take care of it so I can get back to research that matters!'),(704,63101,'en','Nergigante Slay Event 1','Slay Nergigante','To the hunters who have conquered the New World using everything at your disposal, we salute you with a quest that will show us why they call you the true Sapphire Star!'),(705,63102,'de','Nergigante Tötungs-Event 2','Töte den Nergigante.','An alle, die die Neue Welt unter den widrigsten Umständen erobert haben! Wir grüssen euch mit einer Quest, die zeigen wird, wen man künftig als wahren Saphirstern bezeichnen darf!'),(706,63102,'en','Nergigante Slay Event 2','Slay Nergigante','To the hunters who have conquered the New World using everything at your disposal, we salute you with a quest that will show us why they call you the true Sapphire Star!'),(707,61604,'en','Kings Know No Fear','Hunt all target monsters','Just looking at a Rathalos reminds me of how irrelevant I am compared to the King of the Skies. And I hate it! Help me be famous too! (Increased chance of rare material rewards, special ticket available)'),(708,63103,'de','Nergigante Tötungs-Event 3','Töte den Nergigante.','An alle, die die Neue Welt unter den widrigsten Umständen erobert haben! Wir grüssen euch mit einer Quest, die zeigen wird, wen man künftig als wahren Saphirstern bezeichnen darf!'),(709,61605,'de','Mosswine und Mooswein','Töte 5 Mosswine.','Der Admiral und der Miauskuläre Koch haben ein paar Mosswine gefangen und sie in die Arena verschleppt. Ich habe mich nicht getraut, es ihnen zu sagen, aber diese Mosswine sehen irgendwie seltsam aus. Aber sieh selbst! *maunz*'),(710,63103,'en','Nergigante Slay Event 3','Slay Nergigante','To the hunters who have conquered the New World using everything at your disposal, we salute you with a quest that will show us why they call you the true Sapphire Star!'),(711,63009,'en','Down the Dark, Muddy Path','Slay a Barroth','I heard rumors of a powerful monster dwelling in this place. One clad in an armor of earth. You must be like myself, seeking a rival that will force you to surpass your limits. It\'s time to fight!'),(712,61605,'en','Mosswinin\' and Dinin\'','Slay 5 Mosswine','The Admiral and Meowscular Chef trapped some Mosswine and put them into the Arena. I didn\'t have the courage to tell them, but those Mosswine look purr-ty odd to me. Take a look!'),(713,61606,'de','Der grösste Jagras','Erjage einen Gross-Jagras.','Ich habe gehört, ein Jäger habe einen Gross-Jagras in die Ecke getrieben, aber bevor er ihn erledigen konnte, ist ein Schatten aufgetaucht. Was denkst du ist das gewesen? Bitte zieh los und finde es heraus! (Spezial-Ticket als Belohnung!)'),(714,61606,'en','The Greatest Jagras','Hunt a Great Jagras','So I heard that a hunter had a Great Jagras cornered, but when they went to finish it off, a shadow appeared. What do you think it is? Heh, go out and find out for yourself! (Special ticket rewards)'),(715,63104,'de','Sturm & Fang Tötungs-Event 1','Töte alle Zielmonster.','An alle, die die Neue Welt unter den widrigsten Umständen erobert haben! Wir grüssen euch mit einer Quest, die zeigen wird, wen man künftig als wahren Saphirstern bezeichnen darf!'),(716,61607,'de','Der Name lautet Lavasioth!','Erjage einen Lavasioth.','Hey, wir wurden gebeten, ein Monster zu untersuchen, das zuvor niemand untersuchen wollte! Dieses grosse Fischding, das in Lava schwimmt. Du weisst schon, von wem ich rede, oder? (Spezial-Ticket als Belohnung!)'),(717,63104,'en','Gale & Fangs Slay Event 1','Slay all target monsters','To the hunters who have conquered the New World using everything at your disposal, we salute you with a quest that will show us why they call you the true Sapphire Star!'),(718,61607,'en','The Name\'s Lavasioth!','Hunt a Lavasioth','Yo, we got asked to research a monster that no one ever wants to research! You know the one, that big floppy fishy that likes to lounge around in the lava! Yeah, THAT one! (Special ticket rewards)'),(719,63105,'de','Sturm & Fang Tötungs-Event 2','Töte alle Zielmonster.','An alle, die die Neue Welt unter den widrigsten Umständen erobert haben! Wir grüssen euch mit einer Quest, die zeigen wird, wen man künftig als wahren Saphirstern bezeichnen darf!'),(720,61801,'de','Perlenschnapper','Liefere sechs Perlenquell-Makaken.','Oh! Mein bester Assistent kommt mir zu Hilfe! Kannst du mir einen dieser flauschigen Perlenquell-Makaken fangen? Wofür? Na, zum Spiel... äh... zur Forschung natürlich! (Bei Abschluss winken besondere Materialien als Belohnung.)'),(721,63105,'en','Gale & Fangs Slay Event 2','Slay all target monsters','To the hunters who have conquered the New World using everything at your disposal, we salute you with a quest that will show us why they call you the true Sapphire Star!'),(722,61801,'en','Pearl Snatchers','Deliver 6 Pearlspring Macaques','Ooooh! My best assistant came to lend me a hand! Think you can catch me some of those fluffy duffy Pearlspring Macaques? For what? Duh! To play with—er, I mean to research of course, you silly hunter! (Special material rewards upon completion.)'),(723,63106,'de','Sturm & Fang Tötungs-Event 3','Töte alle Zielmonster.','An alle, die die Neue Welt unter den widrigsten Umständen erobert haben! Wir grüssen euch mit einer Quest, die zeigen wird, wen man künftig als wahren Saphirstern bezeichnen darf!'),(724,61802,'de','Traum eines jeden Jägers III','Erjage alle Zielmonster.','Ich habe hier noch Zeichnungen von einer Waffe, die ein Jäger einst in Auftrag gegeben hat. Wenn du auch ein Exemplar möchtest, dann bring mir einfach die benötigten Materialien. (Bei Abschluss winken besondere Materialien als Belohnung.)'),(725,63031,'de','Herausforderung 1: Fortgeschrittene','Töte alle Zielmonster.','In der Monsterecke: Ein Duo – Tzitzi-Ya-Ku und Rathalos! Ein Krieg an zwei Fronten ist nie Spass, aber du findest schon die richtige Strategie...'),(726,63106,'en','Gale & Fangs Slay Event 3','Slay all target monsters','To the hunters who have conquered the New World using everything at your disposal, we salute you with a quest that will show us why they call you the true Sapphire Star!'),(727,61802,'en','Every Hunter\'s Dream III','Hunt all target monsters','A hunter came by with a blueprint of a weapon they wanted. I still have the prints lying around, so if you want one of your own, get me the materials and I\'ll start workin\'. (Special material rewards)'),(728,63031,'en','Challenge Quest 1: Intermediate','Slay all target monsters','In the monster corner: A Rathalos and Tzitzi-Ya-Ku tag team! Fighting a war on two fronts is never fun, but maybe one of the monsters can *ahem* shed some light on a viable strategy!'),(729,63107,'de','Nergigante Tötungs-Event 4','Töte den Nergigante.','An alle, die die Neue Welt unter den widrigsten Umständen erobert haben! Wir grüssen euch mit einer Quest, die zeigen wird, wen man künftig als wahren Saphirstern bezeichnen darf!'),(730,50892,'de','Blaue Prominenz','Töte die Lunastra.','Himmel, ich war in der Wildnis unterwegs, um das Fressverhalten von Monstern zu studieren, als ein riesiger blauer Drache aufgetaucht ist! Hilf mir, ich will doch nur forschen!'),(731,61803,'de','Traum eines jeden Jägers II','Fange einen Korallen-Pukei-Pukei.','Ich habe hier noch Zeichnungen von Palico-Ausrüstung, die ein Jäger einst in Auftrag gegeben hat. Wenn du auch ein Exemplar möchtest, dann bring mir einfach die benötigten Materialien. (Bei Abschluss winken besondere Materialien als Belohnung.)'),(732,63032,'de','Herausforderung 2: Fortgeschrittene','Töte 2 Odogaron.','In der Monsterecke: ein Odogaron-Doppelpack! Wer sich in ihren Einflussbereich begibt, muss sich auf gnadenlose Bestrafungen gefasst machen!'),(733,63107,'en','Nergigante Slay Event 4','Slay Nergigante','To the hunters who have conquered the New World using everything at your disposal, we salute you with a quest that will show us why they call you the true Sapphire Star!'),(734,61803,'en','Every Hunter\'s Dream II','Capture a Coral Pukei-Pukei','A hunter came by with blueprints for Palico equipment they wanted me to craft. I still have the prints lying around, so if you want one of your own, get me the materials and I\'ll start workin\'. (Special material rewards)'),(735,63108,'de','Dämonjho Tötungs-Event','Töte einen Dämonjho.','Wir können jemanden wie dich nicht in noch höheren Tönen loben, deshalb haben wir hier eine Quest, die selbst dich vor Herausforderungen stellen wird, geliebter Saphirstern!'),(736,61805,'de','Bausch dich auf','Liefere acht Bauschpinguine.','Könntest du mir bitte helfen? Ich bräuchte ein paar Bauschpinguine. Kannst du mir welche fangen? Musst aber schnell sein, die Freunde sind flink! (Bei Abschluss winken besondere Materialien als Belohnung.)'),(737,63032,'en','Challenge Quest 2: Intermediate','Slay 2 Odogaron','In the monster corner: A double dose of Odogaron! Any hunter brave enough to step into their penitentiary should prepare for the most brutal of sentences!'),(738,63108,'en','Deviljho Slay Event','Slay a Deviljho','We can\'t lavish any more praise on a hunter such as yourself, who has survived the dangers of the New World. But we do have a quest that will challenge even you, our Sapphire Star!'),(739,63033,'de','Gajalaka-Ausbruch!','Besiege zehn Gajalaka.','Himmel, ich wollte doch nur die Gajalaka-Sprache studieren, also waren einige in meiner Begleitung, aber die sind alle weggerannt. Trommle sie zusammen, bevor sie Ärger bekommen...'),(740,63033,'en','Gajalaka Outbreak!','Defeat 10 Gajalaka','Geez, I just wanted to study the Gajalaka language, so I brought a group of them with me, but they all ran away! Can you help me round them up before they get into trouble?'),(741,50892,'en','Blue Prominence','Slay Lunastra','I was out studying the feeding habits of some seriously cute local fauna when—WOWZERS—a gigantic blue elder dragon appears! Take care of it so I can get back to research that matters!'),(742,63034,'de','Das erwachte Satsui No Hado I','Töte den Nergigante.','Hah, du möchtest es mit einem richtigen Boss von Monster aufnehmen, hm? Keine Sorge, das bleibt unter uns. Du ziehst einfach los und hältst das Ding mit all deiner Kraft auf!'),(743,61805,'en','Duffel Duty','Deliver 8 Duffel Penguins','You ready to lend me a hand? Oh, goodie! I need you to capture some Duffel Penguins for me. You gotta be quick, though. They\'ll give you the flipper then you give you the slip! (Special material rewards)'),(744,63034,'en','The Awakened Satsui No Hado I','Slay Nergigante','Hah, you\'ve come to fight a real boss of a dragon, eh? Don\'t worry, I won\'t say a word about this. You just go and stop that thing with all you\'ve got!'),(745,61806,'de','Kein Terz wegen Erz','Erjage einen Brachydios.','Verdammt, Bergarbeit ist ja ein Ganzkörpertraining! Wenn ich eine bessere Spitzhacke hätte... Oh, ich hab\'s! Ja, INSPIRATION! Auf zu den Nachrichtenbrettern! (Bei Abschluss winken besondere Materialien als Belohnung.)'),(746,63035,'de','Das erwachte Satsui No Hado II','Töte den Nergigante.','Hah, du möchtest es mit einem richtigen Boss von Monster aufnehmen, hm? Keine Sorge, das bleibt unter uns. Du ziehst einfach los und hältst das Ding mit all deiner Kraft auf!'),(747,61806,'en','Scores of Ores','Hunt a Brachydios','Dang, mining is a workout! If I had a cooler pickaxe maybe this wou—...!? I got it! Yes, INSPIRATION! To the message boards! (Special material rewards)'),(748,63035,'en','The Awakened Satsui No Hado II','Slay Nergigante','Hah, you\'ve come to fight a real boss of a dragon, eh? Don\'t worry, I won\'t say a word about this. You just go and stop that thing with all you\'ve got!'),(749,61807,'de','Gänsehaut für alle','Töte alle Zielmonster.','Himmel, ist das kalt heute! Ein Schal würde bestimmt helfen. Vielleicht aber auch... Oh, ich hab\'s! Ja, INSPIRATION! Auf zu den Nachrichtenbrettern! (Bei Abschluss winken besondere Materialien als Belohnung.)'),(750,63036,'de','Das erwachte Satsui No Hado III','Töte den Nergigante.','Hah, du möchtest es mit einem richtigen Boss von Monster aufnehmen, hm? Keine Sorge, das bleibt unter uns. Du ziehst einfach los und hältst das Ding mit all deiner Kraft auf!'),(751,63036,'en','The Awakened Satsui No Hado III','Slay Nergigante','Hah, you\'ve come to fight a real boss of a dragon, eh? Don\'t worry, I won\'t say a word about this. You just go and stop that thing with all you\'ve got!'),(752,63109,'de','Der Beste der Besten','Töte alle Zielmonster.','Wir können jemanden wie dich nicht in noch höheren Tönen loben, deshalb haben wir hier eine Quest, die selbst dich vor Herausforderungen stellen wird, geliebter Saphirstern!'),(753,63037,'de','Kaiserin in voller Blüte I','Töte die Rosa Rathian.','Man sagt, hier gebe es ein Monster so rosa wie Kirschblüten, stimmt das?! Finden wir heraus, wer hier der Stärkste ist... Du, ich oder das Monster. Der Gewinner bekommt einen Preis!'),(754,63109,'en','The Best of the Best','Slay all target monsters','We can\'t lavish any more praise on a hunter such as yourself, who has survived the dangers of the New World. But we do have a quest that will challenge even you, our Sapphire Star!'),(755,63037,'en','Empress in Full Bloom I','Slay Pink Rathian','They say there\'s a monster as pink as the cherry blossoms around these parts, is that true!? Let\'s see who\'s the strongest, you, me, or that monster! Winner gets a prize!'),(756,63110,'de','Was im Wald lauert','Töte alle Zielmonster.','Wir können jemanden wie dich nicht in noch höheren Tönen loben, deshalb haben wir hier eine Quest, die selbst dich vor Herausforderungen stellen wird, geliebter Saphirstern!'),(757,61807,'en','A Chilling Entrance','Slay all target monsters','It\'s cold today, better get a scarf to warm up. I wonder what\'ll happen if I wrap my hea—...!? I got it! INSPIRATION! To the message boards! (Special material rewards)'),(758,63110,'en','What Lurks In The Forest','Slay all target monsters','We can\'t lavish any more praise on a hunter such as yourself, who has survived the dangers of the New World. But we do have a quest that will challenge even you, our Sapphire Star!'),(759,61808,'de','Affenantagonistenaberwitz','Erjage zwei Rajang.','Mann, ich wünschte, ich wäre so stark wie ein Jäger! Statt zu trainieren könnte ich mir auch einen... Oh, ich hab\'s! Ja, INSPIRATION! Auf zu den Nachrichtenbrettern! (Bei Abschluss winken besondere Materialien als Belohnung.)'),(760,63130,'de','Wenn Recht auf Krieg trifft','Töte einen Bazelgeuse.','Nur wer wie du die Gefahren der Neuen Welt überlebt hat, kann bis zum Ende aufrecht stehen und allen zeigen, wer ein Herz hat, das Widrigkeiten trotzt.'),(761,50901,'de','Festmahl im Erdenen Saal','Besiege die Kulve Taroth.','Die Muttergöttin ist wieder aufgetaucht, aber da wir jetzt die Fünfte hier haben, können wir endlich die Untersuchung abschliessen, die wir vor Jahrzehnten angefangen haben!'),(762,63130,'en','When Law Meets War','Slay a Bazelgeuse','Only a hunter like you, who has survived the dangers of the New World, can stand tall until the end and show everyone who has a heart that will not succumb to adversity!'),(763,50901,'en','Banquet in the Earthen Hall','Repel Kulve Taroth','The mother goddess has appeared again, but now that we have the Fifth here, we can finally complete the investigation that we started decades ago! We\'re counting on you kids!'),(764,63131,'de','Die Jagd auf die Blaue Königin','Töte eine Lunastra.','Nur wer wie du die Gefahren der Neuen Welt überlebt hat, kann bis zum Ende aufrecht stehen und allen zeigen, wer das feurigste Herz von allen hat!'),(765,63038,'de','Kaiserin in voller Blüte II','Töte die Rosa Rathian.','Man sagt, hier gebe es ein Monster so rosa wie Kirschblüten, stimmt das?! Finden wir heraus, wer hier der Stärkste ist... Du, ich oder das Monster. Der Gewinner bekommt einen Preis!'),(766,63131,'en','The Hunter and The Blue Empress','Slay a Lunastra','Only a hunter like you, who has survived the dangers of the New World, can stand tall until the end and show everyone who has the fieriest of hearts!'),(767,61808,'en','Muscle Monkey Madness','Hunt 2 Rajang','Boy, I wish I could be as strong as you hunters! Maybe instead of getting buff, I could wear—!? I got it! Yes, INSPIRATION! To the message boards! (Special material rewards)'),(768,63142,'de','Frostiger Abschied','Töte einen Velkhana.','An alle Jäger, die die Gefahren der Neuen Welt überlebt haben: Ich hoffe ihr könnt euer Potenzial noch einmal zur Schau stellen. Zeigt Ihnen das der Saphirstern nie einfrieren wird!'),(769,61809,'de','Paolumu-Schlaflieder','Erjage einen Nachtschatten-Paolumu.','Der Admiral und der Boss haben einen Nachtschatten-Paolumu gefangen, aber irgendwas ist da ganz entkätzlich! Ich habe nichts gesagt, aber könntest du dir das bitte mal ansehen?'),(770,50902,'de','Der Zorn von Eldorado','Besiege die Kulve Taroth.','Das alte Mädchen ist zurück und stärker als je zuvor – ihr Panzer aus Weissgold würde selbst Blinde blenden! Die Erste und die Fünfte arbeiten diesmal zusammen. Lassen wir uns diese goldene Gelegenheit nicht entgehen!'),(771,63142,'en','Farewell to the Frozen','Slay a Velkhana','To the hunters who have survived the dangers of the New World, I hope you can display your full potential one more time. Show them that the Sapphire Star can never be frozen!'),(772,61809,'en','Paolumu Lullabies','Hunt a Nightshade Paolumu','The Admiral and Chef managed to capture a Nightshade Paolumu, but something seemed pawfully off. I didn\'t mention anything to those two, but purrhaps you could take a look, Meowster?'),(773,50902,'en','The Fury of El Dorado','Repel Kulve Taroth','The old girl is back and stronger than ever, this time dressed to the nines in a glittering white gold coat! With the First and Fifth working together, we won\'t let this golden opportunity go to waste!'),(774,50905,'de','Die legendäre Bestie','Schliesse die Aufgabe ab.','Eine Art Bestie ist in der Neuen Welt angekommen, dank der Instabilität des Äthers. Wir müssen etwas unternehmen, sonst ist jedes Lebewesen in der Neuen Welt in ernster Gefahr!'),(775,63038,'en','Empress in Full Bloom II','Slay Pink Rathian','They say there\'s a monster as pink as the cherry blossoms around these parts, is that true!? Let\'s see who\'s the strongest, you, me, or that monster! Winner gets a prize!'),(776,50905,'en','The Legendary Beast','Complete the assignment','Some kind of beast has arrived in the New World due to the instability of the aether. We have to do something otherwise every living thing in the New World is in serious danger!'),(777,63039,'de','Kaiserin in voller Blüte III','Töte die Rosa Rathian.','Man sagt, hier gebe es ein Monster so rosa wie Kirschblüten, stimmt das?! Finden wir heraus, wer hier der Stärkste ist... Du, ich oder das Monster. Der Gewinner bekommt einen Preis!'),(778,50906,'de','Kein Weg zurück','Töte den Behemoth.','Das war eine eorzäische Bestie, ein Behemoth, in der Heimat der Ältesten. Auf Rat eines Mogrys suchen wir einen verlässlichen Jäge––... Abenteurer, der uns helfen kann.'),(779,63039,'en','Empress in Full Bloom III','Slay Pink Rathian','They say there\'s a monster as pink as the cherry blossoms around these parts, is that true!? Let\'s see who\'s the strongest, you, me, or that monster! Winner gets a prize!'),(780,63051,'de','Herausforderung 1: Experten','Töte alle Zielmonster.','In der Monsterecke: Ein Bazelgeuse-Uragaan-Duo! Mit diesen beiden hier rennst du quasi durch ein Minenfeld, also pass auf, wo du hintrittst.'),(781,64101,'de','Wildturm-Aufregung','Erjage alle Zielmonster.','Weisst du, was passiert, wenn wir ein paar extrem kampflustige Monster an einen Ort locken? Nein? Ich auch nicht – also lass es uns versuchen! Es geht um einige Rüstkugeln!'),(782,63051,'en','Challenge Quest 1: Expert','Slay all target monsters','In the monster corner: A Bazelgeuse-Uragaan tag team! You\'re walking into a literal minefield with these two around! Watch your step and you won\'t get blown up!'),(783,61811,'de','Flora-Frostbeule','Liefere zehn Eisblüten.','Die Weite ist so kalt, dass dir die Ohren abfallen... habe ich gehört. Vielleicht würden Ohrenschützer helfen? Oh, ich hab\'s! Ja, INSPIRATION! Auf zu den Nachrichtenbrettern! (Bei Abschluss winken besondere Materialien als Belohnung.)'),(784,63052,'de','Herausforderung 2: Experten','Töte den Nergigante.','In der Monsterecke: Nergigante, der Sturzflug-Dämon, der Bissige Bestrafer, der Gereizte Raufbold. Der Kerl hat Hunger – und du bist das nächste Mahl auf der Speisekarte!'),(785,61811,'en','Flora Frostbite','Deliver 10 Iceblooms','The Reach is so cold your ears will fall off, or so I heard. Earmuffs would do the trick, or maybe some—!? I got it! Yes, INSPIRATION! To the message boards! (Special material rewards)'),(786,63052,'en','Challenge Quest 2: Expert','Slay Nergigante','In the monster corner: Nergigante, the Divebombing Demon, the Prickly Punisher, the Barbed Brawler. It\'s half past time for the Eater of Elder\'s next meal, and you\'re on the menu!'),(787,61812,'de','Fleisch, Fleisch, Fleisch, ...','Erjage alle Zielmonster.','Wie viel ich auch esse, ich werde einfach nicht satt! Ich bin wohl noch im Wachstum. Ich brauche wohl Protein. Oh, ich hab\'s! Ja, INSPIRATION! Auf zu den Nachrichtenbrettern! (Bei Abschluss winken besondere Materialien als Belohnung.)'),(788,63071,'de','Herausforderung 1: MR-Fortgeschrittene','Töte alle Zielmonster.','In der Monsterecke: Ein Duo – Tobi-Kadachi und Viper-Tobi-Kadachi! Sei auf der Lauer, denn hier werden bald die Fellfetzen fliegen! Bist du bereit für einen Kampf mit festen Waffen und Rüstung?'),(789,61812,'en','Beef is Never a Mi-steak','Hunt all target monsters','No matter how much I chow down, I\'m never full. Guess I\'m still a growing boy! I need my protein, or maybe—!? I got it! Yes, INSPIRATION! To the message boards! (Special material rewards)'),(790,63071,'en','Challenge Quest 1: MR Intermediate','Slay all target monsters','In the monster corner: A Tobi-Kadachi-Viper Tobi-Kadachi tag team! Stay on your toes against this tandem because the fur is about to fly! You ready to duke it out with set weapons and armor?'),(791,61813,'de','Eiskaltes Verlangen','Erjage einen Barioth.','An alle Jäger, die sich nach Action in der Arena sehnen, diese Quest ist für euch! Stellt euch unseren Herausforderungen und verdient euch besondere Materialien zur Waffenherstellung! (Besondere Materialien als Belohnung!)'),(792,61813,'en','50 Shades of White','Hunt a Barioth','To all hunters who yearn for action in the Arena, this quest is for you! Go head to head with our combatants, and earn special materials to craft weapons! (Special material rewards)'),(793,50906,'en','He Taketh It with His Eyes','Slay the Behemoth','It was a Behemoth, an Eorzean beast, in the Elder\'s Recess. Heed the moogle\'s advice, call upon other trustworthy hunte— adventurers to help quell this terror!'),(794,61814,'de','Ein schockierender Höhepunkt','Erjage alle Zielmonster.','Ich habe jene gefunden, die den Donner beherrschen! Eine Gruppe Jäger der 5. Flotte ist bereits losgezogen, aber nicht zurückgekehrt. Jetzt hängt es von dir ab... (Bei Abschluss winken besondere Materialien als Belohnung.)'),(795,61814,'en','A Shocking Climax','Hunt all target monsters','I have located the ones who command the thunder. I left the task to a group of Fifth Fleet hunters, but they have yet to return. It\'s up to you now. (Special material rewards)'),(796,50910,'de','Auftrag: Ärger im Uralten Wald','Schliesse die Aufgabe ab.','Achtung Feldteam! Im Uralten Wald wurde eine Anomalie entdeckt. Helft dem Hexer das Problem zu lösen. <STYL MOJI_RED_DEFAULT>In dieser Quest spielst du als Geralt von Riva.'),(797,62502,'de','Der tödlich stille Vorhang','Töte den Vaal Hazak.','Die wahrhaft schrecklichen Dinge sind die, die im Verborgenen schlummern. Aber wie kann das sein? Die 3. Flotte bittet dich, den Vorhang um dieses Geheimnis zu lüften...'),(798,50910,'en','Contract: Trouble in the Ancient Forest','Complete the assignment','Attention field team! An anomaly has been discovered in the Ancient Forest. Help the witcher resolve this issue. <STYL MOJI_RED_DEFAULT>In this quest, you will get to play as Geralt of Rivia.'),(799,62502,'en','The Deathly Quiet Curtain','Slay Vaal Hazak','The truly horrifying things are the ones sleeping in silence, no? But what could it be? The Third Fleet urges you to press on, to lift the curtain off of this mystery and feed our obsession.'),(800,50991,'de','Ein Besucher aus Eorzea','Töte den Behemoth.','Ein Behemoth ist in der Heimat der Ältesten aufgetaucht. Konventionelle Methoden versagen, also suchen wir einen verlässlichen Jäge––... Abenteurer, der uns helfen kann.'),(801,62503,'de','Das Flüstern der weissen Mähne','Töte den Kirin.','Anfangs dachte ich, es wäre eine Illusion gewesen, die auf mich herabstarrte. Der weisse Nebel hat mir die Gänsehaut meines Lebens verpasst! Du musst meine Erfahrung bestätigen.'),(802,50991,'en','A Visitor from Eorzea','Slay the Behemoth','A Behemoth has appeared in the Elder\'s Recess. Conventional methods won\'t work, call upon other trustworthy hunte— adventurers to help quell the beast!'),(803,62503,'en','A Whisper of White Mane','Slay Kirin','At first I thought it was an illusion, staring down at me. That white mist gave me chills I\'ll never forget. I need your help to confirm my findings.'),(804,51601,'de','Offenbare dich, Zerstörer','Schliesse die Aufgabe ab.','Wer oder was auch immer das Horn des Kirin zerbrochen hat, wir haben es in die Leitlande verfolgt. Du kannst jeden Zenny wetten, dass dies kein leichter Kampf wird, also halte deine Deckung oben. Und sei nicht zu spät!'),(805,62504,'de','Das Gespött der Sonne','Töte den Teostra.','Als ich in der Alten Welt zum ersten Mal einen Teostra bekämpft habe, wusch Angst über mich und gab mir Stärke. Heute weiss ich, dass Kraft in der Ruhe liegt, nicht in der Furcht.'),(806,51601,'en','Reveal Thyself, Destroyer','Complete the assignment','We\'ve traced whatever broke the Kirin\'s horn to the Guiding Lands. You can bet your bottom zenny that it\'s one tough customer, so don\'t let your guard down. And don\'t be late!'),(807,64101,'en','Wicked Wildspire Warfare','Hunt all target monsters','Do you know what\'ll happen if we get a couple of highly territorial monsters in one spot? No? Neither do I! Let\'s find out. Come out on top to earn Armor Spheres!'),(808,63072,'de','Herausforderung 2: MR-Fortgeschrittene','Töte alle Zielmonster.','In der Monsterecke: Ein Duo...? Anjanath und Fulgur-Anjanath! Mit den kurzen Armen wird das Abklatschen schwierig... Bist du bereit für einen Kampf mit festen Waffen und Rüstung?'),(809,64601,'de','Uragaaanz schwindelig','Erjage zwei Uragaan.','*stöhn* Mir dreht sich immer noch alles. Wir müssen jemanden finden, der diese Störenfriede erlegt, bevor noch jemand anderem richtig übel wird! Es geht um viele Rüstkugeln!'),(810,64601,'en','Rollin\' With The Uragaan','Hunt 2 Uragaan','Urk, my head is still spinning from what I just saw. We need someone to take out these troublemakers before anyone else gets queasy. Complete this quest for a lot of Armor Spheres!'),(811,64801,'de','Ballonkampf','Erjage alle Zielmonster.','Okay, ich geb zu, ich bin mit den Partyvorbereitungen etwas zu weit gegangen. Aber ich schwör, ich hab die Ballons nicht zum Platzen gebracht. Lass diese Viecher platzen und der Meister der 2. Flotte lässt dir Rüstkugeln zukommen!'),(812,66104,'de','Der mythische Kirin','Töte 2 Kirin.','Ich schau nach links, er erscheint rechts. Ich seh hinter mich, er taucht vor mir auf. Ich denke, es ist einer – es erscheinen zwei. Schnauze voll, übernimm du.'),(813,64801,'en','Balloon Fight','Hunt all target monsters','OK. I, uh, admit that I went a little crazy with the party prep, but I swear I did NOT blow up those balloons. Pop those pests and the Second Fleet Master will hook you up with armor spheres!'),(814,66104,'en','Kirin The Myth','Slay 2 Kirin','I looked left, it appeared on the right. I glanced behind me, it showed up in front of me. When I thought there was one of them, there were two. I\'m outmatched here. This task is all yours.'),(815,66105,'de','Die Giftgruppe','Erjage alle Zielmonster.','Man sagt, die schönsten Kelche seien giftig. Aber ich glaube nicht, dass das auf Flugwyvern zutrifft. Dennoch sollte das mal jemand untersuchen...'),(816,66105,'en','The Poison Posse','Hunt all target monsters','They say the most beautiful of chalices are poisonous. But I don\'t think that applies to flying wyverns. But just in case, look into that for me.'),(817,66106,'de','Die Vielfrasse grüssen','Erjage alle Zielmonster.','Hm? Ja, das ist eine Quest vom Miauskulären Koch. Was? Du willst an meiner Stelle gehen? Wow, vielen Dank! Um dir meine Dankbarkeit zu zeigen, geht die nächste Mahlzeit auf mich!'),(818,66106,'en','Greeting the Gluttons','Hunt all target monsters','Huh? Yeah, this is a quest from the Meowscular Chef. Whoa, you\'ll go instead of me? Wow, thanks a bunch! To show my gratitude, the next meal\'s on me!'),(819,51602,'de','Gediegener Stolz','Töte einen Kirin.','Hast du die Gerüchte über Halbhorn gehört? Er ist wohl in der Raureif-Weite aufgetaucht, aber hinter dem Warum stehen noch viele Fragezeichen. Klingt nach einem Mysterium, das Aufklärung benötigt, hm?'),(820,64802,'de','Eine übelriechende Party','Erjage einen Brodelnden Bazelgeuse.','Wow, das war eine krasse Party! Aber irgendein Spassverderber hat seine Partyüberreste überall verteilt... Tut mir leid, jemand muss das saubermachen, aber ich mach es nicht! Übernimm das und der Meister der 2. Flotte lässt dir Rüstkugeln zukommen!'),(821,66601,'de','Tiefgrüner Blues','Erjage alle Zielmonster.','Die Monster im Uralten Wald scheinen einander bekämpfen zu wollen, was ein grosser Segen für unsere Forschung sein könnte. Wir müssen diese Chance nutzen!'),(822,51602,'en','Sterling Pride','Slay a Kirin','You hear the rumors of ol\' Shattered Horn? Sounds like it\'s shown up in the Hoarfrost Reach, but why it\'s there and why its horn is broken is as clear as mud! Sounds like a mystery worth investigating, eh?'),(823,66601,'en','Deep Green Blues','Hunt all target monsters','The monsters lurking deep in the Ancient Forest seem intent on facing off with each other. This could be a huge boon for our research. Hunters, don\'t let this opportunity pass us by!'),(824,64802,'en','Talk About a Party Foul...','Hunt a Seething Bazelgeuse','Wooo, that was one GNARLY party! But some, uh, party pooper left all his party poop all over the place... Sorry, Player. Someone\'s gotta clean up this mess and it ain\'t me! But if you do, the Second Fleet Master will hook you up with some sweet armor spheres!'),(825,51603,'de','Über den verlorenen Pfad','Schliesse die Aufgabe ab.','Wir haben in den Leitlanden einen neuen Weg entdeckt, den selbst Monster meiden. Langfristig ist er vielleicht kein Problem, einen Blick ist er aber allemal wert!'),(826,65601,'de','Shamos-Schlamassel','Erjage 13 Shamos.','Ich versinke in Anfragen für die Sachen, die ich trage, aber ich brauche spezielle Materialien, um die Nachfrage zu decken. Das ist dein Stichwort... Los geht\'s!'),(827,66602,'de','Wildturm-Bolero','Erjage alle Zielmonster.','Die Monster in der Wildturm-Ödnis scheinen einander bekämpfen zu wollen, was ein grosser Segen für unsere Forschung sein könnte. Wir müssen diese Chance nutzen!'),(828,51603,'en','Across the Lost Path','Complete the assignment','We\'ve discovered a new path in the Guiding Lands that even monsters tread carefully around. This may not be an issue from a long-term perspective, but it warrants an investigation.'),(829,65601,'en','Scrapping with the Shamos','Hunt 13 Shamos','I\'m getting bombarded with requests left n\' right for the stuff I\'m wearing, but I\'m gonna need some special materials to meet demand. That\'s your cue, Hunter. You know what to do.'),(830,66602,'en','Wildspire Bolero','Hunt all target monsters','The monsters roaming the Wildspire Waste seem intent on facing off with each other. This could be a huge boon for our research. Hunters, don\'t let this opportunity pass us by!'),(831,51604,'de','Umkehrgrenzpunkt','Schliesse die Aufgabe ab.','Du musst mehr über dieses rote Monster herausfinden. Und stürzt dich nicht Hals über Kopf rein. Finde heraus, was du musst, und komm dann zurück.'),(832,65602,'de','Apfel meines Auges','Erjage drei Tzitzi-Ya-Ku.','Meine liebe Schwester und ich leiden unter schlechtem Sehvermögen, aber der Meister der 2. Flotte hat uns tolle Brillen geschmiedet. Ich gebe dir meine, wenn du mir hilfst.'),(833,66603,'de','Korallenwalzer','Erjage alle Zielmonster.','Die Monster im Korallenhochland scheinen einander bekämpfen zu wollen, was ein grosser Segen für unsere Forschung sein könnte. Wir müssen diese Chance nutzen!'),(834,51604,'en','Point of No Return','Complete the assignment','We need you to do some recon on that red monster. Remember, don\'t get in over your head. Get in, find out what you need, then get out.'),(835,65602,'en','A Flash in the Pan','Hunt 3 Tzitzi-Ya-Ku','My dear sister and I were suffering from poor eyesight, but the Second Fleet Master crafted us some fine spectacles. I\'ll give mine to you if you help me test them out!'),(836,66603,'en','Coral Waltz','Hunt all target monsters','The monsters roaming the Coral Highlands seem intent on facing off with each other. This could be a huge boon for our research. Hunters, don\'t let this opportunity pass us by!'),(837,65603,'de','Ei-Liebhaber vereint','Erjage einen Kulu-Ya-Ku.','Während ich da draussen Ei-Proben gesammelt habe, hat mich ein vertrauter Schatten erschreckt. Aber das können wir nutzen! Beobachte das Verhalten des Kulu-Ya-Ku und erstatte Bericht!'),(838,66604,'de','Miasma-Oper','Erjage alle Zielmonster.','Die Monster im Tal der Verwesung scheinen einander bekämpfen zu wollen, was ein grosser Segen für unsere Forschung sein könnte. Wir müssen diese Chance nutzen!'),(839,65603,'en','Egg Lovers United','Hunt a Kulu-Ya-Ku','While out gathering egg specimens, a familiar shadow took me unawares. But I believe we can use this for our own purposes! Study the Kulu-Ya-Ku\'s behavioral patterns, and report back!'),(840,66604,'en','Effluvial Opera','Hunt all target monsters','The monsters roaming the Rotten Vale seem intent on facing off with each other. This could be a huge boon for our research. Hunters, don\'t let this opportunity pass us by!'),(841,65604,'de','Lass wackeln!','Liefere zehn Wackelwürmer.','Hey, bleib mit dem Netz weg – ich bin kein Wackelwurm! Hab dich reingelegt, was? Wenn du magst, was ich trage, musst du mir bei meiner Forschung ein wenig helfen.'),(842,66605,'de','Legende von Rock und Roll','Erjage alle Zielmonster.','Die Monster in der Heimat der Ältesten scheinen einander bekämpfen zu wollen, was ein grosser Segen für unsere Forschung sein könnte. Wir müssen diese Chance nutzen!'),(843,65604,'en','Wiggle Me This','Deliver 10 Wigglers','Wha--hey, don\'t throw that net on me, I\'m not a Wiggler! Fooled you, eh? If you want something like what I\'m wearing, then you\'ll have to help me with my research!'),(844,66605,'en','Rock N\' Roll Recess','Hunt all target monsters','The monsters roaming the Elder\'s Recess seem intent on facing off with each other. This could be a huge boon for our research. Hunters, don\'t let this opportunity pass us by!'),(845,65605,'de','Dreifache Bedrohung','Erjage alle Zielmonster.','Das ist eine Quest, die ich vorbereitet habe... Nur für dich! Du wirst nicht glauben, wie viele Dekorationen du bekommst, wenn du diese Quest abschliesst!'),(846,66606,'de','So starten Aufstände','Erjage alle Zielmonster.','Das ist so absurd! Warum kann ich nicht in Ruhe und Frieden Königliche Kakteen sammeln? Das ist jenseits von nervig, das ist ein Aufstand, sag ich dir! Geh raus und sieh selbst!'),(847,65605,'en','Triple Threat Throwdown','Hunt all target monsters','This is a quest that I\'ve prepared...just for you. You won\'t believe how many decorations you\'ll get if you can complete this quest! Now, show me what you got!'),(848,51605,'de','Der rote Drachen','Töte einen Safi\'jiiva.','Der Safi\'jiiva, die erwachsene Version des Xeno\'jiiva... Berichte bestätigen, dass er Energie aus der Umgebung aufsaugt, um sich zu heilen. Wir müssen diese Bedrohung beseitigen!'),(849,51605,'en','The Red Dragon','Slay Safi\'jiiva','Safi\'jiiva, the mature form of Xeno\'jiiva... Reports confirm that it\'s siphoning energy from its surroundings to heal its wounds. We need to eliminate this threat before it\'s too late!'),(850,51606,'de','Meine Wut trifft alle','Töte einen Wütigen Brachydios.','Ein Wütiger Brachydios wurde in der Raureif-Weite gesichtet. Nicht viele Jäger haben sich einem gestellt und sind ohne den Verlust von Körperteilen zurückgekommen. Wird es dir gelingen?'),(851,66606,'en','This is How Revolts Start','Hunt all target monsters','This is preposterous! Why can\'t I gather Kingly Cactus in peace!? This is beyond annoying, it\'s an uprising I tell you! Go out there and see for yourself'),(852,51606,'en','...And My Rage for All','Slay a Raging Brachydios','A Raging Brachydios has been spotted in the Guiding Lands. Not many hunters have faced one and come back in one piece. Think you can join their ranks?'),(853,66607,'de','Schnee und Kirschblüten','Erjage alle Zielmonster.','Während meiner Untersuchung des Korallenhochlandes bin ich auf ein paar wahrhaft schreckliche Monster getroffen. (Bei Abschluss winken Bonus-JR-Punkte!)'),(854,66607,'en','Snow & Cherry Blossoms','Hunt all target monsters','Hey, I came across a couple of truly terrifying monsters in the Coral Highlands. Thought you might be interested! (Bonus HR points rewarded upon completion.)'),(855,65606,'de','Eine einfache Aufgabe','Liefere zehn Gourmet-Pilzhüte.','Als ich da draussen Proben gesammelt habe, sind mir seltene Spuren aufgefallen. Ich brauche einen Jäger, der mir die restlichen Proben besorgt sowie die Spuren untersucht.'),(856,66608,'de','Eine Nase für ein Auge','Erjage alle Zielmonster.','Zu meiner Zeit haben wir keine Spähkäfer gebraucht, um Monster zu finden, aber in der Neuen Welt... Ich habe ich ein paar Monster lokalisiert. Finde sie! (Bei Abschluss winken Bonus-JR-Punkte!)'),(857,65606,'en','A Simple Task','Deliver 10 Gourmet Shroomcap','While gathering samples out in the field, I noticed a number of rare tracks. I need a capable hunter to investigate these tracks, plus gather the rest of my samples!'),(858,66608,'en','A Nose for an Eye','Hunt all target monsters','In my day, we didn\'t need these Scoutflies to track down monsters, but this is the New World... I\'ve located some interesting monsters for you. Go get them. (Bonus HR points rewarded upon completion.)'),(859,66815,'en','We Three Kings','Slay all target monsters','Thunder. Wind. Fire. Nature\'s wonders in their purest form. So, we fight purity with purity. Pick your weapon, hunter. And fight. (Bonus HR/MR points rewarded upon completion.)'),(860,65607,'de','Überwachung der Lieferung','Liefere zehn Blaue Beryll.','Als ich da draussen Proben gesammelt habe, sind mir seltene Spuren aufgefallen. Ich brauche einen Jäger, der mir die restlichen Proben besorgt sowie die Spuren untersucht.'),(861,66609,'de','Kein Morgen für Eindringlinge','Erjage den Bazelgeuse.','Unsere Jungs haben dieses grosse, hässliche, fliegende Ding in der Heimat der Ältesten gesichtet! Pack dein Zeug, du musst da schnellstmöglich raus! (Bei Abschluss winken Bonus-JR-Punkte!)'),(862,66609,'en','No Tomorrow for Usurpers','Hunt Bazelgeuse','Our guys spotted that big, ugly flying nuisance in the Elder\'s Recess! Get your gear, we need you out here ASAP! (Bonus HR points rewarded upon completion.)'),(863,66816,'de','Abgeklärte Kälte','Töte alle Zielmonster.','Diese Kälte erinnert mich an die Hinterlande, aber sie trieft mit einem gruseligen, abgeklärten Geruch. Das muss näher untersucht werden, nicht? Los, los, spurte dich... (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(864,65607,'en','Tracking the Delivery','Deliver 10 Blue Beryl','While gathering samples out in the field, I noticed a number of rare tracks. I\'ll need a capable hunter to get the remainder of my samples, plus gather these tracks!'),(865,66610,'de','Der Throninteressent','Töte alle Zielmonster.','Ich habe endlich die Erlaubnis der Botanischen Forschung und lege mit drei Partnern los, als wir auf einen Teostra, eine Lunastra UND einen Nergigante treffen. Ich brauch \'ne Pause!'),(866,66816,'en','The Winter Blues','Slay all target monsters','This cold reminds me of the Hinterlands, but it drips with an eerie, tranquil smell. This must be looked into, yes? Run along now... (Bonus HR/MR points rewarded upon completion.)'),(867,66101,'de','Fingerübung','Erjage zwei Gross-Jagras.','Hey, ich habe eine Quest für dich. Aber keine Sorge, die ist genau dein Ding. Zwei Gross-Jagras nerven rum, die müssen weg! Vertrau mir, die Belohnung ist es wert.'),(868,66610,'en','The Thronetaker','Slay all target monsters','I finally got permission from Botanical Research to go out in the field. My partners and I stumbled upon a Teostra, Lunastra AND Nergigante! My luck freakin\' sucks! I need a nap...'),(869,66817,'de','Der Grund des Hungers','Erjage einen Wilden Dämonjho.','Vielleicht jagt diese Art von Dämonjho ständig, weil er die Fähigkeit verloren hat, satt zu werden? Ich kann das ganz gut nachempfinden. Ich bin auch ständig hungrig... Hungrig nach Wissen!  (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(870,66801,'de','Trophäenangeln','Erjage alle Zielmonster.','Essen kann man sie wohl nicht und der Alte wär auch nicht erfreut, wenn ich ihm einen auf den Essenstisch platsche. Aber zwei von denen am Wickel haben: klingt nach Spass! (Bei Abschluss winken erhöhte JR/MR-Punkte und besondere Materialien als Belohnung.)'),(871,66101,'en','Chew The Fat','Hunt 2 Great Jagras','Yo, got a quest for you, but don\'t worry, this is right up your alley. We got a couple of Great Jagras that need to be taken care of. Trust me, the rewards will be worth it.'),(872,66817,'en','A Reason Behind The Hunger','Hunt a Savage Deviljho','Perhaps the reason why this type of Deviljho is constantly hunting is that it\'s lost its ability to feel full? Perhaps I can empathize with its plight. I too, crave... My hunger for knowledge is insatiable! (Bonus HR/MR points rewarded upon completion.)'),(873,66801,'en','Trophy Fishin\'','Hunt all target monsters','Don\'t think you can eat \'em and I know gramps would be reel upset if I plopped one down in front of him for supper. But sounds like mighty good fun tangoin\' with two tundra trouts! (Increased HR/MR points and special material rewards upon completion.)'),(874,67606,'en','A Visitor from Eorzea (Extreme)','Slay a Behemoth','Another Behemoth has appeared in the Elder\'s Recess and is even more dangerous than the last! Summon other adventurers and quell the beast! <STYL MOJI_RED_DEFAULT>(Extremely difficult! Rewards: Drachen layered armor and guild card title)'),(875,66802,'de','Der Herr des Erdreichs winkt','Liefere 20 Erdfrüchte.','Diese Dinger – wie Felvine, sag ich dir! Ich kann gar nicht genug davon bekommen! Wenn du mia noch mehr davon beschaffst, hast du miaunen grössten Dank! Ich belohn dich auch mit vielen Knochen-Miauterialien! (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(876,66102,'de','Acht Leben zu wenig','Erjage alle Zielmonster.','Diese beiden Miaunster sind schnurrtastische Eierdiebe und holen Flugdrachen wie Fliegen aus der Luft. Rauhe Rohlinge sind oft auch gutes Rohmaterial!'),(877,66802,'en','The Lord of the Underworld Beckons','Deliver 20 Underground Fruit','Those things—like felvine, I tell ya! I just can\'t get enough! If you can go meow-t and get your paws on some more, I\'d really a-purr-eciate it! I\'ll even reward you with lots of bone materials fur your troubles! (Bonus HR/MR points rewarded upon completion.)'),(878,67607,'de','Das Herz der Nora','Erjage 2 Dämonjho.','Nein... Mutterherz! Die Überlebenden, die sich im Berg verstecken, werden begraben, wenn du diese Monster nicht erledigst! Beende die Bedrohung und erhalte Spezialausrüstung!'),(879,66102,'en','Ya-Ku With That?','Hunt all target monsters','Hunter, these two meownsters are su-purr good at stealing eggs and dropping wingdrakes in a flash. But purrhaps they\'ll make for good equipment too, mew get me?'),(880,66803,'de','Schlammschleudern','Erjage alle Zielmonster.','Einige Banbaros haben sich an die Wildturm-Ödnis angepasst und greifen Jäger mir Schlammhaufen an! Seid vorsichtig da draussen! (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(881,66103,'de','Durch bis zum Knochen','Erjage alle Zielmonster.','Lass mich das klarstellen: Du gehst also in die Arena und gerätst direkt zwischen Fido und sein Kauspielzeug? Da hat wohl jemand einen Todeswunsch...'),(882,67607,'en','The Heart of the Nora','Hunt 2 Deviljho','No...Mother\'s Heart! The survivors hiding inside the mountain will be buried if you don\'t take down those monsters. Overcome this threat and I will provide you with special equipment!'),(883,66818,'de','Mondlicht-Geheul','Erjage einen Zinogre.','Ich habe einen Zinogre im Korallenhochland gesehen! Das ist die perfekte Gelegenheit für eine Studie über Fulgurkäfer in der neuen Welt! Ich werde nicht ruhen, bis ich... bis du mir ein paar Exemplare gebracht hast! (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(884,66803,'en','A Bunch of Sticks in the Mud','Hunt all target monsters','Some roaming Banbaro have adapted to the Wildspire and are using mounds of mud to attack hunters! Careful out there, everyone! (Bonus HR/MR points rewarded upon completion.)'),(885,66103,'en','Flesh Cleaved to Bone','Hunt all target monsters','So...let me get this straight, you\'re going to step into the arena and get between Fido and its chew toy? Teaching it to play dead, are we?'),(886,67608,'de','Leise, tödlich und wild','Erjage alle Zielmonster.','Ein seltsamer Kerl in einer weissen Robe kam auf mein Schiff, wollte in die Neue Welt. Er gab mir ein einzigartiges Geschenk als Vergütung. Damit kannst du bestimmt was Nettes herstellen! Es gehört dir, wenn du diese Quest für mich abschliesst!'),(887,66804,'de','Dünendelikatesse','Liefere 20 Hartfrüchte.','Ich habe von einer Delikatesse namens Hartfrucht erfahren, die ein entzückender Snack sein soll. Es erfordert etwas Beinarbeit, aber wenn du welche für mich mitbringst, belohn ich dich mit einer Menge Erz! (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(888,67608,'en','SDF: Silent, Deadly, and Fierce','Hunt all target monsters','Had an interestin\' fella in a white robe board me ship, looking for passage to the New World. Gave me quite a unique gift as a fee. I bet you can craft something real nice with it. If you can take care of this quest for me, it\'s all yours!'),(889,66804,'en','Desert Desserts','Deliver 20 Hardfruit','Ah, Hunter! I\'ve caught wind of a delicacy called a Hardfruit, which makes for a delightful snack. It\'s a bit of a trek, but bring some back for me and I\'ll reward you with lots of ore! (Bonus HR/MR points rewarded upon completion.)'),(890,67610,'de','Auftrag: Geist des Waldes','Töte den Uralten Waldschrat.','Im Uralten Wald ist ein Portal erschienen, durch das eine seltsame Kreatur, als Geist des Waldes bekannt, gekommen ist. <STYL MOJI_RED_DEFAULT>Quest-Stufe ähnlich Todesmarsch-Schwierigkeit in The Witcher 3.'),(891,66805,'de','Ein zweiter Störenfried','Erjage alle Zielmonster.','... und weisst du, was faszinierend wäre? Einen Anjanath und einen Banbaro zur selben Zeit jagen! Ich würde gewiss mehr JR/MR-Punkte vergeben, wenn jemand diese Herausforderung annimmt! Ja, kannst du dir das vorstellen? Gegen diese Bestien anzutreten...'),(892,66805,'en','A New Troublemaker in Town','Hunt all target monsters','—and you know what would be fascinating? Hunting an Anjanath AND a Banbaro at the same time! I would certainly dole out more HR/MR points to any hunter who\'d take up that challenge! Yes, can you imagine it, Hunter? Going at it with those two brutes—'),(893,66806,'de','Farbenfroher Fasching','Erjage alle Zielmonster.','Ja, packen wir es an! Ich hab eine Aufgabe von den Gelehrten erhalten. Ich soll ein paar Dingsbums-Beutel einsammeln. Ich sammle einfach alle auf einmal! (Erhöhte JR/MR-Punkte bei Abschluss)'),(894,66806,'en','Colorful Carnival','Hunt all target monsters','Yeah, time to get it done! I got an assignment from the scholars to pick up a couple of whatcha-ma-call-sacs. I\'m gonna do it all in one go! (Increased HR/MR points upon completion.)'),(895,66807,'de','Jäger-Tollpatsch','Erjage alle Zielmonster.','Wir sollten eigentlich etwas für die Analytik besorgen, aber mein Partner hat Mist gebaut und ist auf eine andere Quest gegangen! Kannst du das hier erledigen, während ich ihn zurückhole? Mensch, dieser Idiot... (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(896,66818,'en','Moonlit Howl','Hunt a Zinogre','I saw a Zinogre in the Coral Highlands! This is it—the perfect opportunity for a study case on Fulgurbugs in the New World! I won\'t rest until I—until YOU get me some specimens! (Bonus HR/MR points rewarded upon completion.)'),(897,66819,'de','Ruhig und gelassen','Erjage einen Yian Garuga.','Einer meiner felligsten Freunde hat mir über dieses Miaunster gemaunzt, die Defiechnition von \"ruhig\"! Muss ich selbst sehen! Würden Ohrstöpsel helfen? Felleicht... (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(898,66819,'en','I Am Tranquil, I Am Sound','Hunt a Yian Garuga','My purr-ank-loving furr-iend told me about this meownster that\'s the definition of \"calm\"! I gotta see it for myself! Maybe I should take some earplugs...? Nah, I\'ll be fine! (Bonus HR/MR points rewarded upon completion.)'),(899,66820,'de','Ein berstendes Brüllen','Erjage einen Brachial-Tigrex.','Sobald wir das Gebrüll in der Entfernung gehört haben, haben der Jäger und ich uns zurückgezogen. Gut! Hätten wir das Gebrüll aus der Nähe gehört, wären wir wohl Wyvernhappen geworden! (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(900,66820,'en','A Roar that Splinters the Sky','Hunt a Brute Tigrex','As soon as we heard that roar in the distance, the hunter I was with sounded the retreat. Good thing, too—had we heard that roar up close, well, I\'m sure I would have been its dinner! (Bonus HR/MR points rewarded upon completion.)'),(901,66807,'en','Hunter-Blunderer','Hunt all target monsters','We were supposed to go out to get some stuff for Analytics, but my partner goofed and went on a different quest! Can you take care of this while I fetch him? Geez...this bozo. (Bonus HR/MR points rewarded upon completion.)'),(902,66821,'de','Ein silbernes Aufblitzen','Erjage einen Silbernen Rathalos.','Zuerst dachte ich an eine Lichtreflexion auf Felsen in der Heimat der Ältesten, aber dann wusste ich, dass ER es war. Ich bin ja so froh, in die Neue Welt gekommen zu sein! (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(903,66821,'en','A Glance of Silver','Hunt a Silver Rathalos','At first I thought it was just some light glancing off the rocks in the Elder\'s Recess, but it was HIM. I never thought I\'d live to see this day! It makes me glad I came to the New World. (Bonus HR/MR points rewarded upon completion.)'),(904,66808,'de','Flammender Himmel, feuriges Meer','Erjage alle Zielmonster.','Sie sind überall! Ich kann die tückischen Feuerschwingen über mir hören, den schwelenden Blick aus der Lava spüren! Hilfe! (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(905,67610,'en','Contract: Woodland Spirit','Slay the Ancient Leshen','A portal appeared in the Ancient Forest, and a strange creature came through it. The beast is called a woodland spirit and it\'s extremely dangerous. <STYL MOJI_RED_DEFAULT>Quest level close to Death March! difficulty in The Witcher 3.'),(906,66822,'de','Der Mond ist eine herbe Königin','Erjage eine Goldene Rathian.','Die goldene Kaiserin wurde gesichtet. Jemand von der Fünften muss losziehen und sich um sie kümmern – bevor es zu spät ist! (Bei Abschluss winken erhöhte JR/MR-Punkte als Belohnung.)'),(907,66808,'en','A Sky & Sea of Fire','Hunt all target monsters','They\'re everywhere! I can hear the treacherous wings of fire above me, and I can feel the smoldering glare coming from that lava! Help! (Bonus HR/MR points rewarded upon completion.)'),(908,67801,'de','RE: Rückkehr der Biowaffe','Töte einen Velum-Vaal-Hazak.','Wir haben einen seltsamen Zustand entdeckt, gegen den auch der Miasma-Widerstand nichts ausrichten kann! Worum kann es sich dabei nur handeln? Hilf uns für eine grosszügige Belohnung! (Bei Abschluss winken besondere Materialien als Belohnung.)'),(909,66822,'en','The Moon is a Harsh Queen','Hunt a Gold Rathian','The golden empress has been spotted. We need the Fifth to prepare and head out. Take care, or the empress may turn the tables on you before you know it. (Bonus HR/MR points rewarded upon completion.)'),(910,66809,'de','Sonderbares Experiment','Erjage alle Zielmonster.','Hey, was glaubst du passiert, wenn eine Diablos auf einen aufgeblasenen Paolumu zustürmt? Ich hab schon viel zu lange drüber nachgedacht und kann nicht schlafen. Kannst du es für mich rausfinden? (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(911,67801,'en','RE: Return of the Bioweapon','Slay a Blackveil Vaal Hazak','We\'ve discovered a strange condition which is horrifyingly unaffected by <STYL MOJI_RED_DEFAULT>effluvial resistance! If it\'s not effluvial buildup, then what is it? Help us, Hunter, and you\'ll be generously compensated! (Special material rewards)'),(912,66824,'de','Verwirrt, erschöpft, geblendet','Erjage einen Rajang.','Der Admiral und einige Fünfer haben absoluten Unsinn geredet, bevor sie aufgebrochen sind, um einen Rajang zu jagen. Hm... Die Forschungskommission hat schon ein paar seltsame Jäger! (Bei Abschluss winken besondere Materialien als Belohnung.)'),(913,66809,'en','A Curious Experiment','Hunt all target monsters','Hey, what do you think would happen if a Diablos charged at an inflated Paolumu? I\'ve been thinking about this for way too long and now I can\'t sleep. Do you think you can find out for me? (Bonus HR/MR points rewarded upon completion.)'),(914,66824,'en','Razzled, Frazzled, and Dazzled','Hunt a Rajang','The Admiral and some Fivers were talking some absolutely nonsense when they went off on a quest to hunt a Rajang. The Research Commission sure has a lot of hairballed hunters, huh? (Bonus HR/MR points rewarded upon completion.)'),(915,67802,'de',NULL,NULL,NULL),(916,66825,'de','Wunden sagen alles...','Erjage einen Wundmal-Yian-Garuga.','Wir Jäger haben zu unserer Zeit schon verrücktes Zeug gesehen, aber nichts reicht an den personifizierten Wahnsinn des lila Huhns ran! Jetzt bloss nicht die Ruhe verlieren! (Bei Abschluss winken besondere Materialien als Belohnung.)'),(917,66810,'de','Sehnsucht nach Wasser','Erjage alle Zielmonster.','Ich habe mich so nach einer Jagd an einem Ort gesehnt, der nicht so verdammt kalt ist, und jetzt ruinieren mir diese Nervensägen den Tag! (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(918,67802,'en','Dawn\'s Triumph','Slay an Alatreon','The burning Alatreon has once again been spotted. To make matters worse, news has spread of cataclysmic natural disasters occurring in the Old World. The timing of these events is curious to say the least. They merit further investigation but Alatreon comes first.'),(919,66825,'en','Scars Tell the Whole Story','Hunt a Scarred Yian Garuga','Us hunters have seen a lot of crazy stuff in our day, but nothing comes close to personifying crazy as that big purple chicken does! Don\'t lose your cool now. (Bonus HR/MR points rewarded upon completion.)'),(920,66810,'en','Soaked and Shivering','Hunt all target monsters','I was SO looking forward to going out on a hunt in a place that\'s not cold, but it IS cold. FREEZING COLD! And it\'s wet too! That\'s it! I am SO done. I\'m going home... (Bonus HR/MR points rewarded upon completion.)'),(921,66826,'de','Walzer im Wald','Erjage alle Zielmonster.','Der Uralte Wald ist ein lebendes Labyrinth, deshalb sind kämpfende Monster ein seltener Anblick. Das könnte unsere Forschung beeinflussen, also geh da raus und sorge für Ruhe!'),(922,67803,'de',NULL,NULL,NULL),(923,66811,'de','Angefeuerte Bestien','Erjage alle Zielmonster.','... einen Glavenus und einen Uragaan gleichzeitig jagen, ja! Das wäre ja traumhaft! Ich würde ganz sicherlich zusätzliche JR/MR-Punkte an denjenigen vergeben, der...'),(924,66826,'en','Yodeling in the Forest','Hunt all target monsters','The Ancient Forest is a living maze, so it\'s not every day we see this many monsters duking it out. This could be a huge boon to our research, so suit up and head out!'),(925,66811,'en','Fired-Up Bruisers','Hunt all target monsters','—to hunt a Glavenus AND an Uragaan simultaneously, yes! That\'s the stuff dreams are made of! I\'d most certainly dole out extra HR/MR points upon completion to the hunters who—'),(926,67803,'en','The Black Dragon','Slay Fatalis','It is time for us to confront Fatalis. We, along with every nation and organization known, shall rid this world of this fabled scourge. When you\'re ready, we\'ll set sail.'),(927,66827,'de','Ödnis-Ouvertüre','Erjage alle Zielmonster.','Die Wildturm-Ödnis ist ein riesiges Gebiet, deshalb sehen wir es nicht oft, dass sich Monster bekämpfen. Das könnte unsere Forschung beeinflussen, also geh da raus und sorge für Ruhe!'),(928,66827,'en','Heavy Metal in the Waste','Hunt all target monsters','The Wildspire is a vast stretch of land, so it\'s not every day we see this many monsters duking it out. This could be a huge boon to our research, so suit up and head out!'),(929,66812,'de','Wüste Jagd','Erjage alle Zielmonster.','Späher haben ein Paar gefährlicher Monster entdeckt, die durch die Wildturm-Ödnis rasen. Reise dorthin und kümmere dich um beide Gefahren! Und komm nicht zu spät! (Erhöhte JR/MR-Punkte bei Abschluss)'),(930,67804,'de',NULL,NULL,NULL),(931,66828,'de','Korallen-Symphonie','Erjage alle Zielmonster.','Das Korallenhochland ist für gewöhnlich recht friedlich, aber heute geht es dort richtig rund. Das könnte unsere Forschung beeinflussen, also geh da raus und sorge für Ruhe!'),(932,66812,'en','The Desert Dash','Hunt all target monsters','Scouts have spotted a couple of highly dangerous monsters speeding across the Wildspire. Head to the locale and take care of both threats! And don\'t be late! (Increased HR/MR points upon completion)'),(933,67804,'en','Mighty Muscle Monkey Madness','Hunt 2 Furious Rajang','Yeah, hunters are something else. \"This won\'t do... I\'m not satisfied\", they said with a fire in their eye. Their passion for muscles easily surpasses my inspiration! (Special material rewards)'),(934,66828,'en','Symphony of the Coral','Hunt all target monsters','The Coral Highlands is relatively peaceful, so it\'s not every day we see this many monsters duking it out. This could be a huge boon to our research, so suit up and head out!'),(935,66813,'de','Tief im Wald','Erjage alle Zielmonster.','Man sagt Anjanaths seien für den Wald gemacht. Sie durchstreifen ihn wie Könige. Aber jetzt ist ein Azurner Rathalos aufgetaucht. Das sollte uns einen echten Kampf bescheren! (Erhöhte JR/MR-Punkte bei Abschluss)'),(936,67805,'de',NULL,NULL,NULL),(937,66829,'de','Kanzone der Verwesung','Erjage alle Zielmonster.','Die Monster im Tal der Verwesung waren schon immer rauflustig, aber heute ist es besonders schlimm. Das könnte unsere Forschung beeinflussen, also geh da raus und sorge für Ruhe!'),(938,66813,'en','In the Depths of the Forest','Hunt all target monsters','They say that Anjanaths are built for the forest. They roam it like kings, but now that an Azure Rathalos has showed up, we got a real fight on our hands! (Increased HR/MR points upon completion.)'),(939,67805,'en','Don\'t Forget The Earplugs!','Hunt a Yian Garuga','An awfully big Shepherd Hare is inside the arena. Looks a bit different from the usual variety, but no mistaking it\'s a Shepherd Hare with those ears! You wanna take a look and get some INSPIRATION too!? (Special material rewards)'),(940,66829,'en','Rotten Canzone','Hunt all target monsters','The monsters in the Rotten Vale are usually combative, but today they\'re especially irritated. This could be a huge boon to our research, so suit up and head out!'),(941,66814,'de','Diener des Tals','Erjage alle Zielmonster.','Zwei Monster haben Anspruch auf das Tal der Verwesung erhoben. Aber egal wer gewinnt, die Kommission verliert. Wir brauchen jemanden wie dich, der da reingeht und sie beide rauswirft! (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(942,66830,'de','Ältesten-Arabeske','Erjage alle Zielmonster.','Die Monster in der Heimat der Ältesten waren schon immer wild, aber heute sind sie ausser Kontrolle. Das könnte unsere Forschung beeinflussen, also geh da raus und sorge für Ruhe!'),(943,66814,'en','Servants of the Vale','Hunt all target monsters','Two monsters have staked claim to the Rotten Vale, Hunter. But no matter who wins, the Commission loses. We need someone like you to get in there and drive both of them out! (Bonus HR/MR points rewarded upon completion.)'),(944,67806,'de',NULL,NULL,NULL),(945,66830,'en','Alt Rock Recess','Hunt all target monsters','The monsters in the Elder\'s Recess are used to hanging tough, but today they\'re especially irritated. This could be a huge boon to our research, so suit up and head out!'),(946,66815,'de','Drei Könige','Töte alle Zielmonster.','Donner. Wind. Feuer. Naturwunder in ihrer reinsten Form. Wir bekämpfen Reinheit mit Reinheit. Wähle deine Waffe, Jäger. Und kämpfe. (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(947,67806,'en','Monkey Business','Hunt a Furious Rajang','I just spotted a gigantic Goldspring Macaque! No, seriously! The way it roars into the sky and that electric golden fur, there\'s no mistaking it! It\'s going to be my source of INSPIRATION! (Special material rewards)'),(948,66831,'de','Raureif-Rhapsodie','Erjage alle Zielmonster.','Die Monster in der Weite bleiben normalerweise für sich, aber heute gehen sie einander an die Kehlen. Das könnte unsere Forschung beeinflussen, also geh da raus und sorge für Ruhe!'),(949,66831,'en','Ballad of the Hoarfrost','Hunt all target monsters','The monsters of the Reach tend to keep to themselves, but today they\'re at each other\'s throats! This could be a huge boon to our research, so suit up and head out!'),(950,67807,'de',NULL,NULL,NULL),(951,66832,'de','Hölle, Hölle, Hölle!','Erjage einen Höllen-Zinogre.','Entschuldige. Ich habe jahrelang Monster erforscht, alles für die Kommission gegeben. Aber der hat mich in den Wahnsinn getrieben. Kannst du ihn übernehmen? Meiner Gesundheit zuliebe... (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(952,66832,'en','Wolf Out of Hell','Hunt a Stygian Zinogre','My apologies. I spent years researching monsters, giving everything to the Commission. But I lost everything to THIS one. I need you to step in, for I fear I won\'t be able to keep my cool. (Bonus HR/MR points rewarded upon completion.)'),(953,67807,'en','The Naked Truth','Slay a Shara Ishvalda','I\'ve suddenly reached enlightenment. I now know the truth! All life cannot attain their true potential unless they take the same form as when they came into this world. And that means...INSPIRATION! (Special material rewards)'),(954,66833,'de','Der ewige Goldrausch','Töte die Kulve Taroth.','Die Muttergöttin ist wieder erschienen! Diesmal ist es unsere Aufgabe, sie zu töten. Die Quest gibt es von der Wildexpertin, einem Quest-Schalter oder einer Quest-Tafel. Schlage dich tapfer und kehre gesund wieder zurück!'),(955,67808,'de',NULL,NULL,NULL),(956,66833,'en','The Eternal Gold Rush','Slay Kulve Taroth','The mother goddess has reappeared. This time, our objective is to slay her. Get the quest from your handler or the quest board. Stand tall against her fury and return safely!'),(957,67808,'en','Tears from Nirvana','Slay a Blackveil Vaal Hazak','When people travel to the other side, there are places full of fear and sadness that you must bear alone. You\'ll know that same feeling if you face a Blackveil Vaal Hazak. (Special material rewards)'),(958,66834,'de','Promptes Brüllen','Erjage alle Zielmonster.','In dieser Quest wird es heiss und angespannt! Aber keine Sorge, du riskierst deine Haut nicht für nichts – überstehst du den Einsatz, winken reiche Belohnungen. (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(959,67809,'de',NULL,NULL,NULL),(960,66834,'en','When the Swift Meets the Roar','Hunt all target monsters','Expect things to get hot and tense in this quest! But don\'t worry, you\'ll get your fill of decorations if you come out of this in one piece! (Bonus HR/MR points rewarded upon completion.)'),(961,67809,'en','A Farewell to Zinogre','Hunt a Zinogre','The most hunted monster ever, how wonderful! Let me throw you hunters a curveball and offer a slightly different Zinogre! Those shiny things on the ground may look tempting, but be careful not to get a paw to the face!'),(962,66835,'de','Der Zorn des Donners blitzt auf','Erjage einen Zinogre.','Blitze schlagen nicht zweimal an der gleichen Stelle ein? Und wenn doch? Aber keine Sorge, du riskierst deine Haut nicht für nichts – überstehst du den Einsatz, winken reiche Belohnungen. (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(963,67810,'de',NULL,NULL,NULL),(964,66835,'en','The Wrath of Thunder Descends','Hunt a Zinogre','They say lightning never strikes the same place twice, but I wouldn\'t take my chances here! Get through this in one piece and you\'ll get your fill of decorations! (Bonus HR/MR points rewarded upon completion.)'),(965,67810,'en','Brand New Brute','Hunt a Brute Tigrex','Whoa, no wonder this Brute Tigrex\'s so clean, it\'s the least hunted monster! Is it crying tears of joy? Wait, those tears look a lot like armor spheres...hmm. Odd. (You cannot obtain monster materials from this quest)'),(966,66836,'de','Ode an die Zerstörung','Töte einen Ruinen-Nergigante.','Späher haben einen ungewöhnlich angriffslustigen Ruinen-Nergigante gesichtet. Du musst ihn näher untersuchen. Erwarte ein paar Grosse Geistader-Edelsteine als Belohnung! (Bei Abschluss winken Bonus-JR/MR-Punkte!)'),(967,67811,'de',NULL,NULL,NULL),(968,67811,'en','Mew are Number One!','Hunt a Furious Rajang','Meow, child, we all know that you are the Commission\'s number one hunter. The only thing you\'re missing is a golden trophy, so I\'ve gone and fixed up a quest for you to go out and get one. I even threw in a few goodies too. Be back in time fur dinner, meow!'),(969,66836,'en','Ode to the Destruction','Slay a Ruiner Nergigante','Scouts have sighted an unusually fierce Ruiner Nergigante out in the field. We need you to investigate. Expect some Great Spiritvein Gems as a reward for your trouble. (Bonus HR/MR points rewarded upon completion.)'),(970,67812,'de',NULL,NULL,NULL),(971,67101,'de','Die Erprobung','Erjage einen Anjanath.','Wir haben so lange auf diesen Tag gewartet. Deine Zeit ist gekommen, an der Erprobung teilzunehmen und ein echter Krieger zu werden. Opfere deine Trophäe der All-Mutter!'),(972,67812,'en','The Evening Star','Slay an Alatreon','Alatreon has been sighted in the Secluded Valley. It seethes, like a burning star that revels in the darkness. But it\'s time for the Commission to let the world know of this blazing black abomination!'),(973,67101,'en','The Proving','Hunt an Anjanath','We\'ve waited so long for this day. It\'s time for you to participate in the Proving and become a true brave. Offer your trophy to the All-Mother, and you shall be blessed generously.'),(974,67813,'de',NULL,NULL,NULL),(975,67813,'en','Dawn of the Death Star','Slay an Alatreon','Alatreon has been sighted in the Secluded Valley. It screams, like an icy dead star that rejects the light. But it\'s time for the Commission to let the world know of this blazing black abomination!'),(976,67102,'de','Lektionen der Wildnis','Töte acht Barnos.','Flugdrachen wirken im Vergleich zu grösseren Monstern ein wenig zerbrechlich, können aber dennoch Jäger töten. Keule einige von ihnen, dann winkt dir Palico-Ausrüstung.'),(977,67814,'de',NULL,NULL,NULL),(978,67102,'en','Lessons of the Wild','Slay 8 Barnos','It\'s time for some special training. Wingdrakes are feeble things compared to larger monsters, but even they can take down a hunter. Cull their numbers and we\'ll prep some new Palico gear.'),(979,67814,'en','In the Tempest\'s Wake','Slay a Kushala Daora','When I was a young girl, a Kushala Daora passed by our village. We hid in our homes, afraid of what tragedy it might leave in its wake. And now it\'s here... May this Sealed Feystone be incentive enough for you to put a stop to this tempest.'),(980,67103,'de','Rushs Blutrausch','Erjage zwei Odogaron.','Oh nein! Da ist ein ziemlich fieses Monster, das wie unser Rush aussieht! Jemand muss den grossen Jungen beruhigen! Hilf uns, dann bekommt dein Palico Spezialausrüstung.'),(981,67815,'de',NULL,NULL,NULL),(982,67103,'en','A Rush of Blood','Hunt 2 Odogaron','Oh no! There\'s this big ol\' monster that looks a lot like our Rush! Someone\'s gotta calm the big boy down! Help us out, and we\'ll give you some special gear for your Palico!'),(983,67815,'en','Day of Ruin','Slay a Teostra','A blazing sun in a sunless land—I guess every life burns as brightly as it can, no matter where it finds itself. Just like we did those forty years ago... Anyway, I\'ve prepared a Sealed Feystone for after you\'ve laid this sun to rest.'),(984,67105,'de','USJ: Besondere Behandlung','Erjage drei Gross-Jagras.','USJ ist stolz auf die aufregendste Attraktion aller Zeiten! Bestaune diese grossartige Welt in all ihrer goldenen Glorie! Als Belohnung winkt am Ende fantastische Ausrüstung!'),(985,67816,'de',NULL,NULL,NULL),(986,67105,'en','USJ: Gold Star Treatment','Hunt 3 Great Jagras','USJ is pleased to bring you the most exciting attraction ever! Witness this grand world in all of its golden glory! You\'ll be presented with some fantastic equipment once you\'re done!'),(987,67816,'en','The Cold Never Bothered Me','Slay a Lunastra','We\'ve driven the \"Blue Flame\" into the cold prison of the supply cache, but now it seems to burn brighter than ever in its defiance. Extinguish it before it burns us all, and I\'ll reward your efforts with a Sealed Feystone.'),(988,67603,'de','USJ Lodernde Azursterne!','Erjage alle Zielmonster.','USJ präsentiert die EXPLOSIVSTE Show aller Zeiten! Die blauen Zwillingssterne tanzen, wie man es nie zuvor gesehen hat! Schliesse unsere Herausforderung ab und gewinne eine fantastische Rüstung!'),(989,67817,'de',NULL,NULL,NULL),(990,67603,'en','USJ Blazing Azure Stars!','Hunt all target monsters','USJ is pleased to present the most EXPLOSIVE show ever! Our twin blue stars will show you a dance like you\'ve never seen before! Complete our challenge, and earn some fantastic armor!'),(991,67817,'en','The Distant Dark Tide','Slay a Namielle','My mother used to lead a hunting party and told me once of a story where pleasant weather turned to violent storms, forcing the party back and spoiling a fine expedition. Perhaps the cause was Namielle. I hope your hunt divulges some answers...'),(992,67605,'de','Code: Rot','Erjage alle Zielmonster.','Legenden zufolge gibt es in einem weit entfernten Land einen Dämonenjäger mit einem roten Mantel, der Dämonen stylish eliminiert. Wie wäre es, wenn wir dich auch zur Legende machen?'),(993,67818,'de',NULL,NULL,NULL),(994,67605,'en','Code: Red','Hunt all target monsters','Legends say in a far off land, a demon hunter in a red coat offed demons with a sickeningly sweet style. How about we make a legend out of you too? If you\'re interested, jump in.'),(995,67818,'en','The Last White Knight','Hunt a Frostfang Barioth','We\'ve finally found it! The tree top assassin that controls the frost. \"The Last White Knight\", they call it. Outmuscling it is out of the question. No, only the most devoted can topple this beast. I await your report, Hunter.'),(996,67606,'de','Ein Besucher aus Eorzea (extrem)','Töte den Behemoth.','Ein weiterer Behemoth ist aufgetaucht, stärker als der davor. Versammle andere Abenteurer um dich und gehe zur Heimat der Ältesten, um die Bestie aufzuhalten. <STYL MOJI_RED_DEFAULT>(Extrem schwierig!) (Belohnung: Drachenreiter-Dekorrüstung und Gildenkarten-Titel)'),(997,67819,'de',NULL,NULL,NULL),(998,67819,'en','The Place Where Winter Sleeps','Slay a Velkhana','As leader of this hunt, I\'ve been granted authority to add new recruits to our ranks. Our target is an incredibly ferocious Velkhana. Want a challenge? Then help us send it to its end!'),(999,67820,'de',NULL,NULL,NULL),(1000,67820,'en','Fade to Black','Slay Fatalis','We\'ve been tasked with slaying Fatalis, a monster known only in legends handed-down. This beast will test all of your limits, but I know you\'ll be ready.'),(1001,67821,'de',NULL,NULL,NULL),(1002,67821,'en','Old Dog, New Trick','Hunt a Frostfang Barioth','What a proud figure I must make, sitting here with my arms crossed. But perhaps I should learn the ways of the new generation, starting with the clutch claw? I heard a Gold Melding Ticket would be the prize, heh.'),(1003,67822,'de',NULL,NULL,NULL),(1004,67822,'en','A Fish to Whet Your Appetite','Deliver 2 Great Whetfish','Not only are those big boys sharp to a fault, if you can haul them here fresh as a daisy, they might be useful as a weapon too! So get on out there and snag some, will ya? (Special material rewards)'),(1005,67823,'de',NULL,NULL,NULL),(1006,67823,'en','Fetching Light Pearls','Deliver 8 Light Pearls','I saw those Kelbi eyes glow like a pearl in the dark! Then it struck me. Yes, INSPIRATION! To the message boards! (Special material rewards)'),(1007,67824,'de',NULL,NULL,NULL),(1008,67824,'en','To Our World','Slay a Rathalos','Why is that thing still alive? I thought we killed it! Does that mean I\'m in the...? At any rate, I need to find a way back to my world. In this quest, you will get to play as Artemis.'),(1009,67825,'de',NULL,NULL,NULL),(1010,67825,'en','The New World','Head to Area 8','Looks like I\'m back in this world again, but where are those two? Guess I better look for them... In this quest, you will get to play as Artemis.'),(1011,67826,'de',NULL,NULL,NULL),(1012,67826,'en','Skyward Snipers','Deliver 5 Grandfather Mantagrells','You\'ve seen those big Grandfather Mantagrells being all floaty in the air, right? My notes say they\'re especially weak to sudden shocks. I bet if you use your slinger you can get one for me to play with—I mean study, of course! (Special material rewards)'),(1013,67827,'de',NULL,NULL,NULL),(1014,67827,'en','Camoflawed','Hunt a Rathian','The young miss I work with needs to research some critter in a Rath nest and almost went wearin\' an herbivore disguise. Good thing I stopped her before she got swooped up. Could you go hunt that Rathian so she can get her critter fix? (Special material rewards)'),(1015,67828,'de',NULL,NULL,NULL),(1016,67828,'en','Kadachi Twins','Hunt all target monsters','It\'s so freakin\' cold out here that I came up with a design for some warm armor based on a monster! It looks strong, yes, strong indeed! (Special material rewards)'),(1017,67829,'de',NULL,NULL,NULL),(1018,67829,'en','Seeing is Believing','Hunt a Tigrex','Yo, Scrawny. This hungover hunter came by sayin\' he\'s seein\' things in the Arena. He was so shook up about it that it\'s made him quit drinkin\'. Go check it out for him, will ya? (Special material rewards)'),(1019,67830,'de',NULL,NULL,NULL),(1020,67830,'en','The True Tyrant','Slay a Tigrex','We salute all hunters who have conquered the New World using everything at their disposal. Embark on this quest that will challenge you and may the Sapphire Star light your way!'),(1021,67831,'de',NULL,NULL,NULL),(1022,67831,'en','The Assassin','Hunt a Nargacuga','I dreamt of a man with the grace of an assassin...and ever since, I\'ve been going bonkers thinking about what I want to work on next. Ya gotta help me out here! (Upgrades the Assassin\'s Hood upon first completion.)'),(1023,67832,'de',NULL,NULL,NULL),(1024,67832,'en','USJ: Shine On Forever','Slay a Velkhana','Special delivery from USJ to you: the perfect stage for you to sparkle with a monster that truly shines! May the shine never end! (Special material rewards)'),(1025,67833,'de',NULL,NULL,NULL),(1026,67833,'en','The Conqueror of Hoarfrost','Slay all target monsters','We salute all hunters who have conquered the New World using everything at their disposal. Embark on this quest that will challenge you and may the Sapphire Star light your way!'),(1027,67834,'de',NULL,NULL,NULL),(1028,67834,'en','A Star That Will Never Dim','Slay a Namielle','We salute all hunters who have conquered the New World using everything at their disposal. Embark on this quest that will challenge you and may the Sapphire Star light your way!'),(1029,67835,'de',NULL,NULL,NULL),(1030,67835,'en','Wearer of the Iceborne Crown','Slay a Velkhana','We salute all hunters who have conquered the New World using everything at their disposal. Embark on this quest that will challenge you and may the Sapphire Star light your way!'),(1031,67836,'de',NULL,NULL,NULL),(1032,67836,'en','USJ: Ballet of Frost','Hunt a Frostfang Barioth','Special delivery from USJ to you: the perfect stage for you to duel with a monster with fangs of frost! May the excitement never end! (Special material rewards)'),(1033,67837,'de',NULL,NULL,NULL),(1034,67837,'en','Aiming for the Light','Slay a Namielle','We salute all hunters who have conquered the New World using everything at their disposal. Embark on this quest that will challenge you and may the Sapphire Star light your way!'),(1035,67838,'de',NULL,NULL,NULL),(1036,67838,'en','All That Glitters is Furious','Hunt a Furious Rajang','We know of the Furious Rajang, but only just that. Do you know why? Because when it spots you, it\'s already over. Can our Sapphire Star stand up to the golden fury?'),(1037,67839,'de',NULL,NULL,NULL),(1038,67839,'en','Fear No Scars','Slay a Scarred Yian Garuga','We salute all hunters who have conquered the New World using everything at their disposal. Embark on this quest that will challenge you and may the Sapphire Star light your way!'),(1039,67840,'de',NULL,NULL,NULL),(1040,67840,'en','Power and Technique','Slay all target monsters','We salute all hunters who have conquered the New World using everything at their disposal. Embark on this quest that will challenge you and may the Sapphire Star light your way!'),(1041,67841,'de',NULL,NULL,NULL),(1042,67841,'en','Achy Brachy Heart','Slay a Raging Brachydios','My senior hunting friend went off to slay a Raging Brachydios once, and when I asked about it she just said, \"I just don\'t think you\'d understand.\" Can you believe that? I almost blew up at her! Now I have to go see it for myself.');
